}

.0 + i as f32 + 1.0) + 1.0 / (60.0 + i as f32 + 1.0);\n                combined_scores.push(black_box(dense + sparse + rrf_score));\n            }\n            black_box(combined_scores)\n        });\n    });\n\n    group.finish();\n}\n\n/// Benchmark for concurrent operations\nfn benchmark_concurrent_processing(c: \u0026mut Criterion) {\n    let mut group = c.benchmark_group(\"concurrent_processing\");\n\n    group.bench_function(\"parallel_document_processing\", |b| {\n        let documents: Vec\u003cString\u003e = (0..100).map(|i| format!(\"Document {}\", i)).collect();\n\n        b.iter(|| {\n            use std::thread;\n            let handles: Vec\u003c_\u003e = documents\n                .chunks(10)\n                .map(|chunk| {\n                    let chunk = chunk.to_vec();\n                    thread::spawn(move || {\n                        chunk.iter().map(|doc| black_box(doc.len())).sum::\u003cusize\u003e()\n                    })\n                })\n                .collect();\n\n            let results: Vec\u003c_\u003e = handles.into_iter().map(|h| h.join().unwrap()).collect();\n            black_box(results)\n        });\n    });\n\n    group.finish();\n}\n\ncriterion_group!(\n    benches,\n    benchmark_document_processing,\n    benchmark_search_operations,\n    benchmark_concurrent_processing\n);\ncriterion_main!(benches);","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","build.rs"],"content":"use std::env;\nuse std::path::PathBuf;\n\nfn main() -\u003e Result\u003c(), Box\u003cdyn std::error::Error\u003e\u003e {\n    let out_dir = PathBuf::from(env::var(\"OUT_DIR\").unwrap());\n\n    tonic_build::configure()\n        .build_server(true)\n        .build_client(true)\n        .file_descriptor_set_path(out_dir.join(\"workspace_daemon_descriptor.bin\"))\n        .compile_protos(\n            \u0026[\"proto/workspace_daemon.proto\"],\n            \u0026[\"proto\"],\n        )?;\n\n    // Rerun if proto files change\n    println!(\"cargo:rerun-if-changed=proto/workspace_daemon.proto\");\n\n    Ok(())\n}","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","config.rs"],"content":"//! Configuration management for the Workspace Qdrant Daemon\n\nuse crate::error::DaemonResult;\nuse serde::{Deserialize, Serialize};\nuse std::path::Path;\n\n/// Main daemon configuration\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct DaemonConfig {\n    /// Server configuration\n    pub server: ServerConfig,\n\n    /// Database configuration\n    pub database: DatabaseConfig,\n\n    /// Qdrant configuration\n    pub qdrant: QdrantConfig,\n\n    /// Document processing configuration\n    pub processing: ProcessingConfig,\n\n    /// File watching configuration\n    pub file_watcher: FileWatcherConfig,\n\n    /// Metrics configuration\n    pub metrics: MetricsConfig,\n\n    /// Logging configuration\n    pub logging: LoggingConfig,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct ServerConfig {\n    /// gRPC server host\n    pub host: String,\n\n    /// gRPC server port\n    pub port: u16,\n\n    /// Maximum number of concurrent connections\n    pub max_connections: usize,\n\n    /// Connection timeout in seconds\n    pub connection_timeout_secs: u64,\n\n    /// Request timeout in seconds\n    pub request_timeout_secs: u64,\n\n    /// Enable TLS (for future use)\n    pub enable_tls: bool,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct DatabaseConfig {\n    /// SQLite database file path\n    pub sqlite_path: String,\n\n    /// Maximum number of database connections\n    pub max_connections: u32,\n\n    /// Connection timeout in seconds\n    pub connection_timeout_secs: u64,\n\n    /// Enable WAL mode for better concurrency\n    pub enable_wal: bool,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct QdrantConfig {\n    /// Qdrant server URL\n    pub url: String,\n\n    /// Qdrant API key (optional)\n    pub api_key: Option\u003cString\u003e,\n\n    /// Connection timeout in seconds\n    pub timeout_secs: u64,\n\n    /// Maximum number of retries\n    pub max_retries: u32,\n\n    /// Default collection configuration\n    pub default_collection: CollectionConfig,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct CollectionConfig {\n    /// Vector size for embeddings\n    pub vector_size: usize,\n\n    /// Distance metric (Cosine, Euclidean, Dot)\n    pub distance_metric: String,\n\n    /// Enable payload indexing\n    pub enable_indexing: bool,\n\n    /// Replication factor\n    pub replication_factor: u32,\n\n    /// Number of shards\n    pub shard_number: u32,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct ProcessingConfig {\n    /// Maximum number of concurrent processing tasks\n    pub max_concurrent_tasks: usize,\n\n    /// Default chunk size for documents\n    pub default_chunk_size: usize,\n\n    /// Default chunk overlap\n    pub default_chunk_overlap: usize,\n\n    /// Maximum file size to process (in bytes)\n    pub max_file_size_bytes: u64,\n\n    /// Supported file extensions\n    pub supported_extensions: Vec\u003cString\u003e,\n\n    /// Enable LSP integration\n    pub enable_lsp: bool,\n\n    /// LSP server timeout in seconds\n    pub lsp_timeout_secs: u64,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct FileWatcherConfig {\n    /// Enable file watching\n    pub enabled: bool,\n\n    /// Debounce delay in milliseconds\n    pub debounce_ms: u64,\n\n    /// Maximum number of watched directories\n    pub max_watched_dirs: usize,\n\n    /// Patterns to ignore\n    pub ignore_patterns: Vec\u003cString\u003e,\n\n    /// Enable recursive watching\n    pub recursive: bool,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct MetricsConfig {\n    /// Enable metrics collection\n    pub enabled: bool,\n\n    /// Metrics collection interval in seconds\n    pub collection_interval_secs: u64,\n\n    /// Metrics retention period in days\n    pub retention_days: u32,\n\n    /// Enable Prometheus metrics export\n    pub enable_prometheus: bool,\n\n    /// Prometheus metrics port\n    pub prometheus_port: u16,\n}\n\n#[derive(Debug, Clone, Serialize, Deserialize)]\npub struct LoggingConfig {\n    /// Log level (trace, debug, info, warn, error)\n    pub level: String,\n\n    /// Log file path (optional)\n    pub file_path: Option\u003cString\u003e,\n\n    /// Enable JSON logging\n    pub json_format: bool,\n\n    /// Maximum log file size in MB\n    pub max_file_size_mb: u64,\n\n    /// Maximum number of log files to keep\n    pub max_files: u32,\n}\n\nimpl Default for DaemonConfig {\n    fn default() -\u003e Self {\n        Self {\n            server: ServerConfig {\n                host: \"127.0.0.1\".to_string(),\n                port: 50051,\n                max_connections: 1000,\n                connection_timeout_secs: 30,\n                request_timeout_secs: 300,\n                enable_tls: false,\n            },\n            database: DatabaseConfig {\n                sqlite_path: \"./workspace_daemon.db\".to_string(),\n                max_connections: 10,\n                connection_timeout_secs: 30,\n                enable_wal: true,\n            },\n            qdrant: QdrantConfig {\n                url: \"http://localhost:6333\".to_string(),\n                api_key: None,\n                timeout_secs: 30,\n                max_retries: 3,\n                default_collection: CollectionConfig {\n                    vector_size: 384, // sentence-transformers/all-MiniLM-L6-v2\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    replication_factor: 1,\n                    shard_number: 1,\n                },\n            },\n            processing: ProcessingConfig {\n                max_concurrent_tasks: 4,\n                default_chunk_size: 1000,\n                default_chunk_overlap: 200,\n                max_file_size_bytes: 100 * 1024 * 1024, // 100MB\n                supported_extensions: vec![\n                    \"rs\".to_string(),\n                    \"py\".to_string(),\n                    \"js\".to_string(),\n                    \"ts\".to_string(),\n                    \"md\".to_string(),\n                    \"txt\".to_string(),\n                    \"pdf\".to_string(),\n                    \"html\".to_string(),\n                    \"json\".to_string(),\n                    \"xml\".to_string(),\n                ],\n                enable_lsp: true,\n                lsp_timeout_secs: 10,\n            },\n            file_watcher: FileWatcherConfig {\n                enabled: true,\n                debounce_ms: 500,\n                max_watched_dirs: 100,\n                ignore_patterns: vec![\n                    \"target/**\".to_string(),\n                    \"node_modules/**\".to_string(),\n                    \".git/**\".to_string(),\n                    \"*.tmp\".to_string(),\n                    \"*.log\".to_string(),\n                ],\n                recursive: true,\n            },\n            metrics: MetricsConfig {\n                enabled: true,\n                collection_interval_secs: 60,\n                retention_days: 30,\n                enable_prometheus: true,\n                prometheus_port: 9090,\n            },\n            logging: LoggingConfig {\n                level: \"info\".to_string(),\n                file_path: Some(\"./workspace_daemon.log\".to_string()),\n                json_format: false,\n                max_file_size_mb: 100,\n                max_files: 5,\n            },\n        }\n    }\n}\n\nimpl DaemonConfig {\n    /// Load configuration from file or use defaults\n    pub fn load(config_path: Option\u003c\u0026Path\u003e) -\u003e DaemonResult\u003cSelf\u003e {\n        match config_path {\n            Some(path) =\u003e {\n                let content = std::fs::read_to_string(path)?;\n                let config: DaemonConfig = serde_yaml::from_str(\u0026content)\n                    .map_err(|e| crate::error::DaemonError::Config(\n                        config::ConfigError::Message(format!(\"Invalid YAML: {}\", e))\n                    ))?;\n                Ok(config)\n            },\n            None =\u003e {\n                // Try to load from environment variables\n                Self::from_env()\n            }\n        }\n    }\n\n    /// Load configuration from environment variables\n    fn from_env() -\u003e DaemonResult\u003cSelf\u003e {\n        let mut config = Self::default();\n\n        // Override with environment variables if present\n        if let Ok(url) = std::env::var(\"QDRANT_URL\") {\n            config.qdrant.url = url;\n        }\n\n        if let Ok(api_key) = std::env::var(\"QDRANT_API_KEY\") {\n            config.qdrant.api_key = Some(api_key);\n        }\n\n        if let Ok(host) = std::env::var(\"DAEMON_HOST\") {\n            config.server.host = host;\n        }\n\n        if let Ok(port) = std::env::var(\"DAEMON_PORT\") {\n            config.server.port = port.parse()\n                .map_err(|e| crate::error::DaemonError::Config(\n                    config::ConfigError::Message(format!(\"Invalid port: {}\", e))\n                ))?;\n        }\n\n        if let Ok(db_path) = std::env::var(\"DAEMON_DB_PATH\") {\n            config.database.sqlite_path = db_path;\n        }\n\n        Ok(config)\n    }\n\n    /// Save configuration to file\n    pub fn save(\u0026self, path: \u0026Path) -\u003e DaemonResult\u003c()\u003e {\n        let content = serde_yaml::to_string(self)\n            .map_err(|e| crate::error::DaemonError::Config(\n                config::ConfigError::Message(format!(\"Serialization error: {}\", e))\n            ))?;\n        std::fs::write(path, content)?;\n        Ok(())\n    }\n\n    /// Validate configuration\n    pub fn validate(\u0026self) -\u003e DaemonResult\u003c()\u003e {\n        // Validate server configuration\n        if self.server.port == 0 {\n            return Err(crate::error::DaemonError::Config(\n                config::ConfigError::Message(\"Server port cannot be 0\".to_string())\n            ));\n        }\n\n        // Validate Qdrant URL\n        if self.qdrant.url.is_empty() {\n            return Err(crate::error::DaemonError::Config(\n                config::ConfigError::Message(\"Qdrant URL cannot be empty\".to_string())\n            ));\n        }\n\n        // Validate database path\n        if self.database.sqlite_path.is_empty() {\n            return Err(crate::error::DaemonError::Config(\n                config::ConfigError::Message(\"Database path cannot be empty\".to_string())\n            ));\n        }\n\n        // Validate processing configuration\n        if self.processing.default_chunk_size == 0 {\n            return Err(crate::error::DaemonError::Config(\n                config::ConfigError::Message(\"Chunk size must be greater than 0\".to_string())\n            ));\n        }\n\n        Ok(())\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use std::env;\n    use tempfile::tempdir;\n    use std::fs::File;\n    use std::io::Write;\n\n    #[test]\n    fn test_daemon_config_default() {\n        let config = DaemonConfig::default();\n\n        // Test server defaults\n        assert_eq!(config.server.host, \"127.0.0.1\");\n        assert_eq!(config.server.port, 50051);\n        assert_eq!(config.server.max_connections, 1000);\n        assert_eq!(config.server.connection_timeout_secs, 30);\n        assert_eq!(config.server.request_timeout_secs, 300);\n        assert!(!config.server.enable_tls);\n\n        // Test database defaults\n        assert_eq!(config.database.sqlite_path, \"./workspace_daemon.db\");\n        assert_eq!(config.database.max_connections, 10);\n        assert_eq!(config.database.connection_timeout_secs, 30);\n        assert!(config.database.enable_wal);\n\n        // Test qdrant defaults\n        assert_eq!(config.qdrant.url, \"http://localhost:6333\");\n        assert!(config.qdrant.api_key.is_none());\n        assert_eq!(config.qdrant.timeout_secs, 30);\n        assert_eq!(config.qdrant.max_retries, 3);\n        assert_eq!(config.qdrant.default_collection.vector_size, 384);\n        assert_eq!(config.qdrant.default_collection.distance_metric, \"Cosine\");\n        assert!(config.qdrant.default_collection.enable_indexing);\n        assert_eq!(config.qdrant.default_collection.replication_factor, 1);\n        assert_eq!(config.qdrant.default_collection.shard_number, 1);\n\n        // Test processing defaults\n        assert_eq!(config.processing.max_concurrent_tasks, 4);\n        assert_eq!(config.processing.default_chunk_size, 1000);\n        assert_eq!(config.processing.default_chunk_overlap, 200);\n        assert_eq!(config.processing.max_file_size_bytes, 100 * 1024 * 1024);\n        assert!(config.processing.supported_extensions.contains(\u0026\"rs\".to_string()));\n        assert!(config.processing.supported_extensions.contains(\u0026\"py\".to_string()));\n        assert!(config.processing.enable_lsp);\n        assert_eq!(config.processing.lsp_timeout_secs, 10);\n\n        // Test file watcher defaults\n        assert!(config.file_watcher.enabled);\n        assert_eq!(config.file_watcher.debounce_ms, 500);\n        assert_eq!(config.file_watcher.max_watched_dirs, 100);\n        assert!(config.file_watcher.ignore_patterns.contains(\u0026\"target/**\".to_string()));\n        assert!(config.file_watcher.ignore_patterns.contains(\u0026\"node_modules/**\".to_string()));\n        assert!(config.file_watcher.recursive);\n\n        // Test metrics defaults\n        assert!(config.metrics.enabled);\n        assert_eq!(config.metrics.collection_interval_secs, 60);\n        assert_eq!(config.metrics.retention_days, 30);\n        assert!(config.metrics.enable_prometheus);\n        assert_eq!(config.metrics.prometheus_port, 9090);\n\n        // Test logging defaults\n        assert_eq!(config.logging.level, \"info\");\n        assert_eq!(config.logging.file_path, Some(\"./workspace_daemon.log\".to_string()));\n        assert!(!config.logging.json_format);\n        assert_eq!(config.logging.max_file_size_mb, 100);\n        assert_eq!(config.logging.max_files, 5);\n    }\n\n    #[test]\n    fn test_daemon_config_debug_clone() {\n        let config = DaemonConfig::default();\n        let cloned = config.clone();\n\n        assert_eq!(config.server.host, cloned.server.host);\n        assert_eq!(config.qdrant.url, cloned.qdrant.url);\n\n        // Test debug format\n        let debug_str = format!(\"{:?}\", config);\n        assert!(debug_str.contains(\"DaemonConfig\"));\n        assert!(debug_str.contains(\"ServerConfig\"));\n    }\n\n    #[test]\n    fn test_load_config_from_file() {\n        let dir = tempdir().unwrap();\n        let file_path = dir.path().join(\"config.yaml\");\n        let mut file = File::create(\u0026file_path).unwrap();\n\n        writeln!(file, r#\"\nserver:\n  host: \"0.0.0.0\"\n  port: 8080\n  max_connections: 500\n  connection_timeout_secs: 60\n  request_timeout_secs: 600\n  enable_tls: true\nqdrant:\n  url: \"http://remote-qdrant:6333\"\n  api_key: \"test-key\"\n  timeout_secs: 45\n  max_retries: 5\n  default_collection:\n    vector_size: 512\n    distance_metric: \"Euclidean\"\n    enable_indexing: false\n    replication_factor: 2\n    shard_number: 3\ndatabase:\n  sqlite_path: \"/custom/path.db\"\n  max_connections: 20\n  connection_timeout_secs: 45\n  enable_wal: false\nprocessing:\n  max_concurrent_tasks: 8\n  default_chunk_size: 2000\n  default_chunk_overlap: 400\n  max_file_size_bytes: 200000000\n  supported_extensions: [\"rs\", \"py\"]\n  enable_lsp: false\n  lsp_timeout_secs: 20\nfile_watcher:\n  enabled: false\n  debounce_ms: 1000\n  max_watched_dirs: 50\n  ignore_patterns: [\"*.log\"]\n  recursive: false\nmetrics:\n  enabled: false\n  collection_interval_secs: 120\n  retention_days: 60\n  enable_prometheus: false\n  prometheus_port: 9091\nlogging:\n  level: \"debug\"\n  file_path: \"/custom/log.log\"\n  json_format: true\n  max_file_size_mb: 200\n  max_files: 10\n\"#).unwrap();\n\n        let config = DaemonConfig::load(Some(\u0026file_path)).unwrap();\n\n        assert_eq!(config.server.host, \"0.0.0.0\");\n        assert_eq!(config.server.port, 8080);\n        assert_eq!(config.server.max_connections, 500);\n        assert_eq!(config.server.connection_timeout_secs, 60);\n        assert_eq!(config.server.request_timeout_secs, 600);\n        assert!(config.server.enable_tls);\n\n        assert_eq!(config.qdrant.url, \"http://remote-qdrant:6333\");\n        assert_eq!(config.qdrant.api_key, Some(\"test-key\".to_string()));\n        assert_eq!(config.qdrant.timeout_secs, 45);\n        assert_eq!(config.qdrant.max_retries, 5);\n        assert_eq!(config.qdrant.default_collection.vector_size, 512);\n        assert_eq!(config.qdrant.default_collection.distance_metric, \"Euclidean\");\n        assert!(!config.qdrant.default_collection.enable_indexing);\n        assert_eq!(config.qdrant.default_collection.replication_factor, 2);\n        assert_eq!(config.qdrant.default_collection.shard_number, 3);\n\n        assert_eq!(config.database.sqlite_path, \"/custom/path.db\");\n        assert_eq!(config.database.max_connections, 20);\n        assert_eq!(config.database.connection_timeout_secs, 45);\n        assert!(!config.database.enable_wal);\n\n        assert_eq!(config.processing.max_concurrent_tasks, 8);\n        assert_eq!(config.processing.default_chunk_size, 2000);\n        assert_eq!(config.processing.default_chunk_overlap, 400);\n        assert_eq!(config.processing.max_file_size_bytes, 200000000);\n        assert_eq!(config.processing.supported_extensions, vec![\"rs\", \"py\"]);\n        assert!(!config.p me(nonexistent_path));\n        assert!(result.is_err());\n\n        if let Err(crate::error::DaemonError::Io(_)) = result {\n            // Expected error type\n        } else {\n            panic!(\"Expected IO error\");\n        }\n    }\n\n    #[test]\n    fn test_from_env() {\n        // Save original env vars\n        let original_qdrant_url = env::var(\"QDRANT_URL\").ok();\n        let original_qdrant_api_key = env::var(\"QDRANT_API_KEY\").ok();\n        let original_daemon_host = env::var(\"DAEMON_HOST\").ok();\n        let original_daemon_port = env::var(\"DAEMON_PORT\").ok();\n        let original_daemon_db_path = env::var(\"DAEMON_DB_PATH\").ok();\n\n        // Set test env vars\n        env::set_var(\"QDRANT_URL\", \"http://test-qdrant:6333\");\n        env::set_var(\"QDRANT_API_KEY\", \"test-api-key\");\n        env::set_var(\"DAEMON_HOST\", \"0.0.0.0\");\n        env::set_var(\"DAEMON_PORT\", \"8080\");\n        env::set_var(\"DAEMON_DB_PATH\", \"/test/db.sqlite\");\n\n        let config = DaemonConfig::from_env().unwrap();\n\n        assert_eq!(config.qdrant.url, \"http://test-qdrant:6333\");\n        assert_eq!(config.qdrant.api_key, Some(\"test-api-key\".to_string()));\n        assert_eq!(config.server.host, \"0.0.0.0\");\n        assert_eq!(config.server.port, 8080);\n        assert_eq!(config.database.sqlite_path, \"/test/db.sqlite\");\n\n        // Restore original env vars\n        match original_qdrant_url {\n            Some(val) =\u003e env::set_var(\"QDRANT_URL\", val),\n            None =\u003e env::remove_var(\"QDRANT_URL\"),\n        }\n        match original_qdrant_api_key {\n            Some(val) =\u003e env::set_var(\"QDRANT_API_KEY\", val),\n            None =\u003e env::remove_var(\"QDRANT_API_KEY\"),\n        }\n        match original_daemon_host {\n            Some(val) =\u003e env::set_var(\"DAEMON_HOST\", val),\n            None =\u003e env::remove_var(\"DAEMON_HOST\"),\n        }\n        match original_daemon_port {\n ze, cloned.vector_size);\n        assert_eq!(collection_config.distance_metric, cloned.distance_metric);\n    }\n\n    #[test]\n    fn test_config_with_serde_defaults() {\n        // Test that all config structs can be created with minimal YAML\n        // This tests basic serialization/deserialization\n        let minimal_yaml = r#\"\nserver:\n  host: \"custom-host\"\n  port: 9999\n  max_connections: 500\n  connection_timeout_secs: 30\n  request_timeout_secs: 300\n  enable_tls: false\nqdrant:\n  url: \"http://custom-qdrant:6333\"\n  api_key: null\n  timeout_secs: 30\n  max_retries: 3\n  default_collection:\n    vector_size: 384\n    distance_metric: \"Cosine\"\n    enable_indexing: true\n    replication_factor: 1\n    shard_number: 1\ndatabase:\n  sqlite_path: \"./workspace_daemon.db\"\n  max_connections: 10\n  connection_timeout_secs: 30\n  enable_wal: true\nprocessing:\n  max_concurrent_tasks: 4\n  default_chunk_size: 1000\n  default_chunk_overlap: 200\n  max_file_size_bytes: 104857600\n  supported_extensions: [\"rs\", \"py\"]\n  enable_lsp: true\n  lsp_timeout_secs: 10\nfile_watcher:\n  enabled: true\n  debounce_ms: 500\n  max_watched_dirs: 100\n  ignore_patterns: [\"target/**\"]\n  recursive: true\nmetrics:\n  enabled: true\n  collection_interval_secs: 60\n  retention_days: 30\n  enable_prometheus: true\n  prometheus_port: 9090\nlogging:\n  level: \"info\"\n  file_path: \"./workspace_daemon.log\"\n  json_format: false\n  max_file_size_mb: 100\n  max_files: 5\n\"#;\n\n        let config: DaemonConfig = serde_yaml::from_str(minimal_yaml).unwrap();\n\n        // Custom fields should be set\n        assert_eq!(config.server.host, \"custom-host\");\n        assert_eq!(config.server.port, 9999);\n        assert_eq!(config.qdrant.url, \"http://custom-qdrant:6333\");\n    }\n}","traces":[{"line":183,"address":[],"length":0,"stats":{"Line":11}},{"line":185,"address":[],"length":0,"stats":{"Line":22}},{"line":193,"address":[],"length":0,"stats":{"Line":22}},{"line":199," "line":20,"address":[],"length":0,"stats":{"Line":1}},{"line":21,"address":[],"length":0,"stats":{"Line":1}},{"line":22,"address":[],"length":0,"stats":{"Line":1}},{"line":23,"address":[],"length":0,"stats":{"Line":1}},{"line":24,"address":[],"length":0,"stats":{"Line":1}},{"line":30,"address":[],"length":0,"stats":{"Line":2}},{"line":32,"address":[],"length":0,"stats":{"Line":2}}],"covered":11,"coverable":11},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","daemon","mod.rs"],"content":"//! Core daemon implementation for workspace document processing\n\npub mod core;\npub mod state;\npub mod processing;\npub mod watcher;\n\nuse crate::config::DaemonConfig;\nuse crate::error::{DaemonError, DaemonResult};\nuse std::sync::Arc;\nuse tokio::sync::RwLock;\nuse tracing::{info, warn};\n\n/// Main daemon coordinator\n#[derive(Debug, Clone)]\npub struct WorkspaceDaemon {\n    config: DaemonConfig,\n    state: Arc\u003cRwLock\u003cstate::DaemonState\u003e\u003e,\n    processing: Arc\u003cprocessing::DocumentProcessor\u003e,\n    watcher: Option\u003cArc\u003cwatcher::FileWatcher\u003e\u003e,\n}\n\nimpl WorkspaceDaemon {\n    /// Create a new daemon instance\n    pub async fn new(config: DaemonConfig) -\u003e DaemonResult\u003cSelf\u003e {\n        // Validate configuration\n        config.validate()?;\n\n        info!(\"Initializing Workspace Daemon with config: {:?}\", config);\n\n        // Initialize state management\n        let state = Arc::new(RwLock::new(\n            state::DaemonState::new(\u0026config.database).await?\n        ));\n\n        // Initialize document processor\n        let processing = Arc::new(\n            processing::DocumentProcessor::new(\u0026config.processing, \u0026config.qdrant).await?\n        );\n\n        // Initialize file watcher if enabled\n        let watcher = if config.file_watcher.enabled {\n            Some(Arc::new(\n                watcher::FileWatcher::new(\u0026config.file_watcher, Arc::clone(\u0026processing)).await?\n            ))\n        } else {\n            None\n        };\n\n        Ok(Self {\n            config,\n            state,\n            processing,\n            watcher,\n        })\n    }\n\n    /// Start all daemon services\n    pub async fn start(\u0026mut self) -\u003e DaemonResult\u003c()\u003e {\n        info!(\"Starting daemon services\");\n\n        // Start file watcher if enabled\n        if let Some(ref watcher) = self.watcher {\n            watcher.start().await?;\n            info!(\"File watcher started\");\n        }\n\n        info!(\"All daemon services started successfully\");\n        Ok(())\n    }\n\n    /// Stop all daemon services\n    pub async fn stop(\u0026mut self) -\u003e DaemonResult\u003c()\u003e {\n        info!(\"Stopping daemon services\");\n\n        // Stop file watcher\n        if let Some(ref watcher) = self.watcher {\n            watcher.stop().await?;\n            info!(\"File watcher stopped\");\n        }\n\n        info!(\"All daemon services stopped\");\n        Ok(())\n    }\n\n    /// Get daemon configuration\n    pub fn config(\u0026self) -\u003e \u0026DaemonConfig {\n        \u0026self.config\n    }\n\n    /// Get daemon state (read-only)\n    pub async fn state(\u0026self) -\u003e tokio::sync::RwLockReadGuard\u003cstate::DaemonState\u003e {\n        self.state.read().await\n    }\n\n    /// Get daemon state (read-write)\n    pub async fn state_mut(\u0026self) -\u003e tokio::sync::RwLockWriteGuard\u003cstate::DaemonState\u003e {\n        self.state.write().await\n    }\n\n    /// Get document processor\n    pub fn processor(\u0026self) -\u003e \u0026Arc\u003cprocessing::DocumentProcessor\u003e {\n        \u0026self.processing\n    }\n\n    /// Get file watcher\n    pub fn watcher(\u0026self) -\u003e Option\u003c\u0026Arc\u003cwatcher::FileWatcher\u003e\u003e {\n        self.watcher.as_ref()\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::*;\n    use tempfile::TempDir;\n    use tokio_test;\n    use std::path::PathBuf;\n    use uuid::Uuid;\n\n    fn create_test_config() -\u003e DaemonConfig {\n        // Use in-memory SQLite database for tests\n        let db_path = \":memory:\".to_string();\n\n        DaemonConfig {\n            server: ServerConfig {\n                host: \"127.0.0.1\".to_string(),\n                port: 50051,\n                max_connections: 1000,\n                connection_timeout_secs: 30,\n                request_timeout_secs: 300,\n                enable_tls: false,\n            },\n            database: DatabaseConfig {\n                sqlite_path: db_path,\n                max_connections: 5,\n                connection_timeout_secs: 30,\n                enable_wal: true,\n            },\n            qdrant: QdrantConfig {\n                url: \"http://localhost:6333\".to_string(),\n                api_key: None,\n                timeout_secs: 30,\n                max_retries: 3,\n                default_collection: crate::config::CollectionConfig {\n                    vector_size: 384,\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    replication_factor: 1,\n                    shard_number: 1,\n                },\n            },\n            processing: ProcessingConfig {\n                max_concurrent_tasks: 4,\n                default_chunk_size: 1000,\n                default_chunk_overlap: 100,\n                max_file_size_bytes: 1000000,\n                supported_extensions: vec![\"txt\".to_string(), \"md\".to_string()],\n                enable_lsp: false,\n                lsp_timeout_secs: 10,\n            },\n            file_watcher: FileWatcherConfig {\n                enabled: false,\n                debounce_ms: 500,\n                max_watched_dirs: 100,\n                ignore_patterns: vec![],\n                recursive: true,\n            },\n            metrics: crate::config::MetricsConfig {\n                enabled: false,\n                collection_interval_secs: 60,\n                retention_days: 30,\n                enable_prometheus: false,\n                prometheus_port: 9090,\n            },\n            logging: crate::config::LoggingConfig {\n                level: \"info\".to_string(),\n                file_path: None,\n                json_format: false,\n                max_file_size_mb: 100,\n                max_files: 5,\n            },\n        }\n    }\n\n    fn create_test_config_with_watcher() -\u003e DaemonConfig {\n        let mut config = create_test_config();\n        config.file_watcher.enabled = true;\n        config\n    }\n\n    #[tokio::test]\n    async fn test_workspace_daemon_new_success() {\n        let config = create_test_config();\n        let result = WorkspaceDaemon::new(config).await;\n\n        assert!(result.is_ok());\n        let daemon = result.unwrap();\n        assert_eq!(daemon.config().database.max_connections, 5);\n        assert_eq!(daemon.config().qdrant.url, \"http://localhost:6333\");\n        assert!(daemon.watcher().is_none());\n    }\n\n    #[tokio::test]\n    async fn test_workspace_daemon_new_with_watcher() {\n        let config = create_test_config_with_watcher();\n        let result = WorkspaceDaemon::new(config).await;\n\n        assert!(result.is_ok());\n        let daemon = result.unwrap();\n        assert!(daemon.watcher().is_some());\n    }\n\n    #[tokio::test]\n    async fn test_workspace_daemon_debug_format() {\n        let config = create_test_config();\n        let daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        let debug_str = format!(\"{:?}\", daemon);\n        assert!(debug_str.contains(\"WorkspaceDaemon\"));\n    }\n\n    #[tokio::test]\n    async fn test_daemon_config_access() {\n        let config = create_test_config();\n        let original_max_connections = config.database.max_connections;\n        let daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        assert_eq!(daemon.config().database.max_connections, original_max_connections);\n    }\n\n    #[tokio::test]\n    async fn test_daemon_state_access() {\n        let config = create_test_config();\n        let daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        let state = daemon.state().await;\n        // Test that we can access state\n        drop(state);\n\n        let state_mut = daemon.state_mut().await;\n        // Test that we can access mutable state\n        drop(state_mut);\n    }\n\n    #[tokio::test]\n    async fn test_daemon_processor_access() {\n        let config = create_test_config();\n        let daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        let processor1 = daemon.processor();\n        let processor2 = daemon.processor();\n        assert!(Arc::ptr_eq(\u0026processor1, \u0026processor2)); // Should be same Arc\n    }\n\n    #[tokio::test]\n    async fn test_daemon_start_stop_cycle() {\n        let config = create_test_config();\n        let mut daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        // Test start\n        let start_result = daemon.start().await;\n        assert!(start_result.is_ok());\n\n        // Test stop\n        let stop_result = daemon.stop().await;\n        assert!(stop_result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_daemon_start_stop_with_watcher() {\n        let config = create_test_config_with_watcher();\n        let mut daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        // Test start with watcher\n        let start_result = daemon.start().await;\n        assert!(start_result.is_ok());\n\n        // Test stop with watcher\n        let stop_result = daemon.stop().await;\n        assert!(stop_result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_daemon_start_disabled_watcher() {\n        let config = create_test_config(); // watcher disabled\n        let mut daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        let start_result = daemon.start().await;\n        assert!(start_result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_daemon_multiple_start_stop_cycles() {\n        let config = create_test_config();\n        let mut daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        // Multiple start/stop cycles\n        for _ in 0..3 {\n            assert!(daemon.start().await.is_ok());\n            assert!(daemon.stop().await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_daemon_watcher_option_handling() {\n        // Test with watcher disabled\n        let config_disabled = create_test_config();\n        let daemon_disabled = WorkspaceDaemon::new(config_disabled).await.unwrap();\n        assert!(daemon_disabled.watcher().is_none());\n\n        // Test with watcher enabled\n        let config_enabled = create_test_config_with_watcher();\n        let daemon_enabled = WorkspaceDaemon::new(config_enabled).await.unwrap();\n        assert!(daemon_enabled.watcher().is_some());\n    }\n\n    #[tokio::test]\n    async fn test_daemon_concurrent_state_access() {\n        let config = create_test_config();\n        let daemon = Arc::new(WorkspaceDaemon::new(config).await.unwrap());\n\n        let daemon1 = Arc::clone(\u0026daemon);\n        let daemon2 = Arc::clone(\u0026daemon);\n\n        let handle1 = tokio::spawn(async move {\n            let _state = daemon1.state().await;\n            tokio::time::sleep(tokio::time::Duration::from_millis(10)).await;\n        });\n\n        let handle2 = tokio::spawn(async move {\n            let _state = daemon2.state().await;\n            tokio::time::sleep(tokio::time::Duration::from_millis(10)).await;\n        });\n\n        let (r1, r2) = tokio::join!(handle1, handle2);\n        assert!(r1.is_ok());\n        assert!(r2.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_daemon_processor_arc_sharing() {\n        let config = create_test_config();\n        let daemon = WorkspaceDaemon::new(config).await.unwrap();\n\n        let processor1 = daemon.processor();\n        let processor2 = daemon.processor();\n\n        // Both should point to the same Arc\u003cDocumentProcessor\u003e\n        assert!(Arc::ptr_eq(processor1, processor2));\n    }\n\n    #[tokio::test]\n    async fn test_daemon_error_handling_invalid_config() {\n        let mut config = create_test_config();\n\n        // Make config invalid by setting empty URL\n        config.qdrant.url = String::new();\n\n        let result = WorkspaceDaemon::new(config).await;\n        assert!(result.is_err());\n    }\n\n    #[test]\n    fn test_daemon_struct_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cWorkspaceDaemon\u003e();\n        assert_sync::\u003cWorkspaceDaemon\u003e();\n    }\n}","traces":[{"line":25,"address":[],"length":0,"stats":{"Line":194}},{"line":27,"address":[],"length":0,"stats":{"Line":195}},{"line":29,"address":[],"length":0,"stats":{"Line":96}},{"line":32,"address":[],"length":0,"stats":{"Line":96}},{"line":33,"address":[],"length":0,"stats":{"Line":0}},{"line":38,"address":[],"length":0,"stats":{"Line":0}},{"line":42,"address":[],"length":0,"stats":{"Line":96}},{"line":43,"address":[],"length":0,"stats":{"Line":3}},{"line":44,"address":[],"length":0,"stats":{"Line":12}},{"line":47,"address":[],"length":0,"stats":{"Line":93}},{"line":59,"address":[],"length":0,"stats":{"Line":12}},{"line":60,"address":[],"length":0,"stats":{"Line":6}},{"line":63,"address":[],"length":0,"stats":{"Line":7}},{"line":64,"address":[],"length":0,"stats":{"Line":0}},{"line":65,"address":[],"length":0,"stats":{"Line":1}},{"line":68,"address":[],"length":0,"stats":{"Line":6}},{"line":73,"address":[],"length":0,"stats":{"Line":10}},{"line":74,"address":[],"length":0,"stats":{"Line":5}},{"line":77,"address":[],"length":0,"stats":{"Line":6}},{"line":78,"address":[],"length":0,"stats":{"Line":0}},{"line": _err(|e| DaemonError::Internal { message: format!(\"Semaphore error: {}\", e) })?;\n\n        debug!(\"Processing document: {}\", file_path);\n\n        // TODO: Implement actual document processing\n        // This is a placeholder\n        tokio::time::sleep(std::time::Duration::from_millis(100)).await;\n\n        Ok(uuid::Uuid::new_v4().to_string())\n    }\n\n    /// Get processing configuration\n    pub fn config(\u0026self) -\u003e \u0026ProcessingConfig {\n        \u0026self.config\n    }\n\n    /// Create a test instance for testing purposes\n    #[cfg(any(test, feature = \"test-utils\"))]\n    pub fn test_instance() -\u003e Self {\n        let config = ProcessingConfig {\n            max_concurrent_tasks: 2,\n            default_chunk_size: 1000,\n            default_chunk_overlap: 200,\n            max_file_size_bytes: 1024 * 1024,\n            supported_extensions: vec![\"txt\".to_string(), \"md\".to_string()],\n            enable_lsp: false,\n            lsp_timeout_secs: 10,\n        };\n\n        let qdrant_config = QdrantConfig {\n            url: \"http://localhost:6333\".to_string(),\n            api_key: None,\n            timeout_secs: 30,\n            max_retries: 3,\n            default_collection: crate::config::CollectionConfig {\n                vector_size: 384,\n                distance_metric: \"Cosine\".to_string(),\n                enable_indexing: true,\n                replication_factor: 1,\n                shard_number: 1,\n            },\n        };\n\n        let semaphore = Arc::new(Semaphore::new(config.max_concurrent_tasks));\n\n        Self {\n            config,\n            qdrant_config,\n            semaphore,\n        }\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::{ProcessingConfig, QdrantConfig, CollectionConfig};\n    use std::sync::Arc;\n    use tracing_subscriber;\n\n    fn create_test_processing_config() -\u003e ProcessingConfig {\n        ProcessingConfig {\n            max_concurrent_tasks: 2,\n            default_chunk_size: 1000,\n            default_chunk_overlap: 200,\n            max_file_size_bytes: 1024 * 1024,\n            supported_extensions: vec![\"rs\".to_string(), \"py\".to_string()],\n            enable_lsp: true,\n            lsp_timeout_secs: 10,\n        }\n    }\n\n    fn create_test_qdrant_config() -\u003e QdrantConfig {\n        QdrantConfig {\n            url: \"http://localhost:6333\".to_string(),\n            api_key: None,\n            timeout_secs: 30,\n            max_retries: 3,\n            default_collection: CollectionConfig {\n                vector_size: 384,\n                distance_metric: \"Cosine\".to_string(),\n                enable_indexing: true,\n                replication_factor: 1,\n                shard_number: 1,\n            },\n        }\n    }\n\n    #[tokio::test]\n    async fn test_document_processor_new() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        // Test that the processor was created successfully\n        assert_eq!(processor.config().max_concurrent_tasks, 2);\n        assert_eq!(processor.config().default_chunk_size, 1000);\n        assert_eq!(processor.config().default_chunk_overlap, 200);\n        assert_eq!(processor.config().max_file_size_bytes, 1024 * 1024);\n        assert!(processor.config().enable_lsp);\n        assert_eq!(processor.config().lsp_timeout_secs, 10);\n\n        // Test debug formatting\n        let debug_str = format!(\"{:?}\", processor);\n        assert!(debug_str.contains(\"DocumentProcessor\"));\n    }\n\n    #[tokio::test]\n    async fn test_process_document() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        let result = processor.process_document(\"test_file.rs\").await.unwrap();\n\n        // Should return a UUID string\n        assert_eq!(result.len(), 36); // UUID v4 string length\n        assert!(result.contains('-'));\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_processing() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = Arc::new(\n            DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n                .await\n                .unwrap(),\n        );\n\n        let mut handles = vec![];\n\n        // Spawn multiple concurrent tasks\n        for i in 0..4 {\n            let processor_clone = Arc::clone(\u0026processor);\n            let handle = tokio::spawn(async move {\n                processor_clone\n                    .process_document(\u0026format!(\"test_file_{}.rs\", i))\n                    .await\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all tasks to complete\n        let results: Vec\u003c_\u003e = futures_util::future::join_all(handles).await;\n\n        // All tasks should complete successfully\n        for result in results {\n            let task_result = result.unwrap();\n            assert!(task_result.is_ok());\n            let uuid_str = task_result.unwrap();\n            assert_eq!(uuid_str.len(), 36);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_config_access() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        let config = processor.config();\n        assert_eq!(config.max_concurrent_tasks, 2);\n        assert_eq!(config.default_chunk_size, 1000);\n        assert_eq!(config.supported_extensions, vec![\"rs\", \"py\"]);\n    }\n\n    #[tokio::test]\n    async fn test_semaphore_limits() {\n        let mut processing_config = create_test_processing_config();\n        processing_config.max_concurrent_tasks = 1; // Allow only 1 concurrent task\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = Arc::new(\n            DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n                .await\n                .unwrap(),\n        );\n\n        let start_time = std::time::Instant::now();\n\n        let processor1 = Arc::clone(\u0026processor);\n        let processor2 = Arc::clone(\u0026processor);\n\n        let handle1 = tokio::spawn(async move {\n            processor1.process_document(\"test1.rs\").await\n        });\n\n        let handle2 = tokio::spawn(async move {\n            processor2.process_document(\"test2.rs\").await\n        });\n\n        let (result1, result2) = tokio::join!(handle1, handle2);\n\n        // Both should succeed\n        assert!(result1.unwrap().is_ok());\n        assert!(result2.unwrap().is_ok());\n\n        // Should take at least 200ms due to semaphore limiting concurrency\n        let elapsed = start_time.elapsed();\n        assert!(elapsed \u003e= std::time::Duration::from_millis(150));\n    }\n\n    #[tokio::test]\n    async fn test_processor_with_different_configs() {\n        let mut config1 = create_test_processing_config();\n        config1.max_concurrent_tasks = 1;\n        config1.default_chunk_size = 500;\n\n        let mut config2 = create_test_processing_config();\n        config2.max_concurrent_tasks = 5;\n        config2.default_chunk_size = 2000;\n\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor1 = DocumentProcessor::new(\u0026config1, \u0026qdrant_config)\n            .await\n            .unwrap();\n        let processor2 = DocumentProcessor::new(\u0026config2, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        assert_eq!(processor1.config().max_concurrent_tasks, 1);\n        assert_eq!(processor1.config().default_chunk_size, 500);\n\n        assert_eq!(processor2.config().max_concurrent_tasks, 5);\n        assert_eq!(processor2.config().default_chunk_size, 2000);\n    }\n\n    #[tokio::test]\n    async fn test_various_file_extensions() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        let test_files = vec![\n            \"test.rs\",\n            \"script.py\",\n            \"document.md\",\n            \"data.json\",\n            \"page.html\",\n        ];\n\n        for file in test_files {\n            let result = processor.process_document(file).await;\n            assert!(result.is_ok(), \"Failed to process file: {}\", file);\n            let uuid_str = result.unwrap();\n            assert_eq!(uuid_str.len(), 36);\n        }\n    }\n\n    #[test]\n    fn test_instance_creation() {\n        let processor = DocumentProcessor::test_instance();\n\n        // Test that test_instance creates processor with expected config\n        assert_eq!(processor.config().max_concurrent_tasks, 2);\n        assert_eq!(processor.config().default_chunk_size, 1000);\n        assert_eq!(processor.config().default_chunk_overlap, 200);\n        assert_eq!(processor.config().max_file_size_bytes, 1024 * 1024);\n        assert_eq!(processor.config().supported_extensions, vec![\"txt\", \"md\"]);\n        assert!(!processor.config().enable_lsp);\n        assert_eq!(processor.config().lsp_timeout_secs, 10);\n\n        // Test that qdrant_config is properly set\n        assert_eq!(processor.qdrant_config.url, \"http://localhost:6333\");\n        assert_eq!(processor.qdrant_config.api_key, None);\n        assert_eq!(processor.qdrant_config.timeout_secs, 30);\n        assert_eq!(processor.qdrant_config.max_retries, 3);\n        assert_eq!(processor.qdrant_config.default_collection.vector_size, 384);\n        assert_eq!(processor.qdrant_config.default_collection.distance_metric, \"Cosine\");\n        assert!(processor.qdrant_config.default_collection.enable_indexing);\n        assert_eq!(processor.qdrant_config.default_collection.replication_factor, 1);\n        assert_eq!(processor.qdrant_config.default_collection.shard_number, 1);\n    }\n\n    #[tokio::test]\n    async fn test_semaphore_error_handling() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        // Close the semaphore to force an error condition\n        processor.semaphore.close();\n\n        let result = processor.process_document(\"test_file.rs\").await;\n        assert!(result.is_err());\n\n        match result {\n            Err(DaemonError::Internal { message }) =\u003e {\n                assert!(message.contains(\"Semaphore error\"));\n            }\n            _ =\u003e panic!(\"Expected Internal error with semaphore message\"),\n        }\n    }\n\n    #[tokio::test]\n    async fn test_process_document_uuid_generation() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        // Process multiple documents and ensure UUIDs are unique\n        let mut uuids = std::collections::HashSet::new();\n\n        for i in 0..10 {\n            let result = processor.process_document(\u0026format!(\"test_{}.rs\", i)).await.unwrap();\n            assert_eq!(result.len(), 36);\n            assert!(result.contains('-'));\n\n            // Parse as UUID to ensure validity\n            let uuid = uuid::Uuid::parse_str(\u0026result).unwrap();\n            assert_eq!(uuid.get_version_num(), 4); // UUID v4\n\n            // Ensure uniqueness\n            assert!(uuids.insert(result), \"UUID should be unique\");\n        }\n    }\n\n    #[tokio::test]\n    async fn test_processor_configuration_variants() {\n        // Test with minimal configuration\n        let minimal_config = ProcessingConfig {\n            max_concurrent_tasks: 1,\n            default_chunk_size: 100,\n            default_chunk_overlap: 0,\n            max_file_size_bytes: 1024,\n            supported_extensions: vec![],\n            enable_lsp: false,\n            lsp_timeout_secs: 1,\n        };\n\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026minimal_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        assert_eq!(processor.config().max_concurrent_tasks, 1);\n        assert_eq!(processor.config().default_chunk_size, 100);\n        assert_eq!(processor.config().default_chunk_overlap, 0);\n        assert_eq!(processor.config().max_file_size_bytes, 1024);\n        assert!(processor.config().supported_extensions.is_empty());\n        assert!(!processor.config().enable_lsp);\n        assert_eq!(processor.config().lsp_timeout_secs, 1);\n\n        // Test processing with minimal config\n        let result = processor.process_document(\"minimal_test.txt\").await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_processor_configuration_maximal() {\n        // Test with maximal configuration\n        let maximal_config = ProcessingConfig {\n            max_concurrent_tasks: 100,\n            default_chunk_size: 10000,\n            default_chunk_overlap: 2000,\n            max_file_size_bytes: 100 * 1024 * 1024, // 100MB\n            supported_extensions: vec![\n                \"rs\".to_string(), \"py\".to_string(), \"js\".to_string(),\n                \"ts\".to_string(), \"java\".to_string(), \"cpp\".to_string(),\n                \"c\".to_string(), \"h\".to_string(), \"hpp\".to_string(),\n                \"md\".to_string(), \"txt\".to_string(), \"json\".to_string(),\n            ],\n            enable_lsp: true,\n            lsp_timeout_secs: 60,\n        };\n\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026maximal_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        assert_eq!(processor.config().max_concurrent_tasks, 100);\n        assert_eq!(processor.config().default_chunk_size, 10000);\n        assert_eq!(processor.config().default_chunk_overlap, 2000);\n        assert_eq!(processor.config().max_file_size_bytes, 100 * 1024 * 1024);\n        assert_eq!(processor.config().supported_extensions.len(), 12);\n        assert!(processor.config().enable_lsp);\n        assert_eq!(processor.config().lsp_timeout_secs, 60);\n\n        // Test processing with maximal config\n        let result = processor.process_document(\"maximal_test.cpp\").await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_qdrant_config_variants() {\n        let processing_config = create_test_processing_config();\n\n        // Test with API key\n        let qdrant_with_key = QdrantConfig {\n            url: \"https://cloud.qdrant.io\".to_string(),\n            api_key: Some(\"test-api-key\".to_string()),\n            timeout_secs: 60,\n            max_retries: 5,\n            default_collection: CollectionConfig {\n                vector_size: 768,\n                distance_metric: \"Dot\".to_string(),\n                enable_indexing: false,\n                replication_factor: 2,\n                shard_number: 4,\n            },\n        };\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_with_key)\n            .await\n            .unwrap();\n\n        assert_eq!(processor.qdrant_config.url, \"https://cloud.qdrant.io\");\n        assert_eq!(processor.qdrant_config.api_key, Some(\"test-api-key\".to_string()));\n        assert_eq!(processor.qdrant_config.timeout_secs, 60);\n        assert_eq!(processor.qdrant_config.max_retries, 5);\n        assert_eq!(processor.qdrant_config.default_collection.vector_size, 768);\n        assert_eq!(processor.qdrant_config.default_collection.distance_metric, \"Dot\");\n        assert!(!processor.qdrant_config.default_collection.enable_indexing);\n        assert_eq!(processor.qdrant_config.default_collection.replication_factor, 2);\n        assert_eq!(processor.qdrant_config.default_collection.shard_number, 4);\n    }\n\n    #[tokio::test]\n    async fn test_debug_implementation() {\n        let processor = DocumentProcessor::test_instance();\n\n        let debug_str = format!(\"{:?}\", processor);\n        assert!(debug_str.contains(\"DocumentProcessor\"));\n        assert!(debug_str.contains(\"config\"));\n        assert!(debug_str.contains(\"qdrant_config\"));\n        assert!(debug_str.contains(\"semaphore\"));\n    }\n\n    #[tokio::test]\n    async fn test_empty_file_path() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        let result = processor.process_document(\"\").await;\n        assert!(result.is_ok()); // Should handle empty path gracefully\n        let uuid_str = result.unwrap();\n        assert_eq!(uuid_str.len(), 36);\n    }\n\n    #[tokio::test]\n    async fn test_very_long_file_path() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        // Create a very long file path\n        let long_path = \"a\".repeat(1000) + \".rs\";\n        let result = processor.process_document(\u0026long_path).await;\n        assert!(result.is_ok()); // Should handle long paths gracefully\n        let uuid_str = result.unwrap();\n        assert_eq!(uuid_str.len(), 36);\n    }\n\n    #[tokio::test]\n    async fn test_special_characters_in_file_path() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        let special_paths = vec![\n            \"file with spaces.rs\",\n            \"file-with-dashes.py\",\n            \"file_with_underscores.md\",\n            \"file.with.dots.txt\",\n            \"file@with#special$chars%.json\",\n            \"file(with)parentheses.rs\",\n            \"file[with]brackets.py\",\n            \"file{with}braces.md\",\n        ];\n\n        for path in special_paths {\n            let result = processor.process_document(path).await;\n            assert!(result.is_ok(), \"Failed to process file: {}\", path);\n            let uuid_str = result.unwrap();\n            assert_eq!(uuid_str.len(), 36);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_unicode_file_paths() {\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        let unicode_paths = vec![\n            \"файл.rs\", // Russian\n            \"文件.py\", // Chinese\n            \"ファイル.md\", // Japanese\n            \"파일.txt\", // Korean\n            \"αρχείο.json\", // Greek\n            \"फ़ाइल.rs\", // Hindi\n            \"🚀rocket.py\", // Emoji\n        ];\n\n        for path in unicode_paths {\n            let result = processor.process_document(path).await;\n            assert!(result.is_ok(), \"Failed to process unicode file: {}\", path);\n            let uuid_str = result.unwrap();\n            assert_eq!(uuid_str.len(), 36);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_debug_logging_coverage() {\n        // This test ensures the debug! logging line is executed\n        // Initialize tracing subscriber to capture debug logs\n        let _ = tracing_subscriber::fmt()\n            .with_max_level(tracing::Level::DEBUG)\n            .try_init();\n\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        // This call will trigger the debug! statement on line 36\n        let result = processor.process_document(\"debug_test.rs\").await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_info_logging_coverage() {\n        // This test ensures the info! logging line is executed\n        // Initialize tracing subscriber to capture info logs\n        let _ = tracing_subscriber::fmt()\n            .with_max_level(tracing::Level::INFO)\n            .try_init();\n\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        // This call will trigger the info! statement on line 20\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        assert_eq!(processor.config().max_concurrent_tasks, 2);\n    }\n\n    #[tokio::test]\n    async fn test_complete_processing_pipeline() {\n        // Comprehensive test that exercises the complete processing pipeline\n        let processing_config = create_test_processing_config();\n        let qdrant_config = create_test_qdrant_config();\n\n        // Test processor creation (covers info! logging)\n        let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config)\n            .await\n            .unwrap();\n\n        // Test configuration access\n        let config = processor.config();\n        assert!(config.enable_lsp);\n        assert_eq!(config.supported_extensions, vec![\"rs\", \"py\"]);\n\n        // Test document processing with various scenarios\n        let test_scenarios = vec![\n            (\"simple.rs\", \"Simple Rust file\"),\n            (\"\", \"Empty path\"),\n            (\"very/deep/nested/path/file.py\", \"Deeply nested path\"),\n            (\"file with spaces.md\", \"Path with spaces\"),\n            (\"αβγ.txt\", \"Unicode filename\"),\n        ];\n\n        for (path, description) in test_scenarios {\n            let result = processor.process_document(path).await;\n            assert!(result.is_ok(), \"Failed to process {}: {}\", description, path);\n\n            let uuid_str = result.unwrap();\n            assert_eq!(uuid_str.len(), 36, \"Invalid UUID length for {}\", description);\n\n            // Verify it's a valid UUID v4\n            let uuid = uuid::Uuid::parse_str(\u0026uuid_str)\n                .expect(\u0026format!(\"Invalid UUID format for {}\", description));\n            assert_eq!(uuid.get_version_num(), 4, \"Expected UUID v4 for {}\", description);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_processor_struct_fields() {\n        // Test to ensure all struct fields are properly initialized and accessible\n        let processor = DocumentProcessor::test_instance();\n\n        // Test config field\n        assert_eq!(processor.config.max_concurrent_tasks, 2);\n        assert_eq!(processor.config.default_chunk_size, 1000);\n        assert_eq!(processor.config.default_chunk_overlap, 200);\n        assert_eq!(processor.config.max_file_size_bytes, 1024 * 1024);\n        assert_eq!(processor.config.supported_extensions, vec![\"txt\", \"md\"]);\n        assert!(!processor.config.enable_lsp);\n        assert_eq!(processor.config.lsp_timeout_secs, 10);\n\n        // Test qdrant_config field\n        assert_eq!(processor.qdrant_config.url, \"http://localhost:6333\");\n        assert_eq!(processor.qdrant_config.api_key, None);\n        assert_eq!(processor.qdrant_config.timeout_secs, 30);\n        assert_eq!(processor.qdrant_config.max_retries, 3);\n        assert_eq!(processor.qdrant_config.default_collection.vector_size, 384);\n        assert_eq!(processor.qdrant_config.default_collection.distance_metric, \"Cosine\");\n        assert!(processor.qdrant_config.default_collection.enable_indexing);\n        assert_eq!(processor.qdrant_config.default_collection.replication_factor, 1);\n        assert_eq!(processor.qdrant_config.default_collection.shard_number, 1);\n\n        // Test semaphore field by verifying it works\n        let permit = processor.semaphore.acquire().await.unwrap();\n        drop(permit); // Release permit\n    }\n}","traces":[{"line":19,"address":[],"length":0,"stats":{"Line":232}},{"line":20,"address":[],"length":0,"stats":{"Line":116}},{"line":22,"address":[],"length":0,"stats":{"Line":464}},{"line":24,"address":[],"length":0,"stats":{"Line":116}},{"line":25,"address":[],"length":0,"stats":{"Line":348}},{"line":26,"address":[],"length":0,"stats":{"Line":232}},{"line":27,"address":[],"length":0,"stats":{"Line":116}},{"line":32,"address":[],"length":0,"stats":{"Line":96}},{"line":33,"address":[],"length":0,"stats":{"Line":95}},{"line":34,"address":[],"length":0,"stats":{"Line":52}},{"line":36,"address":[],"length":0,"stats":{"Line":0}},{"line":42,"address":[],"length":0,"stats":{"Line":47}},{"line":46,"address":[],"length":0,"stats":{"Line":35}},{"line":47,"address":[],"length":0,"stats":{"Line":35}},{"line":52,"address":[],"length":0,"stats":{"Line":43}},{"line":57,"address":[],"length":0,"stats":{"Line":86}},{"line":58,"address":[],"length":0,"stats":{"Line":172}},{"line":64,"address":[],"length":0,"stats":{"Line":129}},{"line":68,"address":[],"length":0,"stats":{"Line":43}},{"line":77,"address":[],"length":0,"stats":{"Line":172}}],"covered":19,"coverable":20},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","daemon","state.rs"],"content":"//! Daemon state management using SQLite\n\nuse crate::config::DatabaseConfig;\nuse crate::error::{DaemonError, DaemonResult};\nuse sqlx::SqlitePool;\nuse tracing::{info, debug};\n\n/// Daemon state manager\n#[derive(Debug)]\npub struct DaemonState {\n    pool: SqlitePool,\n}\n\nimpl DaemonState {\n    /// Create a new state manager\n    pub async fn new(config: \u0026DatabaseConfig) -\u003e DaemonResult\u003cSelf\u003e {\n        info!(\"Initializing database at: {}\", config.sqlite_path);\n\n        let pool = SqlitePool::connect(\u0026config.sqlite_path).await?;\n\n        // Run migrations\n        Self::run_migrations(\u0026pool).await?;\n\n        Ok(Self { pool })\n    }\n\n    /// Run database migrations\n    async fn run_migrations(pool: \u0026SqlitePool) -\u003e DaemonResult\u003c()\u003e {\n        debug!(\"Running database migrations\");\n\n        // Create projects table\n        sqlx::query(r#\"\n            CREATE TABLE IF NOT EXISTS projects (\n                id TEXT PRIMARY KEY,\n                name TEXT NOT NULL,\n                root_path TEXT NOT NULL UNIQUE,\n                git_repository TEXT,\n                git_branch TEXT,\n                metadata TEXT, -- JSON\n                created_at DATETIME DEFAULT CURRENT_TIMESTAMP,\n                updated_at DATETIME DEFAULT CURRENT_TIMESTAMP\n            )\n        \"#)\n        .execute(pool)\n        .await?;\n\n        // Create collections table\n        sqlx::query(r#\"\n            CREATE TABLE IF NOT EXISTS collections (\n                id TEXT PRIMARY KEY,\n                name TEXT NOT NULL,\n                project_id TEXT NOT NULL,\n                config TEXT, -- JSON\n                created_at DATETIME DEFAULT CURRENT_TIMESTAMP,\n                FOREIGN KEY (project_id) REFERENCES projects (id),\n                UNIQUE (name, project_id)\n            )\n        \"#)\n        .execute(pool)\n        .await?;\n\n        // Create processing_operations table\n        sqlx::query(r#\"\n            CREATE TABLE IF NOT EXISTS processing_operations (\n                id TEXT PRIMARY KEY,\n                project_id TEXT,\n                status TEXT NOT NULL,\n                total_documents INTEGER DEFAULT 0,\n                processed_documents INTEGER DEFAULT 0,\n                failed_documents INTEGER DEFAULT 0,\n                error_messages TEXT, -- JSON array\n                started_at DATETIME DEFAULT CURRENT_TIMESTAMP,\n                updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,\n                FOREIGN KEY (project_id) REFERENCES projects (id)\n            )\n        \"#)\n        .execute(pool)\n        .await?;\n\n        info!(\"Database migrations completed\");\n        Ok(())\n    }\n\n    /// Get the connection pool\n    pub fn pool(\u0026self) -\u003e \u0026SqlitePool {\n        \u0026self.pool\n    }\n\n    /// Health check\n    pub async fn health_check(\u0026self) -\u003e DaemonResult\u003c()\u003e {\n        sqlx::query(\"SELECT 1\")\n            .execute(\u0026self.pool)\n            .await?;\n        Ok(())\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use sqlx::Row;\n    use tokio::time::{timeout, Duration};\n\n    fn create_test_db_config() -\u003e DatabaseConfig {\n        DatabaseConfig {\n            sqlite_path: \"sqlite::memory:\".to_string(),\n            max_connections: 1,\n            connection_timeout_secs: 5,\n            enable_wal: false,\n        }\n    }\n\n    fn create_test_db_config_with_wal() -\u003e DatabaseConfig {\n        DatabaseConfig {\n            sqlite_path: \"sqlite::memory:\".to_string(),\n            max_connections: 5,\n            connection_timeout_secs: 10,\n            enable_wal: true,\n        }\n    }\n\n    #[tokio::test]\n    async fn test_daemon_state_new_basic() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test that the state was created successfully\n        assert!(!state.pool().is_closed());\n\n        // Test debug formatting\n        let debug_str = format!(\"{:?}\", state);\n        assert!(debug_str.contains(\"DaemonState\"));\n    }\n\n    #[tokio::test]\n    async fn test_daemon_state_new_with_wal() {\n        let config = create_test_db_config_with_wal();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        assert!(!state.pool().is_closed());\n        state.health_check().await.unwrap();\n    }\n\n    #[tokio::test]\n    async fn test_daemon_state_new_custom_config() {\n        let config = DatabaseConfig {\n            sqlite_path: \"sqlite::memory:\".to_string(),\n            max_connections: 3,\n            connection_timeout_secs: 15,\n            enable_wal: false,\n        };\n\n        let state = DaemonState::new(\u0026config).await.unwrap();\n        assert!(!state.pool().is_closed());\n\n        // Verify logging by checking info! logs are called during initialization\n        // This tests the logging paths in the new() method\n    }\n\n    #[tokio::test]\n    async fn test_health_check_success() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Health check should pass\n        let result = state.health_check().await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_health_check_multiple_calls() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Multiple health checks should all pass\n        for _ in 0..5 {\n            state.health_check().await.unwrap();\n        }\n    }\n\n    #[tokio::test]\n    async fn test_pool_access() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Pool should be accessible\n        let pool = state.pool();\n        assert!(!pool.is_closed());\n\n        // Test that we can use the pool reference\n        sqlx::query(\"SELECT 1\")\n            .execute(pool)\n            .await\n            .unwrap();\n    }\n\n    #[tokio::test]\n    async fn test_migrations_create_all_tables() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Verify all tables were created by querying them\n        let projects_result = sqlx::query(\"SELECT name FROM sqlite_master WHERE type='table' AND name='projects'\")\n            .fetch_optional(state.pool())\n            .await\n            .unwrap();\n        assert!(projects_result.is_some());\n\n        let collections_result = sqlx::query(\"SELECT name FROM sqlite_master WHERE type='table' AND name='collections'\")\n            .fetch_optional(state.pool())\n            .await\n            .unwrap();\n        assert!(collections_result.is_some());\n\n        let processing_ops_result = sqlx::query(\"SELECT name FROM sqlite_master WHERE type='table' AND name='processing_operations'\")\n            .fetch_optional(state.pool())\n            .await\n            .unwrap();\n        assert!(processing_ops_result.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_migrations_table_schema() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test projects table schema\n        let projects_schema = sqlx::query(\"PRAGMA table_info(projects)\")\n            .fetch_all(state.pool())\n            .await\n            .unwrap();\n        assert!(!projects_schema.is_empty());\n\n        // Verify expected columns exist\n        let column_names: Vec\u003cString\u003e = projects_schema\n            .iter()\n            .map(|row| row.get::\u003cString, _\u003e(\"name\"))\n            .collect();\n        assert!(column_names.contains(\u0026\"id\".to_string()));\n        assert!(column_names.contains(\u0026\"name\".to_string()));\n        assert!(column_names.contains(\u0026\"root_path\".to_string()));\n        assert!(column_names.contains(\u0026\"git_repository\".to_string()));\n        assert!(column_names.contains(\u0026\"metadata\".to_string()));\n        assert!(column_names.contains(\u0026\"created_at\".to_string()));\n        assert!(column_names.contains(\u0026\"updated_at\".to_string()));\n    }\n\n    #[tokio::test]\n    async fn test_migrations_collections_schema() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test collections table schema\n        let collections_schema = sqlx::query(\"PRAGMA table_info(collections)\")\n            .fetch_all(state.pool())\n            .await\n            .unwrap();\n        assert!(!collections_schema.is_empty());\n\n        let column_names: Vec\u003cString\u003e = collections_schema\n            .iter()\n            .map(|row| row.get::\u003cString, _\u003e(\"name\"))\n            .collect();\n        assert!(column_names.contains(\u0026\"id\".to_string()));\n        assert!(column_names.contains(\u0026\"name\".to_string()));\n        assert!(column_names.contains(\u0026\"project_id\".to_string()));\n        assert!(column_names.contains(\u0026\"config\".to_string()));\n        assert!(column_names.contains(\u0026\"created_at\".to_string()));\n    }\n\n    #[tokio::test]\n    async fn test_migrations_processing_operations_schema() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test processing_operations table schema\n        let processing_ops_schema = sqlx::query(\"PRAGMA table_info(processing_operations)\")\n            .fetch_all(state.pool())\n            .await\n            .unwrap();\n        assert!(!processing_ops_schema.is_empty());\n\n        let column_names: Vec\u003cString\u003e = processing_ops_schema\n            .iter()\n            .map(|row| row.get::\u003cString, _\u003e(\"name\"))\n            .collect();\n        assert!(column_names.contains(\u0026\"id\".to_string()));\n        assert!(column_names.contains(\u0026\"project_id\".to_string()));\n        assert!(column_names.contains(\u0026\"status\".to_string()));\n        assert!(column_names.contains(\u0026\"total_documents\".to_string()));\n        assert!(column_names.contains(\u0026\"processed_documents\".to_string()));\n        assert!(column_names.contains(\u0026\"failed_documents\".to_string()));\n        assert!(column_names.contains(\u0026\"error_messages\".to_string()));\n        assert!(column_names.contains(\u0026\"started_at\".to_string()));\n        assert!(column_names.contains(\u0026\"updated_at\".to_string()));\n    }\n\n    #[tokio::test]\n    async fn test_migrations_foreign_keys() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Enable foreign key constraints\n        sqlx::query(\"PRAGMA foreign_keys = ON\")\n            .execute(state.pool())\n            .await\n            .unwrap();\n\n        // Test that foreign key constraints work\n        // First, insert a project\n        sqlx::query(\"INSERT INTO projects (id, name, root_path) VALUES ('test-project', 'Test Project', '/test')\")\n            .execute(state.pool())\n            .await\n            .unwrap();\n\n        // Then, insert a collection referencing the project\n        let result = sqlx::query(\"INSERT INTO collections (id, name, project_id) VALUES ('test-collection', 'Test Collection', 'test-project')\")\n            .execute(state.pool())\n            .await;\n        assert!(result.is_ok());\n\n        // Try inserting a collection with invalid project_id (should fail)\n        let invalid_result = sqlx::query(\"INSERT INTO collections (id, name, project_id) VALUES ('invalid-collection', 'Invalid Collection', 'nonexistent-project')\")\n            .execute(state.pool())\n            .await;\n        assert!(invalid_result.is_err());\n    }\n\n    #[tokio::test]\n    async fn test_migrations_unique_constraints() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test unique constraint on projects.root_path\n        sqlx::query(\"INSERT INTO projects (id, name, root_path) VALUES ('project1', 'Project 1', '/same/path')\")\n            .execute(state.pool())\n            .await\n            .unwrap();\n\n        // Second insert with same root_path should fail\n        let duplicate_result = sqlx::query(\"INSERT INTO projects (id, name, root_path) VALUES ('project2', 'Project 2', '/same/path')\")\n            .execute(state.pool())\n            .await;\n        assert!(duplicate_result.is_err());\n    }\n\n    #[tokio::test]\n    async fn test_migrations_default_values() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Insert minimal data to test defaults\n        sqlx::query(\"INSERT INTO projects (id, name, root_path) VALUES ('minimal-project', 'Minimal Project', '/minimal')\")\n            .execute(state.pool())\n            .await\n            .unwrap();\n\n        // Verify default values are set\n        let row = sqlx::query(\"SELECT created_at, updated_at FROM projects WHERE id = 'minimal-project'\")\n            .fetch_one(state.pool())\n            .await\n            .unwrap();\n\n        let created_at: String = row.get(\"created_at\");\n        let updated_at: Strin
