g = row.get(\"updated_at\");\n        assert!(!created_at.is_empty());\n        assert!(!updated_at.is_empty());\n\n        // Test processing_operations defaults\n        sqlx::query(\"INSERT INTO processing_operations (id, status) VALUES ('test-op', 'running')\")\n            .execute(state.pool())\n            .await\n            .unwrap();\n\n        let op_row = sqlx::query(\"SELECT total_documents, processed_documents, failed_documents, started_at FROM processing_operations WHERE id = 'test-op'\")\n            .fetch_one(state.pool())\n            .await\n            .unwrap();\n\n        let total_docs: i64 = op_row.get(\"total_documents\");\n        let processed_docs: i64 = op_row.get(\"processed_documents\");\n        let failed_docs: i64 = op_row.get(\"failed_documents\");\n        let started_at: String = op_row.get(\"started_at\");\n\n        assert_eq!(total_docs, 0);\n        assert_eq!(processed_docs, 0);\n        assert_eq!(failed_docs, 0);\n        assert!(!started_at.is_empty());\n    }\n\n    #[tokio::test]\n    async fn test_invalid_database_path() {\n        let config = DatabaseConfig {\n            sqlite_path: \"/invalid/path/db.sqlite\".to_string(),\n            max_connections: 1,\n            connection_timeout_secs: 5,\n            enable_wal: false,\n        };\n\n        let result = DaemonState::new(\u0026config).await;\n        assert!(result.is_err());\n\n        // Verify it's a database error\n        match result {\n            Err(DaemonError::Database(_)) =\u003e {},\n            _ =\u003e panic!(\"Expected Database error for invalid path\"),\n        }\n    }\n\n    #[tokio::test]\n    async fn test_run_migrations_directly() {\n        let config = create_test_db_config();\n        let pool = SqlitePool::connect(\u0026config.sqlite_path).await.unwrap();\n\n        // Test migrations run successfully\n        let result = DaemonState::run_migrations(\u0026pool).await;\n        assert!(result.is_ok());\n\n        // Test running migrations again (should be idempotent)\n        let result2 = DaemonState::run_migrations(\u0026pool).await;\n        assert!(result2.is_ok());\n\n        // Verify tables exist after direct migration call\n        let tables = sqlx::query(\"SELECT name FROM sqlite_master WHERE type='table' ORDER BY name\")\n            .fetch_all(\u0026pool)\n            .await\n            .unwrap();\n\n        let table_names: Vec\u003cString\u003e = tables.iter().map(|row| row.get::\u003cString, _\u003e(\"name\")).collect();\n        assert!(table_names.contains(\u0026\"projects\".to_string()));\n        assert!(table_names.contains(\u0026\"collections\".to_string()));\n        assert!(table_names.contains(\u0026\"processing_operations\".to_string()));\n    }\n\n    #[tokio::test]\n    async fn test_run_migrations_logging() {\n        let config = create_test_db_config();\n        let pool = SqlitePool::connect(\u0026config.sqlite_path).await.unwrap();\n\n        // This test ensures the debug! logging paths are covered\n        let result = DaemonState::run_migrations(\u0026pool).await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_database_config_variations() {\n        // Test various database configurations\n        let configs = vec![\n            DatabaseConfig {\n                sqlite_path: \"sqlite::memory:\".to_string(),\n                max_connections: 1,\n                connection_timeout_secs: 5,\n                enable_wal: false,\n            },\n            DatabaseConfig {\n                sqlite_path: \"sqlite::memory:\".to_string(),\n                max_connections: 5,\n                connection_timeout_secs: 10,\n                enable_wal: true,\n            },\n            DatabaseConfig {\n                sqlite_path: \"sqlite::memory:\".to_string(),\n                max_connections: 10,\n                connection_timeout_secs: 30,\n                enable_wal: false,\n            },\n        ];\n\n        for config in configs {\n            let state = DaemonState::new(\u0026config).await.unwrap();\n            state.health_check().await.unwrap();\n        }\n    }\n\n    #[tokio::test]\n    async fn test_multiple_state_instances() {\n        let config1 = create_test_db_config();\n        let config2 = create_test_db_config();\n\n        let state1 = DaemonState::new(\u0026config1).await.unwrap();\n        let state2 = DaemonState::new(\u0026config2).await.unwrap();\n\n        // Both should be functional\n        state1.health_check().await.unwrap();\n        state2.health_check().await.unwrap();\n\n        // Test cross-state operations\n        assert!(!state1.pool().is_closed());\n        assert!(!state2.pool().is_closed());\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_health_checks() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Run multiple health checks concurrently\n        let futures = (0..10).map(|_| state.health_check()).collect::\u003cVec\u003c_\u003e\u003e();\n        let results = futures_util::future::try_join_all(futures).await;\n        assert!(results.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_database_operations_after_init() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test basic database operations work after initialization\n        let result = sqlx::query(\"INSERT INTO projects (id, name, root_path) VALUES ('test', 'Test Project', '/test/path')\")\n            .execute(state.pool())\n            .await;\n        assert!(result.is_ok());\n\n        let count: (i64,) = sqlx::query_as(\"SELECT COUNT(*) FROM projects\")\n            .fetch_one(state.pool())\n            .await\n            .unwrap();\n        assert_eq!(count.0, 1);\n    }\n\n    #[tokio::test]\n    async fn test_pool_state_after_operations() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Perform several database operations\n        for i in 0..5 {\n            sqlx::query(\u0026format!(\"INSERT INTO projects (id, name, root_path) VALUES ('project{}', 'Project {}', '/path/{}')\", i, i, i))\n                .execute(state.pool())\n                .await\n                .unwrap();\n        }\n\n        // Pool should still be healthy\n        state.health_check().await.unwrap();\n        assert!(!state.pool().is_closed());\n    }\n\n    #[tokio::test]\n    async fn test_state_debug_formatting() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test comprehensive debug formatting\n        let debug_str = format!(\"{:?}\", state);\n        assert!(debug_str.contains(\"DaemonState\"));\n        assert!(!debug_str.is_empty());\n\n        // Debug should not expose sensitive information\n        assert!(!debug_str.contains(\"password\"));\n        assert!(!debug_str.contains(\"secret\"));\n    }\n\n    #[tokio::test]\n    async fn test_health_check_error_recovery() {\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Verify health check works initially\n        state.health_check().await.unwrap();\n\n        // Pool should remain functional\n        assert!(!state.pool().is_closed());\n\n        // Multiple health checks should continue to work\n        for _ in 0..3 {\n            state.health_check().await.unwrap();\n        }\n    }\n\n    #[tokio::test]\n    async fn test_database_config_edge_cases() {\n        // Test various edge case configurations\n        let edge_configs = vec![\n            DatabaseConfig {\n                sqlite_path: \"sqlite::memory:\".to_string(),\n                max_connections: 1,  // Minimum connections\n                connection_timeout_secs: 1,  // Short timeout\n                enable_wal: false,\n            },\n            DatabaseConfig {\n                sqlite_path: \"sqlite::memory:\".to_string(),\n                max_connections: 100,  // High connections\n                connection_timeout_secs: 300,  // Long timeout\n                enable_wal: true,\n            },\n        ];\n\n        for config in edge_configs {\n            let state = DaemonState::new(\u0026config).await.unwrap();\n            state.health_check().await.unwrap();\n        }\n    }\n\n    #[tokio::test]\n    async fn test_migration_logging_paths() {\n        let config = create_test_db_config();\n\n        // Create state to trigger migration logging\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Verify the state is functional (ensures logging didn't break anything)\n        state.health_check().await.unwrap();\n\n        // Test that pool is accessible after logging\n        let pool = state.pool();\n        assert!(!pool.is_closed());\n    }\n\n    #[tokio::test]\n    async fn test_error_handling_coverage() {\n        // Test various error scenarios to improve coverage\n\n        // Test with completely invalid path format\n        let bad_config = DatabaseConfig {\n            sqlite_path: \"invalid://path\".to_string(),\n            max_connections: 1,\n            connection_timeout_secs: 5,\n            enable_wal: false,\n        };\n\n        let result = DaemonState::new(\u0026bad_config).await;\n        assert!(result.is_err());\n    }\n\n    #[tokio::test]\n    async fn test_all_code_paths_covered() {\n        // This test aims to hit any remaining uncovered code paths\n        let config = create_test_db_config();\n        let state = DaemonState::new(\u0026config).await.unwrap();\n\n        // Test all public methods\n        let pool_ref = state.pool();\n        assert!(!pool_ref.is_closed());\n\n        // Test health check multiple times\n        state.health_check().await.unwrap();\n        state.health_check().await.unwrap();\n\n        // Test debug formatting\n        let _debug = format!(\"{:?}\", state);\n\n        // Test with timeout to ensure async paths are covered\n        let health_result = timeout(Duration::from_secs(5), state.health_check()).await;\n        assert!(health_result.is_ok());\n        assert!(health_result.unwrap().is_ok());\n    }\n}","traces":[{"line":16,"address":[],"length":0,"stats":{"Line":250}},{"line":17,"address":[],"length":0,"stats":{"Line":125}},{"line":19,"address":[],"length":0,"stats":{"Line":375}},{"line":22,"address":[],"length":0,"stats":{"Line":0}},{"line":24,"address":[],"length":0,"stats":{"Line":123}},{"line":28,"address":[],"length":0,"stats":{"Line":252}},{"line":29,"address":[],"length":0,"stats":{"Line":126}},{"line":44,"address":[],"length":0,"stats":{"Line":252}},{"line":45,"address":[],"length":0,"stats":{"Line":126}},{"line":60,"address":[],"length":0,"stats":{"Line":0}},{"line":78,"address":[],"length":0,"stats":{"Line":0}},{"line":80,"address":[],"length":0,"stats":{"Line":126}},{"line":85,"address":[],"length":0,"stats":{"Line":33}},{"line":86,"address":[],"length":0,"stats":{"Line":33}},{"line":90,"address":[],"length":0,"stats":{"Line":66}},{"line":91,"address":[],"length":0,"stats":{"Line":99}},{"line":92,"address":[],"length":0,"stats":{"Line":66}},{"line":93,"address":[],"length":0,"stats":{"Line":33}},{"line":94,"address":[],"length":0,"stats":{"Line":33}}],"covered":16,"coverable":19},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","daemon","watcher.rs"],"content":"//! File system watcher for automatic document processing\n\nuse crate::config::FileWatcherConfig;\nuse crate::daemon::processing::DocumentProcessor;\nuse crate::error::{DaemonError, DaemonResult};\nuse notify::{RecommendedWatcher, RecursiveMode, Event};\nuse std::sync::Arc;\nuse std::path::Path;\nuse tokio::sync::{mpsc, Mutex};\nuse tracing::{info, debug, warn, error};\n\n/// File watcher\n#[derive(Debug)]\npub struct FileWatcher {\n    config: FileWatcherConfig,\n    processor: Arc\u003cDocumentProcessor\u003e,\n    watcher: Arc\u003cMutex\u003cOption\u003cRecommendedWatcher\u003e\u003e\u003e,\n}\n\nimpl FileWatcher {\n    /// Create a new file watcher\n    pub async fn new(config: \u0026FileWatcherConfig, processor: Arc\u003cDocumentProcessor\u003e) -\u003e DaemonResult\u003cSelf\u003e {\n        info!(\"Initializing file watcher (enabled: {})\", config.enabled);\n\n        Ok(Self {\n            config: config.clone(),\n            processor,\n            watcher: Arc::new(Mutex::new(None)),\n        })\n    }\n\n    /// Start watching for file changes\n    pub async fn start(\u0026self) -\u003e DaemonResult\u003c()\u003e {\n        if !self.config.enabled {\n            info!(\"File watcher is disabled\");\n            return Ok(());\n        }\n\n        info!(\"Starting file watcher\");\n\n        // TODO: Implement actual file watching\n        // This is a placeholder implementation\n\n        Ok(())\n    }\n\n    /// Stop watching for file changes\n    pub async fn stop(\u0026self) -\u003e DaemonResult\u003c()\u003e {\n        info!(\"Stopping file watcher\");\n\n        // TODO: Implement actual stop logic\n\n        Ok(())\n    }\n\n    /// Add a directory to watch\n    pub async fn watch_directory\u003cP: AsRef\u003cPath\u003e\u003e(\u0026mut self, path: P) -\u003e DaemonResult\u003c()\u003e {\n        let path = path.as_ref();\n        info!(\"Adding directory to watch: {}\", path.display());\n\n        // TODO: Implement actual directory watching\n\n        Ok(())\n    }\n\n    /// Remove a directory from watching\n    pub async fn unwatch_directory\u003cP: AsRef\u003cPath\u003e\u003e(\u0026mut self, path: P) -\u003e DaemonResult\u003c()\u003e {\n        let path = path.as_ref();\n        info!(\"Removing directory from watch: {}\", path.display());\n\n        // TODO: Implement actual directory unwatching\n\n        Ok(())\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::{FileWatcherConfig, ProcessingConfig, QdrantConfig};\n    use tempfile::TempDir;\n    use std::path::PathBuf;\n    use std::sync::Arc;\n    use tokio_test;\n\n    fn create_test_config(enabled: bool) -\u003e FileWatcherConfig {\n        FileWatcherConfig {\n            enabled,\n            debounce_ms: 100,\n            max_watched_dirs: 10,\n            ignore_patterns: vec![\"*.tmp\".to_string(), \"*.log\".to_string()],\n            recursive: true,\n        }\n    }\n\n    fn create_test_processor() -\u003e Arc\u003cDocumentProcessor\u003e {\n        // Use test instance for reliable testing\n        Arc::new(DocumentProcessor::test_instance())\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_new_enabled() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let result = FileWatcher::new(\u0026config, processor).await;\n        assert!(result.is_ok());\n\n        let watcher = result.unwrap();\n        assert_eq!(watcher.config.enabled, true);\n        assert_eq!(watcher.config.debounce_ms, 100);\n        assert_eq!(watcher.config.max_watched_dirs, 10);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_new_disabled() {\n        let config = create_test_config(false);\n        let processor = create_test_processor();\n\n        let result = FileWatcher::new(\u0026config, processor).await;\n        assert!(result.is_ok());\n\n        let watcher = result.unwrap();\n        assert_eq!(watcher.config.enabled, false);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_debug_format() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n        let debug_str = format!(\"{:?}\", watcher);\n\n        assert!(debug_str.contains(\"FileWatcher\"));\n        assert!(debug_str.contains(\"config\"));\n        assert!(debug_str.contains(\"processor\"));\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_start_enabled() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n        let result = watcher.start().await;\n\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_start_disabled() {\n        let config = create_test_config(false);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n        let result = watcher.start().await;\n\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_stop() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Start then stop\n        assert!(watcher.start().await.is_ok());\n        assert!(watcher.stop().await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_watch_directory() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let temp_dir = TempDir::new().unwrap();\n        let result = watcher.watch_directory(temp_dir.path()).await;\n\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_watch_directory_string_path() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let result = watcher.watch_directory(\"/tmp\").await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_unwatch_directory() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let temp_dir = TempDir::new().unwrap();\n\n        // Watch then unwatch\n        assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n        assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_unwatch_directory_string_path() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let result = watcher.unwatch_directory(\"/tmp\").await;\n        assert!(result.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_multiple_directories() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let temp_dir1 = TempDir::new().unwrap();\n        let temp_dir2 = TempDir::new().unwrap();\n\n        // Watch multiple directories\n        assert!(watcher.watch_directory(temp_dir1.path()).await.is_ok());\n        assert!(watcher.watch_directory(temp_dir2.path()).await.is_ok());\n\n        // Unwatch them\n        assert!(watcher.unwatch_directory(temp_dir1.path()).await.is_ok());\n        assert!(watcher.unwatch_directory(temp_dir2.path()).await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_start_stop_multiple_times() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Multiple start/stop cycles\n        for _ in 0..3 {\n            assert!(watcher.start().await.is_ok());\n            assert!(watcher.stop().await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_config_clone() {\n        let config = create_test_config(true);\n        let config_clone = config.clone();\n\n        assert_eq!(config.enabled, config_clone.enabled);\n        assert_eq!(config.debounce_ms, config_clone.debounce_ms);\n        assert_eq!(config.max_watched_dirs, config_clone.max_watched_dirs);\n        assert_eq!(config.ignore_patterns, config_clone.ignore_patterns);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_processor_arc_sharing() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let processor_clone = Arc::clone(\u0026processor);\n\n        let watcher = FileWatcher::new(\u0026config, processor_clone).await.unwrap();\n\n        // Test that the processor Arc is properly shared\n        assert!(Arc::strong_count(\u0026processor) \u003e= 2);\n    }\n\n    #[test]\n    fn test_file_watcher_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cFileWatcher\u003e();\n        assert_sync::\u003cFileWatcher\u003e();\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_with_ignore_patterns() {\n        let mut config = create_test_config(true);\n        config.ignore_patterns = vec![\n            \"*.tmp\".to_string(),\n            \"*.log\".to_string(),\n            \"target/*\".to_string(),\n        ];\n\n        let processor = create_test_processor();\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        assert_eq!(watcher.config.ignore_patterns.len(), 3);\n        assert!(watcher.config.ignore_patterns.contains(\u0026\"*.tmp\".to_string()));\n        assert!(watcher.config.ignore_patterns.contains(\u0026\"*.log\".to_string()));\n        assert!(watcher.config.ignore_patterns.contains(\u0026\"target/*\".to_string()));\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_with_custom_debounce() {\n        let mut config = create_test_config(true);\n        config.debounce_ms = 1000;\n\n        let processor = create_test_processor();\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        assert_eq!(watcher.config.debounce_ms, 1000);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_with_edge_case_configs() {\n        // Test with zero debounce\n        let mut config = create_test_config(true);\n        config.debounce_ms = 0;\n        config.max_watched_dirs = 0;\n\n        let processor = create_test_processor();\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        assert_eq!(watcher.config.debounce_ms, 0);\n        assert_eq!(watcher.config.max_watched_dirs, 0);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_with_maximal_config() {\n        let mut config = create_test_config(true);\n        config.debounce_ms = u64::MAX;\n        config.max_watched_dirs = usize::MAX;\n        config.ignore_patterns = vec![\n            \"*.tmp\".to_string(),\n            \"*.log\".to_string(),\n            \"target/**\".to_string(),\n            \"node_modules/**\".to_string(),\n            \".git/**\".to_string(),\n            \"*.backup\".to_string(),\n            \"*.swp\".to_string(),\n            \"*~\".to_string(),\n        ];\n        config.recursive = true;\n\n        let processor = create_test_processor();\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        assert_eq!(watcher.config.debounce_ms, u64::MAX);\n        assert_eq!(watcher.config.max_watched_dirs, usize::MAX);\n        assert_eq!(watcher.config.ignore_patterns.len(), 8);\n        assert!(watcher.config.recursive);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_watcher_field_initialization() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Verify the watcher field is properly initialized as None\n        let watcher_guard = watcher.watcher.lock().await;\n        assert!(watcher_guard.is_none());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_processor_field_access() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let processor_weak_count = Arc::weak_count(\u0026processor);\n\n        let watcher = FileWatcher::new(\u0026config, processor.clone()).await.unwrap();\n\n        // Verify processor is properly stored and accessible\n        assert!(Arc::ptr_eq(\u0026watcher.processor, \u0026processor));\n        assert!(Arc::weak_count(\u0026processor) \u003e= processor_weak_count);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_config_field_values() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Verify all config fields are properly cloned and stored\n        assert_eq!(watcher.config.enabled, config.enabled);\n        assert_eq!(watcher.config.debounce_ms, config.debounce_ms);\n        assert_eq!(watcher.config.max_watched_dirs, config.max_watched_dirs);\n        assert_eq!(watcher.config.ignore_patterns, config.ignore_patterns);\n        assert_eq!(watcher.config.recursive, config.recursive);\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_logging_levels() {\n        // Test that logging statements are executed by configuring tracing\n        let _ = tracing_subscriber::fmt()\n            .with_max_level(tracing::Level::DEBUG)\n            .try_init();\n\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        // This will trigger the info! logging on line 23\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // This will trigger the info! logging on line 39\n        assert!(watcher.start().await.is_ok());\n\n        // This will trigger the info! logging on line 49\n        assert!(watcher.stop().await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_disabled_logging() {\n        // Test the disabled path logging\n        let _ = tracing_subscriber::fmt()\n            .with_max_level(tracing::Level::INFO)\n            .try_init();\n\n        let config = create_test_config(false); // disabled\n        let processor = create_test_processor();\n\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // This will trigger the \"File watcher is disabled\" info! logging on line 35\n        assert!(watcher.start().await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_watch_directory_logging() {\n        // Test directory watching logging\n        let _ = tracing_subscriber::fmt()\n            .with_max_level(tracing::Level::INFO)\n            .try_init();\n\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let temp_dir = TempDir::new().unwrap();\n\n        // This will trigger the info! logging on line 59\n        assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_unwatch_directory_logging() {\n        // Test directory unwatching logging\n        let _ = tracing_subscriber::fmt()\n            .with_max_level(tracing::Level::INFO)\n            .try_init();\n\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let temp_dir = TempDir::new().unwrap();\n\n        // This will trigger the info! logging on line 69\n        assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_path_as_ref_implementations() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let temp_dir = TempDir::new().unwrap();\n        let path_buf = temp_dir.path().to_path_buf();\n        let path_str = temp_dir.path().to_str().unwrap();\n\n        // Test different AsRef\u003cPath\u003e implementations\n        assert!(watcher.watch_directory(\u0026path_buf).await.is_ok());\n        assert!(watcher.watch_directory(path_str).await.is_ok());\n        assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n\n        assert!(watcher.unwatch_directory(\u0026path_buf).await.is_ok());\n        assert!(watcher.unwatch_directory(path_str).await.is_ok());\n        assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_complex_paths() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Test complex path scenarios\n        let complex_paths = vec![\n            \"/tmp\",\n            \"/tmp/subdir\",\n            \"./relative/path\",\n            \"../parent/path\",\n            \"/path/with spaces/dir\",\n            \"/path/with-dashes/dir\",\n            \"/path/with_underscores/dir\",\n            \"/path/with.dots/dir\",\n        ];\n\n        for path in complex_paths {\n            assert!(watcher.watch_directory(path).await.is_ok());\n            assert!(watcher.unwatch_directory(path).await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_unicode_paths() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let unicode_paths = vec![\n            \"/tmp/русский\",     // Russian\n            \"/tmp/中文\",         // Chinese\n            \"/tmp/日本語\",       // Japanese\n            \"/tmp/한국어\",       // Korean\n            \"/tmp/ελληνικά\",    // Greek\n            \"/tmp/हिन्दी\",      // Hindi\n            \"/tmp/🚀rocket\",     // Emoji\n        ];\n\n        for path in unicode_paths {\n            assert!(watcher.watch_directory(path).await.is_ok());\n            assert!(watcher.unwatch_directory(path).await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_empty_path() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Test empty path\n        assert!(watcher.watch_directory(\"\").await.is_ok());\n        assert!(watcher.unwatch_directory(\"\").await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_very_long_path() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Test very long path\n        let long_path = format!(\"/tmp/{}\", \"a\".repeat(1000));\n        assert!(watcher.watch_directory(\u0026long_path).await.is_ok());\n        assert!(watcher.unwatch_directory(\u0026long_path).await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_rapid_operations() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Test rapid start/stop operations\n        for _ in 0..10 {\n            assert!(watcher.start().await.is_ok());\n            assert!(watcher.stop().await.is_ok());\n        }\n\n        // Test rapid watch/unwatch operations\n        let temp_dir = TempDir::new().unwrap();\n        for _ in 0..10 {\n            assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n            assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_concurrent_operations() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let watcher = Arc::new(Mutex::new(\n            FileWatcher::new(\u0026config, processor).await.unwrap()\n        ));\n\n        let mut handles = vec![];\n\n        // Spawn concurrent start/stop operations\n        for i in 0..5 {\n            let watcher_clone = Arc::clone(\u0026watcher);\n            let handle = tokio::spawn(async move {\n                let watcher = watcher_clone.lock().await;\n                if i % 2 == 0 {\n                    watcher.start().await\n                } else {\n                    watcher.stop().await\n                }\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all operations to complete\n        let results = futures_util::future::join_all(handles).await;\n\n        // All operations should succeed\n        for result in results {\n            assert!(result.unwrap().is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_concurrent_directory_operations() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let watcher = Arc::new(Mutex::new(\n            FileWatcher::new(\u0026config, processor).await.unwrap()\n        ));\n\n        let temp_dirs: Vec\u003c_\u003e = (0..5).map(|_| TempDir::new().unwrap()).collect();\n        let mut handles = vec![];\n\n        // Spawn concurrent watch operations\n        for (i, temp_dir) in temp_dirs.iter().enumerate() {\n            let watcher_clone = Arc::clone(\u0026watcher);\n            let path = temp_dir.path().to_path_buf();\n            let handle = tokio::spawn(async move {\n                let mut watcher = watcher_clone.lock().await;\n                if i % 2 == 0 {\n                    watcher.watch_directory(\u0026path).await\n                } else {\n                    watcher.unwatch_directory(\u0026path).await\n                }\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all operations to complete\n        let results = futures_util::future::join_all(handles).await;\n\n        // All operations should succeed\n        for result in results {\n            assert!(result.unwrap().is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_stress_test() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Stress test with many operations\n        let temp_dirs: Vec\u003c_\u003e = (0..50).map(|_| TempDir::new().unwrap()).collect();\n\n        // Watch all directories\n        for temp_dir in \u0026temp_dirs {\n            assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n        }\n\n        // Multiple start/stop cycles\n        for _ in 0..20 {\n            assert!(watcher.start().await.is_ok());\n            assert!(watcher.stop().await.is_ok());\n        }\n\n        // Unwatch all directories\n        for temp_dir in \u0026temp_dirs {\n            assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_all_config_combinations() {\n        let processor = create_test_processor();\n\n        // Test all boolean combinations\n        let config_combinations = vec![\n            (true, true),   // enabled, recursive\n            (true, false),  // enabled, not recursive\n            (false, true),  // disabled, recursive\n            (false, false), // disabled, not recursive\n        ];\n\n        for (enabled, recursive) in config_combinations {\n            let mut config = create_test_config(enabled);\n            config.recursive = recursive;\n\n            let watcher = FileWatcher::new(\u0026config, processor.clone()).await.unwrap();\n\n            assert_eq!(watcher.config.enabled, enabled);\n            assert_eq!(watcher.config.recursive, recursive);\n\n            // Test that all operations work regardless of config\n            assert!(watcher.start().await.is_ok());\n            assert!(watcher.stop().await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_config_boundary_values() {\n        let processor = create_test_processor();\n\n        // Test boundary values for numeric fields\n        let boundary_configs = vec![\n            (0, 0),                    // minimum values\n            (1, 1),                    // just above minimum\n            (u64::MAX, usize::MAX),    // maximum values\n            (1000, 100),               // typical values\n        ];\n\n        for (debounce_ms, max_watched_dirs) in boundary_configs {\n            let mut config = create_test_config(true);\n            config.debounce_ms = debounce_ms;\n            config.max_watched_dirs = max_watched_dirs;\n\n            let watcher = FileWatcher::new(\u0026config, processor.clone()).await.unwrap();\n\n            assert_eq!(watcher.config.debounce_ms, debounce_ms);\n            assert_eq!(watcher.config.max_watched_dirs, max_watched_dirs);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_ignore_patterns_variations() {\n        let processor = create_test_processor();\n\n        let pattern_variations = vec![\n            vec![], // empty patterns\n            vec![\"*.tmp\".to_string()], // single pattern\n            vec![\"*.tmp\".to_string(), \"*.log\".to_string()], // multiple patterns\n            vec![\n                \"*.tmp\".to_string(),\n                \"*.log\".to_string(),\n                \"target/**\".to_string(),\n                \"node_modules/**\".to_string(),\n                \".git/**\".to_string(),\n                \"*.backup\".to_string(),\n                \"*.swp\".to_string(),\n                \"*~\".to_string(),\n                \"*.cache\".to_string(),\n                \".DS_Store\".to_string(),\n            ], // many patterns\n        ];\n\n        for patterns in pattern_variations {\n            let mut config = create_test_config(true);\n            config.ignore_patterns = patterns.clone();\n\n            let watcher = FileWatcher::new(\u0026config, processor.clone()).await.unwrap();\n\n            assert_eq!(watcher.config.ignore_patterns, patterns);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_comprehensive_api_coverage() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        // Test the complete API surface\n        let temp_dir = TempDir::new().unwrap();\n\n        // Test all public methods in sequence\n        assert!(watcher.start().await.is_ok());\n        assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n        assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n        assert!(watcher.stop().await.is_ok());\n\n        // Test methods multiple times to ensure state consistency\n        for _ in 0..3 {\n            assert!(watcher.start().await.is_ok());\n            assert!(watcher.watch_directory(temp_dir.path()).await.is_ok());\n            assert!(watcher.unwatch_directory(temp_dir.path()).await.is_ok());\n            assert!(watcher.stop().await.is_ok());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_memory_safety() {\n        // Test that dropping components doesn't cause issues\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n\n        {\n            let watcher = FileWatcher::new(\u0026config, processor.clone()).await.unwrap();\n            assert!(watcher.start().await.is_ok());\n            // watcher is dropped here\n        }\n\n        // Processor should still be valid\n        assert_eq!(processor.config().max_concurrent_tasks, 2);\n\n        // Create another watcher with the same processor\n        let mut watcher2 = FileWatcher::new(\u0026config, processor).await.unwrap();\n        assert!(watcher2.start().await.is_ok());\n        assert!(watcher2.stop().await.is_ok());\n    }\n\n    #[tokio::test]\n    async fn test_file_watcher_struct_debug_format_completeness() {\n        let config = create_test_config(true);\n        let processor = create_test_processor();\n        let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n        let debug_output = format!(\"{:?}\", watcher);\n\n        // Verify debug output contains all expected field names\n        assert!(debug_output.contains(\"FileWatcher\"));\n        assert!(debug_output.contains(\"config\"));\n        assert!(debug_output.contains(\"processor\"));\n        assert!(debug_output.contains(\"watcher\"));\n\n        // Verify debug output contains some config values\n        assert!(debug_output.contains(\"enabled\"));\n        assert!(debug_output.contains(\"debounce_ms\"));\n    }\n\n    #[test]\n    fn test_file_watcher_trait_implementations() {\n        // Verify required trait implementations\n        fn assert_debug\u003cT: std::fmt::Debug\u003e() {}\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_debug::\u003cFileWatcher\u003e();\n        assert_send::\u003cFileWatcher\u003e();\n        assert_sync::\u003cFileWatcher\u003e();\n\n        // Test that the type can be used in various contexts\n        fn _takes_debug(_: impl std::fmt::Debug) {}\n        fn _takes_send(_: impl Send) {}\n        fn _takes_sync(_: impl Sync) {}\n\n        let config = FileWatcherConfig {\n            enabled: true,\n            debounce_ms: 100,\n            max_watched_dirs: 10,\n            ignore_patterns: vec![],\n            recursive: true,\n        };\n        let processor = Arc::new(DocumentProcessor::test_instance());\n\n        // This would be tested in a tokio context, but we're testing trait bounds here\n        // let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n        // _takes_debug(watcher);\n        // _takes_send(watcher);\n        // _takes_sync(watcher);\n    }\n}","traces":[{"line":22,"address":[],"length":0,"stats":{"Line":104}},{"line":23,"address":[],"length":0,"stats":{"Line":52}},{"line":25,"address":[],"length":0,"stats":{"Line":52}},{"line":26,"address":[],"length":0,"stats":{"Line":156}},{"line":27,"address":[],"length":0,"stats":{"Line":104}},{"line":28,"address":[],"length":0,"stats":{"Line":104}},{"line":33,"address":[],"length":0,"stats":{"Line":104}},{"line":34,"address":[],"length":0,"stats":{"Line":52}},{"line":35,"address":[],"length":0,"stats":{"Line":4}},{"line":39,"address":[],"length":0,"stats":{"Line":48}},{"line":44,"address":[],"length":0,"stats":{"Line":48}},{"line":48,"address":[],"length":0,"stats":{"Line":94}},{"line":49,"address":[],"length":0,"stats":{"Line":47}},{"line":53,"address":[],"length":0,"stats":{"Line":47}},{"line":57,"address":[],"length":0,"stats":{"Line":186}},{"line":58,"address":[],"length":0,"stats":{"Line":279}},{"line":59,"address":[],"length":0,"stats":{"Line":93}},{"line":63,"address":[],"length":0,"stats":{"Line":93}},{"line":67,"address":[],"length":0,"stats":{"Line":182}},{"line":68,"address":[],"length":0,"stats":{"Line":273}},{"line":69,"address":[],"length":0,"stats":{"Line":91}},{"line":73,"address":[],"length":0,"stats":{"Line":91}}],"covered":22,"coverable":22},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","error.rs"],"content":"//! Error types for the Workspace Qdrant Daemon\n\nuse thiserror::Error;\nuse tonic::{Code, Status};\n\n/// Main error type for daemon operations\n#[derive(Error, Debug)]\npub enum DaemonError {\n    #[error(\"Configuration error: {0}\")]\n    Config(#[from] config::ConfigError),\n\n    #[error(\"Database error: {0}\")]\n    Database(#[from] sqlx::Error),\n\n    #[error(\"I/O error: {0}\")]\n    Io(#[from] std::io::Error),\n\n    #[error(\"gRPC error: {0}\")]\n    Grpc(#[from] tonic::transport::Error),\n\n    #[error(\"Serialization error: {0}\")]\n    Serialization(#[from] serde_json::Error),\n\n    #[error(\"File watching error: {0}\")]\n    FileWatcher(#[from] notify::Error),\n\n    #[error(\"Git error: {0}\")]\n    Git(#[from] git2::Error),\n\n    #[error(\"HTTP client error: {0}\")]\n    Http(#[from] reqwest::Error),\n\n    #[error(\"Document processing error: {message}\")]\n    DocumentProcessing { message: String },\n\n    #[error(\"Search error: {message}\")]\n    Search { message: String },\n\n    #[error(\"Memory management error: {message}\")]\n    Memory { message: String },\n\n    #[error(\"System error: {message}\")]\n    System { message: String },\n\n    #[error(\"Project detection error: {message}\")]\n    ProjectDetection { message: String },\n\n    #[error(\"Connection pool error: {message}\")]\n    ConnectionPool { message: String },\n\n    #[error(\"Timeout error: operation timed out after {seconds}s\")]\n    Timeout { seconds: u64 },\n\n    #[error(\"Resource not found: {resource}\")]\n    NotFound { resource: String },\n\n    #[error(\"Invalid input: {message}\")]\n    InvalidInput { message: String },\n\n    #[error(\"Internal error: {message}\")]\n    Internal { message: String },\n}\n\nimpl From\u003cDaemonError\u003e for Status {\n    fn from(err: DaemonError) -\u003e Self {\n        match err {\n            DaemonError::Config(_) | DaemonError::InvalidInput { .. } =\u003e {\n                Status::new(Code::InvalidArgument, err.to_string())\n            },\n            DaemonError::NotFound { .. } =\u003e {\n                Status::new(Code::NotFound, err.to_string())\n            },\n            DaemonError::Timeout { .. } =\u003e {\n                Status::new(Code::DeadlineExceeded, err.to_string())\n            },\n            DaemonError::Database(_) | DaemonError::Io(_) | DaemonError::FileWatcher(_) =\u003e {\n                Status::new(Code::Internal, \"Internal server error\")\n            },\n            _ =\u003e Status::new(Code::Internal, \"Internal server error\"),\n        }\n    }\n}\n\n/// Result type alias for daemon operations\npub type DaemonResult\u003cT\u003e = Result\u003cT, DaemonError\u003e;\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use std::io::{Error, ErrorKind};\n\n    #[test]\n    fn test_daemon_error_display() {\n        let err = DaemonError::DocumentProcessing {\n            message: \"Test error\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Document processing error: Test error\");\n\n        let err = DaemonError::Search {\n            message: \"Search failed\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Search error: Search failed\");\n\n        let err = DaemonError::Memory {\n            message: \"Memory allocation failed\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Memory management error: Memory allocation failed\");\n\n        let err = DaemonError::System {\n            message: \"System call failed\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"System error: System call failed\");\n\n        let err = DaemonError::ProjectDetection {\n            message: \"No git repository found\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Project detection error: No git repository found\");\n\n        let err = DaemonError::ConnectionPool {\n            message: \"Pool exhausted\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Connection pool error: Pool exhausted\");\n\n        let err = DaemonError::Timeout { seconds: 30 };\n        assert_eq!(format!(\"{}\", err), \"Timeout error: operation timed out after 30s\");\n\n        let err = DaemonError::NotFound {\n            resource: \"document\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Resource not found: document\");\n\n        let err = DaemonError::InvalidInput {\n            message: \"Invalid format\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Invalid input: Invalid format\");\n\n        let err = DaemonError::Internal {\n            message: \"Unexpected state\".to_string(),\n        };\n        assert_eq!(format!(\"{}\", err), \"Internal error: Unexpected state\");\n    }\n\n    #[test]\n    fn test_daemon_error_debug() {\n        let err = DaemonError::DocumentProcessing {\n            message: \"Test error\".to_string(),\n        };\n        let debug_str = format!(\"{:?}\", err);\n        assert!(debug_str.contains(\"DocumentProcessing\"));\n        assert!(debug_str.contains(\"Test error\"));\n    }\n\n    #[test]\n    fn test_daemon_error_from_io_error() {\n        let io_error = Error::new(ErrorKind::NotFound, \"File not found\");\n        let daemon_error: DaemonError = io_error.into();\n\n        match daemon_error {\n            DaemonError::Io(ref e) =\u003e {\n                assert_eq!(e.kind(), ErrorKind::NotFound);\n                assert_eq!(e.to_string(), \"File not found\");\n            },\n            _ =\u003e panic!(\"Expected DaemonError::Io\"),\n        }\n    }\n\n    #[test]\n    fn test_daemon_error_from_serde_json_error() {\n        let json_error = serde_json::from_str::\u003cserde_json::Value\u003e(\"invalid json\")\n            .unwrap_err();\n        let daemon_error: DaemonError = json_error.into();\n\n        match daemon_error {\n            DaemonError::Serialization(_) =\u003e {\n                // Success - correct variant\n            },\n            _ =\u003e panic!(\"Expected DaemonError::Serialization\"),\n        }\n    }\n\n    #[test]\n    fn test_status_conversion_invalid_argument() {\n        let err = DaemonError::InvalidInput {\n            message: \"Bad request\".to_string(),\n        };\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::InvalidArgument);\n        assert!(status.message().contains(\"Invalid input: Bad request\"));\n\n        let err = DaemonError::Config(config::ConfigError::Message(\"Config parse error\".to_string()));\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::InvalidArgument);\n    }\n\n    #[test]\n    fn test_status_conversion_not_found() {\n        let err = DaemonError::NotFound {\n            resource: \"user\".to_string(),\n        };\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::NotFound);\n        assert!(status.message().contains(\"Resource not found: user\"));\n    }\n\n    #[test]\n    fn test_status_conversion_deadline_exceeded() {\n        let err = DaemonError::Timeout { seconds: 60 };\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::DeadlineExceeded);\n        assert!(status.message().contains(\"operation timed out after 60s\"));\n    }\n\n    #[test]\n    fn test_status_conversion_internal_error() {\n        let io_error = Error::new(ErrorKind::PermissionDenied, \"Access denied\");\n        let err = DaemonError::Io(io_error);\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::Internal);\n        assert_eq!(status.message(), \"Internal server error\");\n\n        let err = DaemonError::Database(sqlx::Error::PoolClosed);\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::Internal);\n        assert_eq!(status.message(), \"Internal server error\");\n\n        let err = DaemonError::DocumentProcessing {\n            message: \"Processing failed\".to_string(),\n        };\n        let status: Status = err.into();\n        assert_eq!(status.code(), Code::Internal);\n        assert_eq!(status.message(), \"Internal server error\");\n    }\n\n    #[test]\n    fn test_daemon_result_type() {\n        let success: DaemonResult\u003ci32\u003e = Ok(42);\n        assert_eq!(success.unwrap(), 42);\n\n        let error: DaemonResult\u003ci32\u003e = Err(DaemonError::Internal {\n            message: \"Test error\".to_string(),\n        });\n        assert!(error.is_err());\n    }\n\n    #[test]\n    fn test_error_chain() {\n        let io_error = Error::new(ErrorKind::NotFound, \"File not found\");\n        let daemon_error = DaemonError::Io(io_error);\n\n        let error_string = format!(\"{}\", daemon_error);\n        assert!(error_string.contains(\"I/O error:\"));\n        assert!(error_string.contains(\"File not found\"));\n    }\n\n    #[test]\n    fn test_all_error_variants_are_testable() {\n        // Test that we can create all error variants\n        let errors = vec![\n            DaemonError::DocumentProcessing { message: \"test\".to_string() },\n            DaemonError::Search { message: \"test\".to_string() },\n            DaemonError::Memory { message: \"test\".to_string() },\n            DaemonError::System { message: \"test\".to_string() },\n            DaemonError::ProjectDetection { message: \"test\".to_string() },\n            DaemonError::ConnectionPool { message: \"test\".to_string() },\n            DaemonError::Timeout { seconds: 10 },\n            DaemonError::NotFound { resource: \"test\".to_string() },\n            DaemonError::InvalidInput { message: \"test\".to_string() },\n            DaemonError::Internal { message: \"test\".to_string() },\n        ];\n\n        for error in errors {\n            // Each error should be debuggable\n            let debug_str = format!(\"{:?}\", error);\n            assert!(!debug_str.is_empty());\n\n            // Each error should be displayable\n            let display_str = format!(\"{}\", error);\n            assert!(!display_str.is_empty());\n\n            // Each error should convert to Status\n            let _status: Status = error.into();\n        }\n    }\n\n    #[test]\n    fn test_error_source_chain() {\n        let io_error = Error::new(ErrorKind::NotFound, \"File not found\");\n        let daemon_error = DaemonError::Io(io_error);\n\n        // Test that the source chain is preserved\n        let source = std::error::Error::source(\u0026daemon_error);\n        assert!(source.is_some());\n\n        if let Some(source) = source {\n            assert_eq!(source.to_string(), \"File not found\");\n        }\n    }\n}","traces":[{"line":65,"address":[],"length":0,"stats":{"Line":17}},{"line":66,"address":[],"length":0,"stats":{"Line":17}},{"line":68,"address":[],"length":0,"stats":{"Line":3}},{"line":71,"address":[],"length":0,"stats":{"Line":8}},{"line":74,"address":[],"length":0,"stats":{"Line":8}},{"line":77,"address":[],"length":0,"stats":{"Line":4}},{"line":79,"address":[],"length":0,"stats":{"Line":16}}],"covered":7,"coverable":7},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","middleware.rs"],"content":"//! gRPC middleware for connection management, metrics, and security\n\nuse std::time::{Duration, Instant};\nuse tonic::{Request, Response, Status};\nuse tracing::{debug, info, warn};\nuse std::sync::Arc;\nuse std::sync::atomic::{AtomicU64, Ordering};\nuse dashmap::DashMap;\nuse parking_lot::RwLock;\n\n/// Connection tracking and management\n#[derive(Debug)]\npub struct ConnectionManager {\n    /// Active connections count\n    active_connections: AtomicU64,\n\n    /// Maximum allowed connections\n    max_connections: u64,\n\n    /// Connection metadata by client ID\n    connections: Arc\u003cDashMap\u003cString, ConnectionInfo\u003e\u003e,\n\n    /// Rate limiting state\n    rate_limiter: Arc\u003cRwLock\u003cRateLimiter\u003e\u003e,\n}\n\n#[derive(Debug)]\npub struct ConnectionInfo {\n    pub client_id: String,\n    pub connected_at: Instant,\n    pub last_activity: Instant,\n    pub request_count: AtomicU64,\n    pub bytes_sent: AtomicU64,\n    pub bytes_received: AtomicU64,\n}\n\nimpl Clone for ConnectionInfo {\n    fn clone(\u0026self) -\u003e Self {\n        Self {\n            client_id: self.client_id.clone(),\n            connected_at: self.connected_at,\n            last_activity: self.last_activity,\n            request_count: AtomicU64::new(self.request_count.load(Ordering::SeqCst)),\n            bytes_sent: AtomicU64::new(self.bytes_sent.load(Ordering::SeqCst)),\n            bytes_received: AtomicU64::new(self.bytes_received.load(Ordering::SeqCst)),\n        }\n    }\n}\n\n#[derive(Debug)]\npub struct RateLimiter {\n    /// Requests per second limit per client\n    requests_per_second: u32,\n\n    /// Client request tracking\n    client_requests: DashMap\u003cString, Vec\u003cInstant\u003e\u003e,\n\n    /// Cleanup interval\n    last_cleanup: Instant,\n}\n\nimpl ConnectionManager {\n    pub fn new(max_connections: u64, requests_per_second: u32) -\u003e Self {\n        Self {\n            active_connections: AtomicU64::new(0),\n            max_connections,\n            connections: Arc::new(DashMap::new()),\n            rate_limiter: Arc::new(RwLock::new(RateLimiter {\n                requests_per_second,\n                client_requests: DashMap::new(),\n                last_cleanup: Instant::now(),\n            })),\n        }\n    }\n\n    /// Register a new connection\n    pub fn register_connection(\u0026self, client_id: String) -\u003e Result\u003c(), Status\u003e {\n        let current_connections = self.active_connections.load(Ordering::SeqCst);\n\n        if current_connections \u003e= self.max_connections {\n            warn!(\"Connection limit reached: {}/{}\", current_connections, self.max_connections);\n            return Err(Status::resource_exhausted(\"Connection limit reached\"));\n        }\n\n        let connection_info = ConnectionInfo {\n            client_id: client_id.clone(),\n            connected_at: Instant::now(),\n            last_activity: Instant::now(),\n            request_count: AtomicU64::new(0),\n            bytes_sent: AtomicU64::new(0),\n            bytes_received: AtomicU64::new(0),\n        };\n\n        self.connections.insert(client_id.clone(), connection_info);\n        self.active_connections.fetch_add(1, Ordering::SeqCst);\n\n        info!(\"Connection registered: {} (total: {})\", client_id, current_connections + 1);\n        Ok(())\n    }\n\n    /// Unregister a connection\n    pub fn unregister_connection(\u0026self, client_id: \u0026str) {\n        if self.connections.remove(client_id).is_some() {\n            let remaining = self.active_connections.fetch_sub(1, Ordering::SeqCst) - 1;\n            info!(\"Connection unregistered: {} (remaining: {})\", client_id, remaining);\n        }\n\n        // Clean up rate limiter tracking\n        self.rate_limiter.read().client_requests.remove(client_id);\n    }\n\n    /// Check if request is rate limited\n    pub fn check_rate_limit(\u0026self, client_id: \u0026str) -\u003e Result\u003c(), Status\u003e {\n        let mut rate_limiter = self.rate_limiter.write();\n\n        // Cleanup old entries periodically\n        let now = Instant::now();\n        if now.duration_since(rate_limiter.last_cleanup) \u003e Duration::from_secs(60) {\n            self.cleanup_rate_limiter(\u0026mut rate_limiter, now);\n            rate_limiter.last_cleanup = now;\n        }\n\n        // Get or create client request history\n        let mut requests = rate_limiter.client_requests\n            .entry(client_id.to_string())\n            .or_insert_with(Vec::new)\n            .clone();\n\n        // Remove requests older than 1 second\n        requests.retain(|\u0026timestamp| now.duration_since(timestamp) \u003c Duration::from_secs(1));\n\n        // Check if rate limit exceeded\n        if requests.len() \u003e= rate_limiter.requests_per_second as usize {\n            warn!(\"Rate limit exceeded for client: {}\", client_id);\n            return Err(Status::resource_exhausted(\"Rate limit exceeded\"));\n        }\n\n        // Add current request\n        requests.push(now);\n        rate_limiter.client_requests.insert(client_id.to_string(), requests);\n\n        Ok(())\n    }\n\n    /// Update connection activity\n    pub fn update_activity(\u0026self, client_id: \u0026str, bytes_sent: u64, bytes_received: u64) {\n        if let Some(mut connection) = self.connections.get_mut(client_id) {\n            connection.last_activity = Instant::now();\n            connection.request_count.fetch_add(1, Ordering::SeqCst);\n            connection.bytes_sent.fetch_add(bytes_sent, Ordering::SeqCst);\n            connection.bytes_received.fetch_add(bytes_received, Ordering::SeqCst);\n        }\n    }\n\n    /// Get connection statistics\n    pub fn get_stats(\u0026self) -\u003e ConnectionStats {\n        let active_count = self.active_connections.load(Ordering::SeqCst);\n        let total_requests: u64 = self.connections\n            .iter()\n            .map(|entry| entry.request_count.load(Ordering::SeqCst))\n            .sum();\n        let total_bytes_sent: u64 = self.connections\n            .iter()\n            .map(|entry| entry.bytes_sent.load(Ordering::SeqCst))\n            .sum();\n        let total_bytes_received: u64 = self.connections\n            .iter()\n            .map(|entry| entry.bytes_received.load(Ordering::SeqCst))\n            .sum();\n\n        ConnectionStats {\n            active_connections: active_count,\n            max_connections: self.max_connections,\n            total_requests,\n            total_bytes_sent,\n            total_bytes_received,\n        }\n    }\n\n    /// Cleanup expired connections\n    pub fn cleanup_expired_connections(\u0026self, timeout: Duration) {\n        let now = Instant::now();\n        let mut expired_clients = Vec::new();\n\n        for entry in self.connections.iter() {\n            if now.duration_since(entry.last_activity) \u003e timeout {\n                expired_clients.push(entry.client_id.clone());\n            }\n        }\n\n        for client_id in expired_clients {\n            self.unregister_connection(\u0026client_id);\n            warn!(\"Expired connection cleaned up: {}\", client_id);\n        }\n    }\n\n    fn cleanup_rate_limiter(\u0026self, rate_limiter: \u0026mut RateLimiter, now: Instant) {\n        let cutoff = now - Duration::from_secs(60);\n\n        // Remove old client tracking data\n        rate_limiter.client_requests.retain(|_client_id, requests| {\n            requests.retain(|\u0026timestamp| timestamp \u003e cutoff);\n            !requests.is_empty()\n        });\n    }\n}\n\n#[derive(Debug, Clone)]\npub struct ConnectionStats {\n    pub active_connections: u64,\n    pub max_connections: u64,\n    pub total_requests: u64,\n    pub total_bytes_sent: u64,\n    pub total_bytes_received: u64,\n}\n\n/// Connection pool for outbound connections (to Qdrant, etc.)\npub struct ConnectionPool\u003cT: deadpool::managed::Manager\u003e {\n    pool: deadpool::managed::Pool\u003cT\u003e,\n    config: PoolConfig,\n}\n\nimpl\u003cT: deadpool::managed::Manager\u003e std::fmt::Debug for ConnectionPool\u003cT\u003e {\n    fn fmt(\u0026self, f: \u0026mut std::fmt::Formatter\u003c'_\u003e) -\u003e std::fmt::Result {\n        f.debug_struct(\"ConnectionPool\")\n            .field(\"config\", \u0026self.config)\n            .finish_non_exhaustive()\n    }\n}\n\n#[derive(Debug, Clone)]\npub struct PoolConfig {\n    pub max_size: usize,\n    pub min_idle: Option\u003cusize\u003e,\n    pub max_lifetime: Option\u003cDuration\u003e,\n    pub idle_timeout: Option\u003cDuration\u003e,\n    pub connection_timeout: Duration,\n}\n\nimpl Default for PoolConfig {\n    fn default() -\u003e Self {\n        Self {\n            max_size: 10,\n            min_idle: Some(2),\n            max_lifetime: Some(Duration::from_secs(3600)), // 1 hour\n            idle_timeout: Some(Duration::from_secs(600)),   // 10 minutes\n            connection_timeout: Duration::from_secs(30),\n        }\n    }\n}\n\n/// Middleware interceptor for connection management\n#[derive(Debug, Clone)]\npub struct ConnectionInterceptor {\n    connection_manager: Arc\u003cConnectionManager\u003e,\n}\n\nimpl ConnectionInterceptor {\n    pub fn new(connection_manager: Arc\u003cConnectionManager\u003e) -\u003e Self {\n        Self { connection_manager }\n    }\n\n    /// Intercept incoming requests\n    pub fn intercept\u003cT\u003e(\u0026self, request: Request\u003cT\u003e) -\u003e Result\u003cRequest\u003cT\u003e, Status\u003e {\n        // Extract client ID from metadata\n        let client_id = request\n            .metadata()\n            .get(\"client-id\")\n            .and_then(|value| value.to_str().ok())\n            .unwrap_or(\"unknown\")\n            .to_string();\n\n        // Check rate limiting\n        self.connection_manager.check_rate_limit(\u0026client_id)?;\n\n        // Update activity (approximate request size)\n        let request_size = std::mem::size_of_val(\u0026request) as u64;\n        self.connection_manager.update_activity(\u0026client_id, 0, request_size);\n\n        Ok(request)\n    }\n\n    /// Intercept outgoing responses\n    pub fn intercept_response\u003cT\u003e(\u0026self, response: Response\u003cT\u003e, client_id: \u0026str) -\u003e Response\u003cT\u003e {\n        // Update activity (approximate response size)\n        let response_size = std::mem::size_of_val(\u0026response) as u64;\n        self.connection_manager.update_activity(client_id, response_size, 0);\n\n        response\n    }\n}\n\n/// Retry configuration for failed connections\n#[derive(Debug, Clone)]\npub struct RetryConfig {\n    pub max_retries: u32,\n    pub initial_delay: Duration,\n    pub max_delay: Duration,\n    pub backoff_multiplier: f64,\n}\n\nimpl Default for RetryConfig {\n    fn default() -\u003e Self {\n        Self {\n            max_retries: 3,\n            initial_delay: Duration::from_millis(100),\n            max_delay: Duration::from_secs(30),\n            backoff_multiplier: 2.0,\n        }\n    }\n}\n\n/// Retry wrapper for gRPC operations\npub async fn with_retry\u003cF, T, E\u003e(\n    operation: F,\n    config: \u0026RetryConfig,\n) -\u003e Result\u003cT, E\u003e\nwhere\n    F: Fn() -\u003e std::pin::Pin\u003cBox\u003cdyn std::future::Future\u003cOutput = Result\u003cT, E\u003e\u003e + Send\u003e\u003e,\n    E: std::fmt::Debug,\n{\n    let mut delay = config.initial_delay;\n\n    for attempt in 1..=config.max_retries {\n        match operation().await {\n            Ok(result) =\u003e return Ok(result),\n            Err(err) if attempt == config.max_retries =\u003e {\n                debug!(\"Operation failed after {} attempts: {:?}\", config.max_retries, err);\n                return Err(err);\n            },\n            Err(err) =\u003e {\n                debug!(\"Operation failed (attempt {}/{}): {:?}\", attempt, config.max_retries, err);\n                tokio::time::sleep(delay).await;\n\n                // Exponential backoff with jitter\n                delay = std::cmp::min(\n                    Duration::from_millis(\n                        (delay.as_millis() as f64 * config.backoff_multiplier) as u64\n                    ),\n                    config.max_delay,\n                );\n            }\n        }\n    }\n\n    unreachable!()\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use tokio_test;\n    use std::sync::atomic::Ordering;\n    use std::time::Duration;\n    use tonic::{Request, Response, Status, metadata::MetadataValue};\n\n    #[test]\n    fn test_connection_manager_new() {\n        let manager = ConnectionManager::new(100, 10);\n\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 0);\n        assert_eq!(manager.max_connections, 100);\n        assert!(manager.connections.is_empty());\n    }\n\n    #[test]\n    fn test_connection_info_clone() {\n        let info = ConnectionInfo {\n            client_id: \"test_client\".to_string(),\n            connected_at: Instant::now(),\n            last_activity: Instant::now(),\n            request_count: AtomicU64::new(5),\n            bytes_sent: AtomicU64::new(1000),\n            bytes_received: AtomicU64::new(2000),\n        };\n\n        let cloned = info.clone();\n\n        assert_eq!(info.client_id, cloned.client_id);\n        assert_eq!(info.request_count.load(Ordering::SeqCst),\n                   cloned.request_count.load(Ordering::SeqCst));\n        assert_eq!(info.bytes_sent.load(Ordering::SeqCst),\n                   cloned.bytes_sent.load(Ordering::SeqCst));\n        assert_eq!(info.bytes_received.load(Ordering::SeqCst),\n                   cloned.bytes_received.load(Ordering::SeqCst));\n    }\n\n    #[test]\n    fn test_connection_manager_register_connection() {\n        let manager = ConnectionManager::new(2, 10);\n\n        // Register first connection\n        let result1 = manager.register_connection(\"client1\".to_string());\n        assert!(result1.is_ok());\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 1);\n\n        // Register second connection\n        let result2 = manager.register_connection(\"client2\".to_string());\n        assert!(result2.is_ok());\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 2);\n\n        // Try to register third connection (should fail due to limit)\n        let result3 = manager.register_connection(\"client3\".to_string());\n        assert!(result3.is_err());\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 2);\n    }\n\n    #[test]\n    fn test_connection_manager_unregister_connection() {\n        let manager = ConnectionManager::new(10, 10);\n\n        // Register and then unregister\n        manager.register_connection(\"client1\".to_string()).unwrap();\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 1);\n\n        manager.unregister_connection(\"client1\");\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 0);\n        assert!(manager.connections.is_empty());\n\n        // Unregistering non-existent connection should not panic\n        manager.unregister_connection(\"non_existent\");\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 0);\n    }\n\n    #[test]\n    fn test_connection_manager_rate_limiting() {\n        let manager = ConnectionManager::new(10, 2); // 2 requests per second\n\n        // First request should succeed\n        let result1 = manager.check_rate_limit(\"client1\");\n        assert!(result1.is_ok());\n\n        // Second request should succeed\n        let result2 = manager.check_rate_limit(\"client1\");\n        assert!(result2.is_ok());\n\n        // Third request should fail (rate limit exceeded)\n        let result3 = manager.check_rate_limit(\"client1\");\n        assert!(result3.is_err());\n        if let Err(status) = result3 {\n            assert_eq!(status.code(), tonic::Code::ResourceExhausted);\n        }\n    }\n\n    #[test]\n    fn test_connection_manager_rate_limiting_different_clients() {\n        let manager = ConnectionManager::new(10, 2); // 2 requests per second\n\n        // Two requests from client1\n        assert!(manager.check_rate_limit(\"client1\").is_ok());\n        assert!(manager.check_rate_limit(\"client1\").is_ok());\n\n        // Two requests from client2 should still succeed\n        assert!(manager.check_rate_limit(\"client2\").is_ok());\n        assert!(manager.check_rate_limit(\"client2\").is_ok());\n\n        // Third request from each client should fail\n        assert!(manager.check_rate_limit(\"client1\").is_err());\n        assert!(manager.check_rate_limit(\"client2\").is_err());\n    }\n\n    #[test]\n    fn test_connection_manager_update_activity() {\n        let manager = ConnectionManager::new(10, 10);\n        manager.register_connection(\"client1\".to_string()).unwrap();\n\n        // Update activity\n        manager.update_activity(\"client1\", 1000, 500);\n\n        let stats = manager.get_stats();\n        assert_eq!(stats.total_bytes_sent, 1000);\n        assert_eq!(stats.total_bytes_received, 500);\n        assert_eq!(stats.total_requests, 1);\n\n        // Update activity again\n        manager.update_activity(\"client1\", 2000, 1000);\n\n        let stats = manager.get_stats();\n        assert_eq!(stats.total_bytes_sent, 3000);\n        assert_eq!(stats.total_bytes_received, 1500);\n        assert_eq!(stats.total_requests, 2);\n    }\n\n    #[test]\n    fn test_connection_manager_get_stats() {\n        let manager = ConnectionManager::new(10, 10);\n\n        // Initial stats\n        let stats = manager.get_stats();\n        assert_eq!(stats.active_connections, 0);\n        assert_eq!(stats.max_connections, 10);\n        assert_eq!(stats.total_requests, 0);\n        assert_eq!(stats.total_bytes_sent, 0);\n        assert_eq!(stats.total_bytes_received, 0);\n\n        // Register connections and update activity\n        manager.register_connection(\"client1\".to_string()).unwrap();\n        manager.register_connection(\"client2\".to_string()).unwrap();\n        manager.update_activity(\"client1\", 100, 200);\n        manager.update_activity(\"client2\", 300, 400);\n\n        let stats = manager.get_stats();\n        assert_eq!(stats.active_connections, 2);\n        assert_eq!(stats.total_requests, 2);\n        assert_eq!(stats.total_bytes_sent, 400);\n        assert_eq!(stats.total_bytes_received, 600);\n    }\n\n    #[test]\n    fn test_connection_manager_cleanup_expired_connections() {\n        let manager = ConnectionManager::new(10, 10);\n        manager.register_connection(\"client1\".to_string()).unwrap();\n\n        // Connection should not be expired immediately\n        manager.cleanup_expired_connections(Duration::from_secs(1));\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 1);\n\n        // Connection should be expired with zero timeout\n        manager.cleanup_expired_connections(Duration::from_secs(0));\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 0);\n    }\n\n    #[test]\n    fn test_connection_stats_debug() {\n        let stats = ConnectionStats {\n            active_connections: 5,\n            max_connections: 10,\n            total_requests: 100,\n            total_bytes_sent: 1000,\n            total_bytes_received: 2000,\n        };\n\n        let debug_str = format!(\"{:?}\", stats);\n        assert!(debug_str.contains(\"ConnectionStats\"));\n        assert!(debug_str.contains(\"5\"));\n        assert!(debug_str.contains(\"100\"));\n    }\n\n    #[test]\n    fn test_connection_stats_clone() {\n        let stats = ConnectionStats {\n            active_connections: 5,\n            max_connections: 10,\n            total_requests: 100,\n            total_bytes_sent: 1000,\n            total_bytes_received: 2000,\n        };\n\n        let cloned = stats.clone();\n        assert_eq!(stats.active_connections, cloned.active_connections);\n        assert_eq!(stats.max_connections, cloned.max_connections);\n        assert_eq!(stats.total_requests, cloned.total_requests);\n        assert_eq!(stats.total_bytes_sent, cloned.total_bytes_sent);\n        assert_eq!(stats.total_bytes_received, cloned.total_bytes_received);\n    }\n\n    #[test]\n    fn test_pool_config_default() {\n        let config = PoolConfig::default();\n\n        assert_eq!(config.max_size, 10);\n        assert_eq!(config.min_idle, Some(2));\n        assert_eq!(config.max_lifetime, Some(Duration::from_secs(3600)));\n        assert_eq!(config.idle_timeout, Some(Duration::from_secs(600)));\n        assert_eq!(config.connection_timeout, Duration::from_secs(30));\n    }\n\n    #[test]\n    fn test_pool_config_debug() {\n        let config = PoolConfig::default();\n        let debug_str = format!(\"{:?}\", config);\n\n        assert!(debug_str.contains(\"PoolConfig\"));\n        assert!(debug_str.contains(\"max_size\"));\n        assert!(debug_str.contains(\"10\"));\n    }\n\n    #[test]\n    fn test_connection_interceptor_new() {\n        let manager = Arc::new(ConnectionManager::new(10, 10));\n        let interceptor = ConnectionInterceptor::new(manager.clone());\n\n        assert!(Arc::ptr_eq(\u0026interceptor.connection_manager, \u0026manager));\n    }\n\n    #[test]\n    fn test_connection_interceptor_debug() {\n        let manager = Arc::new(ConnectionManager::new(10, 10));\n        let interceptor = ConnectionInterceptor::new(manager);\n\n        let debug_str = format!(\"{:?}\", interceptor);\n        assert!(debug_str.contains(\"ConnectionInterceptor\"));\n        assert!(debug_str.contains(\"connection_manager\"));\n    }\n\n    #[test]\n    fn test_connection_interceptor_clone() {\n        let manager = Arc::new(ConnectionManager::new(10, 10));\n        let interceptor = ConnectionInterceptor::new(manager);\n        let cloned = interceptor.clone();\n\n        assert!(Arc::ptr_eq(\u0026interceptor.connection_manager, \u0026cloned.connection_manager));\n    }\n\n    #[test]\n    fn test_connection_interceptor_intercept_without_client_id() {\n        let manager = Arc::new(ConnectionManager::new(10, 10));\n        let interceptor = ConnectionInterceptor::new(manager);\n\n        let request: Request\u003c()\u003e = Request::new(());\n        let result = interceptor.intercept(request);\n\n        assert!(result.is_ok());\n    }\n\n    #[test]\n    fn test_connection_interceptor_intercept_with_client_id() {\n        let manager = Arc::new(ConnectionManager::new(10, 10));\n        let interceptor = ConnectionInterceptor::new(manager);\n\n        let mut request: Request\u003c()\u003e = Request::new(());\n        request.metadata_mut().insert(\n            \"client-id\",\n            MetadataValue::from_static(\"test_client\")\n        );\n\n        let result = interceptor.intercept(request);\n        assert!(result.is_ok());\n    }\n\n    #[test]\n    fn test_connection_interceptor_intercept_response() {\n        let manager = Arc::new(ConnectionManager::new(10, 10));\n        let interceptor = ConnectionInterceptor::new(manager.clone());\n\n        manager.register_connection(\"test_client\".to_string()).unwrap();\n\n        let response: Response\u003c()\u003e = Response::new(());\n        let result = interceptor.intercept_response(response, \"test_client\");\n\n        // Should return the response unchanged\n        assert_eq!(result.get_ref(), \u0026());\n    }\n\n    #[test]\n    fn test_retry_config_default() {\n        let config = RetryConfig::default();\n\n        assert_eq!(config.max_retries, 3);\n        assert_eq!(config.initial_delay, Duration::from_millis(100));\n        assert_eq!(config.max_delay, Duration::from_secs(30));\n        assert_eq!(config.backoff_multiplier, 2.0);\n    }\n\n    #[test]\n    fn test_retry_config_debug() {\n        let config = RetryConfig::default();\n        let debug_str = format!(\"{:?}\", config);\n\n        assert!(debug_str.contains(\"RetryConfig\"));\n        assert!(debug_str.contains(\"max_retries\"));\n        assert!(debug_str.contains(\"3\"));\n    }\n\n    #[test]\n    fn test_retry_config_clone() {\n        let config = RetryConfig::default();\n        let cloned = config.clone();\n\n        assert_eq!(config.max_retries, cloned.max_retries);\n        assert_eq!(config.initial_delay, cloned.initial_delay);\n        assert_eq!(config.max_delay, cloned.max_delay);\n        assert_eq!(config.backoff_multiplier, cloned.backoff_multiplier);\n    }\n\n    #[tokio::test]\n    async fn test_with_retry_success_first_attempt() {\n        let config = RetryConfig {\n            max_retries: 3,\n            initial_delay: Duration::from_millis(1
