0),\n            max_delay: Duration::from_secs(1),\n            backoff_multiplier: 2.0,\n        };\n\n        let result = with_retry(\n            || Box::pin(async { Ok::\u003ci32, \u0026'static str\u003e(42) }),\n            \u0026config,\n        ).await;\n\n        assert_eq!(result.unwrap(), 42);\n    }\n\n    #[tokio::test]\n    async fn test_with_retry_success_after_failures() {\n        let config = RetryConfig {\n            max_retries: 3,\n            initial_delay: Duration::from_millis(1),\n            max_delay: Duration::from_secs(1),\n            backoff_multiplier: 2.0,\n        };\n\n        let attempt = Arc::new(AtomicU64::new(0));\n        let attempt_clone = Arc::clone(\u0026attempt);\n        let result = with_retry(\n            move || {\n                let current_attempt = attempt_clone.fetch_add(1, Ordering::SeqCst) + 1;\n                Box::pin(async move {\n                    if current_attempt \u003c 3 {\n                        Err(\"temporary failure\")\n                    } else {\n                        Ok::\u003ci32, \u0026'static str\u003e(42)\n                    }\n                })\n            },\n            \u0026config,\n        ).await;\n\n        assert_eq!(result.unwrap(), 42);\n    }\n\n    #[tokio::test]\n    async fn test_with_retry_final_failure() {\n        let config = RetryConfig {\n            max_retries: 2,\n            initial_delay: Duration::from_millis(1),\n            max_delay: Duration::from_secs(1),\n            backoff_multiplier: 2.0,\n        };\n\n        let result = with_retry(\n            || Box::pin(async { Err::\u003ci32, \u0026'static str\u003e(\"permanent failure\") }),\n            \u0026config,\n        ).await;\n\n        assert_eq!(result.unwrap_err(), \"permanent failure\");\n    }\n\n    #[test]\n    fn test_rate_limiter_debug() {\n        let rate_limiter = RateLimiter {\n            requests_per_second: 10,\n            client_requests: DashMap::new(),\n            last_cleanup: Instant::now(),\n        };\n\n        let debug_str = format!(\"{:?}\", rate_limiter);\n        assert!(debug_str.contains(\"RateLimiter\"));\n        assert!(debug_str.contains(\"requests_per_second\"));\n        assert!(debug_str.contains(\"10\"));\n    }\n\n    #[test]\n    fn test_connection_manager_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cConnectionManager\u003e();\n        assert_sync::\u003cConnectionManager\u003e();\n    }\n\n    #[test]\n    fn test_connection_interceptor_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cConnectionInterceptor\u003e();\n        assert_sync::\u003cConnectionInterceptor\u003e();\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_connection_management() {\n        let manager = Arc::new(ConnectionManager::new(100, 50));\n\n        let mut handles = vec![];\n\n        // Spawn multiple tasks to register connections concurrently\n        for i in 0..10 {\n            let manager_clone = Arc::clone(\u0026manager);\n            let handle = tokio::spawn(async move {\n                let client_id = format!(\"client_{}\", i);\n                manager_clone.register_connection(client_id.clone()).unwrap();\n\n                // Simulate some activity\n                for _ in 0..5 {\n                    manager_clone.update_activity(\u0026client_id, 100, 200);\n                    tokio::time::sleep(Duration::from_millis(1)).await;\n                }\n\n                manager_clone.unregister_connection(\u0026client_id);\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all tasks to complete\n        for handle in handles {\n            handle.await.unwrap();\n        }\n\n        // All connections should be unregistered\n        assert_eq!(manager.active_connections.load(Ordering::SeqCst), 0);\n    }\n}","traces":[{"line":38,"address":[],"length":0,"stats":{"Line":1}},{"line":40,"address":[],"length":0,"stats":{"Line":3}},{"line":41,"address":[],"length":0,"stats":{"Line":2}},{"line":42,"address":[],"length":0,"stats":{"Line":2}},{"line":43,"address":[],"length":0,"stats":{"Line":5}},{"line":44,"address":[],"length":0,"stats":{"Line":5}},{"line":45,"address":[],"length":0,"stats":{"Line":3}},{"line":63,"address":[],"length":0,"stats":{"Line":26}},{"line":65,"address":[],"length":0,"stats":{"Line":52}},{"line":67,"address":[],"length":0,"stats":{"Line":78}},{"line":68,"address":[],"length":0,"stats":{"Line":78}},{"line":77,"address":[],"length":0,"stats":{"Line":19}},{"line":78,"address":[],"length":0,"stats":{"Line":76}},{"line":80,"address":[],"length":0,"stats":{"Line":19}},{"line":81,"address":[],"length":0,"stats":{"Line":1}},{"line":82,"address":[],"length":0,"stats":{"Line":1}},{"line":97,"address":[],"length":0,"stats":{"Line":0}},{"line":102,"address":[],"length":0,"stats":{"Line":13}},{"line":103,"address":[],"length":0,"stats":{"Line":39}},{"line":104,"address":[],"length":0,"stats":{"Line":36}},{"line":105,"address":[],"length":0,"stats":{"Line":12}},{"line":109,"address":[],"length":0,"stats":{"Line":39}},{"line":113,"address":[],"length":0,"stats":{"Line":11}},{"line":114,"address":[],"length":0,"stats":{"Line":22}},{"line":117,"address":[],"length":0,"stats":{"Line":22}},{"line":118,"address":[],"length":0,"stats":{"Line":22}},{"line":119,"address":[],"length":0,"stats":{"Line":0}},{"line":120,"address":[],"length":0,"stats":{"Line":0}},{"line":124,"address":[],"length":0,"stats":{"Line":33}},{"line":125,"address":[],"length":0,"stats":{"Line":33}},{"line":126,"address":[],"length":0,"stats":{"Line":11}},{"line":130,"address":[],"length":0,"stats":{"Line":49}},{"line":133,"address":[],"length":0,"stats":{"Line":22}},{"line":134,"address":[],"length":0,"stats":{"Line":3}},{"line":135,"address":[],"length":0,"stats":{"Line":3}},{"line":146,"add "Line":5}},{"line":274,"address":[],"length":0,"stats":{"Line":4}},{"line":277,"address":[],"length":0,"stats":{"Line":2}},{"line":278,"address":[],"length":0,"stats":{"Line":0}},{"line":280,"address":[],"length":0,"stats":{"Line":0}},{"line":284,"address":[],"length":0,"stats":{"Line":1}},{"line":286,"address":[],"length":0,"stats":{"Line":2}},{"line":287,"address":[],"length":0,"stats":{"Line":3}},{"line":289,"address":[],"length":0,"stats":{"Line":1}},{"line":303,"address":[],"length":0,"stats":{"Line":3}},{"line":306,"address":[],"length":0,"stats":{"Line":3}},{"line":307,"address":[],"length":0,"stats":{"Line":3}},{"line":314,"address":[],"length":0,"stats":{"Line":3}},{"line":322,"address":[],"length":0,"stats":{"Line":6}},{"line":324,"address":[],"length":0,"stats":{"Line":9}},{"line":325,"address":[],"length":0,"stats":{"Line":12}},{"line":326,"address":[],"length":0,"stats":{"Line":2}},{"line":327,"address":[],"length":0,"stats":{"Line":6}},{"line":328,"address":[],"length":0,"stats":{"Line":1}},{"line":329,"address":[],"length":0,"stats":{"Line":1}},{"line":331,"address":[],"length":0,"stats":{"Line":3}},{"line":332,"address":[],"length":0,"stats":{"Line":0}},{"line":333,"address":[],"length":0,"stats":{"Line":0}},{"line":336,"address":[],"length":0,"stats":{"Line":3}},{"line":337,"address":[],"length":0,"stats":{"Line":3}},{"line":338,"address":[],"length":0,"stats":{"Line":3}},{"line":340,"address":[],"length":0,"stats":{"Line":3}}],"covered":81,"coverable":97},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","mod.rs"],"content":"//! gRPC server implementations for all daemon services\n\npub mod server;\npub mod services;\npub mod middleware;\n\npub use server::GrpcServer;","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","server.rs"],"content":"//! Main gRPC server implementation with all service registrations\n\nuse crate::daemon::WorkspaceDaemon;\nuse crate::grpc::middleware::{ConnectionManager, ConnectionInterceptor};\nuse crate::grpc::services::{\n    DocumentProcessorImpl,\n    SearchServiceImpl,\n    MemoryServiceImpl,\n    SystemServiceImpl,\n};\nuse crate::proto::{\n    document_processor_server::DocumentProcessorServer,\n    search_service_server::SearchServiceServer,\n    memory_service_server::MemoryServiceServer,\n    system_service_server::SystemServiceServer,\n};\n\nuse anyhow::Result;\nuse std::net::SocketAddr;\nuse std::sync::Arc;\nuse std::time::Duration;\nuse tokio::signal;\nuse tonic::transport::Server;\nuse tracing::info;\n\n/// Main gRPC server coordinating all daemon services\npub struct GrpcServer {\n    daemon: Arc\u003cWorkspaceDaemon\u003e,\n    address: SocketAddr,\n    connection_manager: Arc\u003cConnectionManager\u003e,\n}\n\nimpl GrpcServer {\n    /// Create a new gRPC server instance\n    pub fn new(daemon: WorkspaceDaemon, address: SocketAddr) -\u003e Self {\n        let config = daemon.config();\n        let connection_manager = Arc::new(ConnectionManager::new(\n            config.server.max_connections as u64,\n            100, // 100 requests per second per client\n        ));\n\n        Self {\n            daemon: Arc::new(daemon),\n            address,\n            connection_manager,\n        }\n    }\n\n    /// Start the gRPC server in foreground mode\n    pub async fn serve(self) -\u003e Result\u003c()\u003e {\n        let address = self.address;\n        info!(\"Starting gRPC server on {}\", address);\n        info!(\"Connection manager initialized with max connections: {}\",\n              self.daemon.config().server.max_connections);\n\n        // Start connection cleanup task\n        let connection_manager_clone = Arc::clone(\u0026self.connection_manager);\n        let cleanup_task = tokio::spawn(async move {\n            let mut interval = tokio::time::interval(Duration::from_secs(60));\n            loop {\n                interval.tick().await;\n                connection_manager_clone.cleanup_expired_connections(Duration::from_secs(300));\n            }\n        });\n\n        let server = self.build_server().await?;\n\n        // Graceful shutdown\n        let shutdown_signal = async {\n            signal::ctrl_c()\n                .await\n                .expect(\"Failed to install CTRL+C signal handler\");\n            info!(\"Received shutdown signal, gracefully shutting down...\");\n            cleanup_task.abort();\n        };\n\n        server\n            .serve_with_shutdown(address, shutdown_signal)\n            .await\n            .map_err(|e| anyhow::anyhow!(\"gRPC server error: {}\", e))?;\n\n        info!(\"gRPC server shutdown complete\");\n        Ok(())\n    }\n\n    /// Start the gRPC server in daemon mode\n    pub async fn serve_daemon(self) -\u003e Result\u003c()\u003e {\n        let address = self.address;\n        info!(\"Starting gRPC server in daemon mode on {}\", address);\n        info!(\"Connection manager initialized with max connections: {}\",\n              self.daemon.config().server.max_connections);\n\n        // Start connection cleanup task\n        let connection_manager_clone = Arc::clone(\u0026self.connection_manager);\n        tokio::spawn(async move {\n            let mut interval = tokio::time::interval(Duration::from_secs(60));\n            loop {\n                interval.tick().await;\n                connection_manager_clone.cleanup_expired_connections(Duration::from_secs(300));\n            }\n        });\n\n        let server = self.build_server().await?;\n\n        server\n            .serve(address)\n            .await\n            .map_err(|e| anyhow::anyhow!(\"gRPC server error: {}\", e))?;\n\n        Ok(())\n    }\n\n    /// Build the complete gRPC server with all services\n    async fn build_server(self) -\u003e Result\u003ctonic::transport::server::Router\u003e {\n        let reflection_service = tonic_reflection::server::Builder::configure()\n            .register_encoded_file_descriptor_set(include_bytes!(concat!(env!(\"OUT_DIR\"), \"/workspace_daemon_descriptor.bin\")))\n            .build_v1()\n            .map_err(|e| anyhow::anyhow!(\"Failed to build reflection service: {}\", e))?;\n\n        // Create connection interceptor\n        let interceptor = ConnectionInterceptor::new(Arc::clone(\u0026self.connection_manager));\n\n        // Create service implementations\n        let document_processor = DocumentProcessorImpl::new(Arc::clone(\u0026self.daemon));\n        let search_service = SearchServiceImpl::new(Arc::clone(\u0026self.daemon));\n        let memory_service = MemoryServiceImpl::new(Arc::clone(\u0026self.daemon));\n        let system_service = SystemServiceImpl::new(Arc::clone(\u0026self.daemon));\n\n        let config = self.daemon.config();\n\n        let server = Server::builder()\n            // Add connection timeout from config\n            .timeout(Duration::from_secs(config.server.connection_timeout_secs))\n            // Set concurrency limits\n            .concurrency_limit_per_connection(256)\n            // Add keep-alive settings\n            .tcp_keepalive(Some(Duration::from_secs(60)))\n            // Register all services\n            .add_service(DocumentProcessorServer::new(document_processor))\n            .add_service(SearchServiceServer::new(search_service))\n            .add_service(MemoryServiceServer::new(memory_service))\n            .add_service(SystemServiceServer::new(system_service))\n            // Add reflection for debugging\n            .add_service(reflection_service);\n\n        Ok(server)\n    }\n\n    /// Get connection statistics\n    pub fn get_connection_stats(\u0026self) -\u003e crate::grpc::middleware::ConnectionStats {\n        self.connection_manager.get_stats()\n    }\n\n    /// Get connection manager for external access\n    pub fn connection_manager(\u0026self) -\u003e \u0026Arc\u003cConnectionManager\u003e {\n        \u0026self.connection_manager\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::*;\n    use std::net::{IpAddr, Ipv4Addr};\n    use tempfile::TempDir;\n    use tokio_test;\n\n    fn create_test_daemon_config() -\u003e DaemonConfig {\n        // Use in-memory SQLite database for tests\n        let db_path = \":memory:\";\n\n        DaemonConfig {\n            server: ServerConfig {\n                host: \"127.0.0.1\".to_string(),\n                port: 50052, // Use different port for testing\n                max_connections: 100,\n                connection_timeout_secs: 30,\n                request_timeout_secs: 60,\n                enable_tls: false,\n            },\n            database: DatabaseConfig {\n                sqlite_path: db_path.to_string(),\n                max_connections: 5,\n                connection_timeout_secs: 30,\n                enable_wal: true,\n            },\n            qdrant: QdrantConfig {\n                url: \"http://localhost:6333\".to_string(),\n                api_key: None,\n                timeout_secs: 30,\n                max_retries: 3,\n                default_collection: CollectionConfig {\n                    vector_size: 384,\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    replication_factor: 1,\n                    shard_number: 1,\n                },\n            },\n            processing: ProcessingConfig {\n                max_concurrent_tasks: 2,\n                default_chunk_size: 1000,\n                default_chunk_overlap: 200,\n                max_file_size_bytes: 1024 * 1024,\n                supported_extensions: vec![\"txt\".to_string(), \"md\".to_string()],\n                enable_lsp: false,\n                lsp_timeout_secs: 10,\n            },\n            file_watcher: FileWatcherConfig {\n                enabled: false,\n                debounce_ms: 500,\n                max_watched_dirs: 10,\n                ignore_patterns: vec![],\n                recursive: true,\n            },\n            metrics: MetricsConfig {\n                enabled: false,\n                collection_interval_secs: 60,\n                retention_days: 30,\n                enable_prometheus: false,\n                prometheus_port: 9090,\n            },\n            logging: LoggingConfig {\n                level: \"info\".to_string(),\n                file_path: None,\n                json_format: false,\n                max_file_size_mb: 100,\n                max_files: 5,\n            },\n        }\n    }\n\n    async fn create_test_daemon() -\u003e WorkspaceDaemon {\n        let config = create_test_daemon_config();\n        WorkspaceDaemon::new(config).await.expect(\"Failed to create daemon\")\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_new() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 0);\n\n        let server = GrpcServer::new(daemon, address);\n\n        assert_eq!(server.address, address);\n        assert!(Arc::strong_count(\u0026server.connection_manager) \u003e= 1);\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_connection_manager_access() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n        let connection_manager = server.connection_manager();\n\n        // Test that we can access connection manager\n        let stats = connection_manager.get_stats();\n        assert_eq!(stats.active_connections, 0);\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_get_connection_stats() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n        let stats = server.get_connection_stats();\n\n        // Initially should have no active connections\n        assert_eq!(stats.active_connections, 0);\n        assert_eq!(stats.total_requests, 0);\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_build_server() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n        let result = server.build_server().await;\n\n        assert!(result.is_ok());\n    }\n\n    #[test]\n    fn test_grpc_server_address_types() {\n        // Test IPv4 address\n        let ipv4 = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(192, 168, 1, 1)), 8080);\n        assert_eq!(ipv4.ip(), IpAddr::V4(Ipv4Addr::new(192, 168, 1, 1)));\n        assert_eq!(ipv4.port(), 8080);\n\n        // Test IPv6 address\n        let ipv6 = \"[::1]:9090\".parse::\u003cSocketAddr\u003e().unwrap();\n        assert!(ipv6.is_ipv6());\n        assert_eq!(ipv6.port(), 9090);\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_with_different_ports() {\n        let daemon = create_test_daemon().await;\n\n        let ports = [8080, 8081, 8082];\n        for port in ports {\n            let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), port);\n            let server = GrpcServer::new(daemon.clone(), address);\n            assert_eq!(server.address.port(), port);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_connection_manager_initialization() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n        let connection_manager = server.connection_manager();\n\n        // Test that connection manager is properly initialized\n        let stats = connection_manager.get_stats();\n        assert_eq!(stats.active_connections, 0);\n        assert_eq!(stats.total_requests, 0);\n        assert_eq!(stats.total_bytes_sent, 0);\n        assert_eq!(stats.total_bytes_received, 0);\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_daemon_config_access() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n\n        // Test accessing daemon config through server\n        let connection_manager = server.connection_manager();\n        let stats = connection_manager.get_stats();\n\n        // Should have valid stats\n        assert!(stats.active_connections \u003e= 0);\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_arc_sharing() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n        let daemon_arc = \u0026server.daemon;\n\n        // Verify daemon is properly shared via Arc\n        assert!(Arc::strong_count(daemon_arc) \u003e= 1);\n    }\n\n    #[test]\n    fn test_socket_addr_parsing() {\n        // Test various socket address formats\n        let addrs = [\n            \"127.0.0.1:8080\",\n            \"0.0.0.0:8080\",\n            \"[::1]:8080\",\n            \"[::]:8080\",\n        ];\n\n        for addr_str in addrs {\n            let result = addr_str.parse::\u003cSocketAddr\u003e();\n            assert!(result.is_ok(), \"Failed to parse address: {}\", addr_str);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_grpc_server_memory_efficiency() {\n        let daemon = create_test_daemon().await;\n        let address = SocketAddr::new(IpAddr::V4(Ipv4Addr::new(127, 0, 0, 1)), 8080);\n\n        let server = GrpcServer::new(daemon, address);\n\n        // Verify that server doesn't hold unnecessary references\n        let initial_daemon_count = Arc::strong_count(\u0026server.daemon);\n        let initial_manager_count = Arc::strong_count(\u0026server.connection_manager);\n\n        assert_eq!(initial_daemon_count, 1);\n        assert_eq!(initial_manager_count, 1);\n    }\n\n    #[test]\n    fn test_grpc_server_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cGrpcServer\u003e();\n        assert_sync::\u003cGrpcServer\u003e();\n    }\n}","traces":[{"line":35,"address":[],"length":0,"stats":{"Line":11}},{"line":36,"address":[],"length":0,"stats":{"Line":33}},{"line":37,"address":[],"length":0,"stats":{"Line":33}},{"line":38,"address":[],"length":0,"stats":{"Line":11}},{"line":43,"address":[],"length":0,"stats":{"Line":33}},{"line":50,"address":[],"length":0,"stats":{"Line":0}},{"line":51,"address":[],"length":0,"stats":{"Line":0}},{"line":52,"address":[],"length":0,"stats":{"Line":0}},{"line":53,"address":[],"length":0,"stats":{"Line":0}},{"line":54,"address":[],"length":0,"stats":{"Line":0}},{"line":57,"address":[],"length":0,"stats":{"Line":0}},{"line":58,"address":[],"length":0,"stats":{"Line":0}},{"line":59,"address":[],"length":0,"stats":{"Line":0}},{"line":61,"address":[],"length":0,"stats":{"Line":0}},{"line":62,"address":[],"length":0,"stats":{"Line":0}},{"line":66,"address":[],"length":0,"stats":{"Line":0}},{"line":69,"address":[],"length":0,"stats":{"Line":0}},{"line":70,"address":[],"length":0,"stats":{"Line":0}},{"line":71,"address":[],"length":0,"stats":{"Line":0}},{"line":73,"address":[],"length":0,"stats":{"Line":0}},{"line":74,"address":[],"length":0,"stats":{"Line":0}},{"line":77,"address":[],"length":0,"stats":{"Line":0}},{"line":78,"address":[],"length":0,"stats":{"Line":0}},{"line":79,"address":[],"length":0,"stats":{"Line":0}},{"line":80,"address":[],"length":0,"stats":{"Line":0}},{"line":82,"address":[],"length":0,"stats":{"Line":0}},{"line":83,"address":[],"length":0,"stats":{"Line":0}},{"line":87,"address":[],"length":0,"stats":{"Line":0}},{"line":88,"address":[],"length":0,"stats":{"Line":0}},{"line":89,"address":[],"length":0,"stats":{"Line":0}},{"line":90,"address":[],"length":0,"stats":{"Line":0}},{"line":91,"address":[],"length":0,"stats":{"Line":0}},{"line":94,"address":[],"length":0,"stats":{"Line":0}},{"line":95,"address":[],"length":0,"stats":{"Line":0}},{"line":96,"address":[],"length":0,"stats":{"Line":0}},{"line":98,"address":[],"length":0,"stats":{"Line":0}},{"line":99,"address":[],"length":0,"stats":{"Line":0}},{"line":103,"address":[],"length":0,"stats":{"Line":0}},{"line":105,"address":[],"length":0,"stats":{"Line":0}},{"line":106,"address":[],"length":0,"stats":{"Line":0}},{"line":107,"address":[],"length":0,"stats":{"Line":0}},{"line":108,"address":[],"length":0,"stats":{"Line":0}},{"line":110,"address":[],"length":0,"stats":{"Line":0}},{"line":114,"address":[],"length":0,"stats":{"Line":2}},{"line":115,"address":[],"length":0,"stats":{"Line":2}},{"line":116,"address":[],"length":0,"stats":{"Line":2}},{"line":118,"address":[],"length":0,"stats":{"Line":1}},{"line":150,"address":[],"length":0,"stats":{"Line":1}},{"line":151,"address":[],"length":0,"stats":{"Line":1}},{"line":155,"address":[],"length":0,"stats":{"Line":3}},{"line":156,"address":[],"length":0,"stats":{"Line":3}}],"covered":13,"coverable":51},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","services","document_processor.rs"],"content":"//! Document processing gRPC service implementation\n\nuse crate::daemon::WorkspaceDaemon;\nuse crate::proto::{\n    document_processor_server::DocumentProcessor,\n    ProcessDocumentRequest, ProcessDocumentResponse,\n    ProcessingStatusRequest, ProcessingStatusResponse,\n    CancelProcessingRequest,\n};\nuse std::sync::Arc;\nuse tonic::{Request, Response, Status};\nuse tracing::{debug, error, info};\n\n/// Document processor service implementation\n#[derive(Debug)]\npub struct DocumentProcessorImpl {\n    daemon: Arc\u003cWorkspaceDaemon\u003e,\n}\n\nimpl DocumentProcessorImpl {\n    pub fn new(daemon: Arc\u003cWorkspaceDaemon\u003e) -\u003e Self {\n        Self { daemon }\n    }\n}\n\n#[tonic::async_trait]\nimpl DocumentProcessor for DocumentProcessorImpl {\n    async fn process_document(\n        \u0026self,\n        request: Request\u003cProcessDocumentRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cProcessDocumentResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Processing document: {:?}\", req.file_path);\n\n        // TODO: Implement actual document processing\n        // This is a placeholder implementation\n        let response = ProcessDocumentResponse {\n            document_id: uuid::Uuid::new_v4().to_string(),\n            status: crate::proto::ProcessingStatus::Completed as i32,\n            error_message: String::new(),\n            chunks_created: 1,\n            extracted_metadata: std::collections::HashMap::new(),\n            processed_at: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp(),\n                nanos: 0,\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    type ProcessDocumentsStream = tokio_stream::wrappers::ReceiverStream\u003cResult\u003cProcessDocumentResponse, Status\u003e\u003e;\n\n    async fn process_documents(\n        \u0026self,\n        request: Request\u003ctonic::Streaming\u003cProcessDocumentRequest\u003e\u003e,\n    ) -\u003e Result\u003cResponse\u003cSelf::ProcessDocumentsStream\u003e, Status\u003e {\n        let mut stream = request.into_inner();\n        let (tx, rx) = tokio::sync::mpsc::channel(128);\n\n        // Spawn task to process the stream\n        tokio::spawn(async move {\n            while let Some(req) = stream.message().await.transpose() {\n                match req {\n                    Ok(req) =\u003e {\n                        debug!(\"Processing document in stream: {:?}\", req.file_path);\n\n                        // TODO: Implement actual processing\n                        let response = ProcessDocumentResponse {\n                            document_id: uuid::Uuid::new_v4().to_string(),\n                            status: crate::proto::ProcessingStatus::Completed as i32,\n                            error_message: String::new(),\n                            chunks_created: 1,\n                            extracted_metadata: std::collections::HashMap::new(),\n                            processed_at: Some(prost_types::Timestamp {\n                                seconds: chrono::Utc::now().timestamp(),\n                                nanos: 0,\n                            }),\n                        };\n\n                        if tx.send(Ok(response)).await.is_err() {\n                            break;\n                        }\n                    },\n                    Err(e) =\u003e {\n                        let _ = tx.send(Err(e)).await;\n                        break;\n                    }\n                }\n            }\n        });\n\n        Ok(Response::new(tokio_stream::wrappers::ReceiverStream::new(rx)))\n    }\n\n    async fn get_processing_status(\n        \u0026self,\n        request: Request\u003cProcessingStatusRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cProcessingStatusResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Getting processing status for: {}\", req.operation_id);\n\n        // TODO: Implement actual status tracking\n        let response = ProcessingStatusResponse {\n            operation_id: req.operation_id,\n            status: crate::proto::ProcessingStatus::Completed as i32,\n            total_documents: 1,\n            processed_documents: 1,\n            failed_documents: 0,\n            error_messages: vec![],\n            started_at: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp() - 60,\n                nanos: 0,\n            }),\n            updated_at: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp(),\n                nanos: 0,\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn cancel_processing(\n        \u0026self,\n        request: Request\u003cCancelProcessingRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003c()\u003e, Status\u003e {\n        let req = request.into_inner();\n        info!(\"Cancelling processing operation: {}\", req.operation_id);\n\n        // TODO: Implement actual cancellation logic\n\n        Ok(Response::new(()))\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::*;\n    use tempfile::TempDir;\n    use tonic::Request;\n    use tokio_test;\n    use std::collections::HashMap;\n\n    fn create_test_daemon_config() -\u003e DaemonConfig {\n        // Use in-memory SQLite database for tests\n        let db_path = \":memory:\";\n\n        DaemonConfig {\n            server: ServerConfig {\n                host: \"127.0.0.1\".to_string(),\n                port: 50051,\n                max_connections: 100,\n                connection_timeout_secs: 30,\n                request_timeout_secs: 60,\n                enable_tls: false,\n            },\n            database: DatabaseConfig {\n                sqlite_path: db_path.to_string(),\n                max_connections: 5,\n                connection_timeout_secs: 30,\n                enable_wal: true,\n            },\n            qdrant: QdrantConfig {\n                url: \"http://localhost:6333\".to_string(),\n                api_key: None,\n                timeout_secs: 30,\n                max_retries: 3,\n                default_collection: CollectionConfig {\n                    vector_size: 384,\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    replication_factor: 1,\n                    shard_number: 1,\n                },\n            },\n            processing: ProcessingConfig {\n                max_concurrent_tasks: 2,\n                default_chunk_size: 1000,\n                default_chunk_overlap: 200,\n                max_file_size_bytes: 1024 * 1024,\n                supported_extensions: vec![\"txt\".to_string(), \"md\".to_string()],\n                enable_lsp: false,\n                lsp_timeout_secs: 10,\n            },\n            file_watcher: FileWatcherConfig {\n                enabled: false,\n                debounce_ms: 500,\n                max_watched_dirs: 10,\n                ignore_patterns: vec![],\n                recursive: true,\n            },\n            metrics: MetricsConfig {\n                enabled: false,\n                collection_interval_secs: 60,\n                retention_days: 30,\n                enable_prometheus: false,\n                prometheus_port: 9090,\n            },\n            logging: LoggingConfig {\n                level: \"info\".to_string(),\n                file_path: None,\n                json_format: false,\n                max_file_size_mb: 100,\n                max_files: 5,\n            },\n        }\n    }\n\n    async fn create_test_daemon() -\u003e Arc\u003cWorkspaceDaemon\u003e {\n        let config = create_test_daemon_config();\n        Arc::new(WorkspaceDaemon::new(config).await.expect(\"Failed to create daemon\"))\n    }\n\n    #[tokio::test]\n    async fn test_document_processor_impl_new() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon.clone());\n\n        assert!(Arc::ptr_eq(\u0026processor.daemon, \u0026daemon));\n    }\n\n    #[tokio::test]\n    async fn test_document_processor_impl_debug() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let debug_str = format!(\"{:?}\", processor);\n        assert!(debug_str.contains(\"DocumentProcessorImpl\"));\n        assert!(debug_str.contains(\"daemon\"));\n    }\n\n    #[tokio::test]\n    async fn test_process_document_basic() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let request = Request::new(ProcessDocumentRequest {\n            project_id: \"test_project\".to_string(),\n            document_type: crate::proto::DocumentType::Text as i32,\n            file_path: \"/test/document.txt\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n            metadata: HashMap::new(),\n            options: None,\n        });\n\n        let result = processor.process_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.document_id.is_empty());\n        assert_eq!(response.status, crate::proto::ProcessingStatus::Completed as i32);\n        assert!(response.error_message.is_empty());\n        assert_eq!(response.chunks_created, 1);\n        assert!(response.processed_at.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_process_document_with_metadata() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let mut metadata = HashMap::new();\n        metadata.insert(\"author\".to_string(), \"test_author\".to_string());\n        metadata.insert(\"version\".to_string(), \"1.0\".to_string());\n\n        let request = Request::new(ProcessDocumentRequest {\n            project_id: \"test_project\".to_string(),\n            document_type: crate::proto::DocumentType::Text as i32,\n            file_path: \"/test/document_with_metadata.txt\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n            metadata,\n            options: None,\n        });\n\n        let result = processor.process_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.document_id.is_empty());\n        assert_eq!(response.status, crate::proto::ProcessingStatus::Completed as i32);\n    }\n\n    #[tokio::test]\n    async fn test_process_document_different_file_types() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let file_types = [\n            \"document.txt\",\n            \"readme.md\",\n            \"script.py\",\n            \"code.rs\",\n            \"data.json\",\n            \"page.html\",\n        ];\n\n        for file_name in file_types {\n            let request = Request::new(ProcessDocumentRequest {\n                project_id: \"test_project\".to_string(),\n                document_type: crate::proto::DocumentType::Text as i32,\n                file_path: format!(\"/test/{}\", file_name),\n                collection_name: \"test_collection\".to_string(),\n                metadata: HashMap::new(),\n                options: None,\n            });\n\n            let result = processor.process_document(request).await;\n            assert!(result.is_ok(), \"Failed to process file: {}\", file_name);\n\n            let response = result.unwrap().into_inner();\n            assert!(!response.document_id.is_empty());\n            assert_eq!(response.status, crate::proto::ProcessingStatus::Completed as i32);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_get_processing_status() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let request = Request::new(ProcessingStatusRequest {\n            operation_id: \"test_operation_123\".to_string(),\n        });\n\n        let result = processor.get_processing_status(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.operation_id, \"test_operation_123\");\n        assert_eq!(response.status, crate::proto::ProcessingStatus::Completed as i32);\n        assert_eq!(response.total_documents, 1);\n        assert_eq!(response.processed_documents, 1);\n        assert_eq!(response.failed_documents, 0);\n        assert!(response.error_messages.is_empty());\n        assert!(response.started_at.is_some());\n        assert!(response.updated_at.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_get_processing_status_different_operation_ids() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let operation_ids = [\n            \"op_1\",\n            \"operation_with_underscores_123\",\n            \"uuid-like-operation-456\",\n            \"simple\",\n        ];\n\n        for op_id in operation_ids {\n            let request = Request::new(ProcessingStatusRequest {\n                operation_id: op_id.to_string(),\n            });\n\n            let result = processor.get_processing_status(request).await;\n            assert!(result.is_ok(), \"Failed for operation ID: {}\", op_id);\n\n            let response = result.unwrap().into_inner();\n            assert_eq!(response.operation_id, op_id);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_cancel_processing() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let request = Request::new(CancelProcessingRequest {\n            operation_id: \"test_cancel_operation\".to_string(),\n        });\n\n        let result = processor.cancel_processing(request).await;\n        assert!(result.is_ok());\n\n        // Response should be empty unit type\n        let response = result.unwrap().into_inner();\n        assert_eq!(response, ());\n    }\n\n    #[tokio::test]\n    async fn test_cancel_processing_multiple_operations() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let operation_ids = [\n            \"cancel_op_1\",\n            \"cancel_op_2\",\n            \"cancel_op_3\",\n        ];\n\n        for op_id in operation_ids {\n            let request = Request::new(CancelProcessingRequest {\n                operation_id: op_id.to_string(),\n            });\n\n            let result = processor.cancel_processing(request).await;\n            assert!(result.is_ok(), \"Failed to cancel operation: {}\", op_id);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_process_document_unique_ids() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let mut document_ids = std::collections::HashSet::new();\n\n        // Process multiple documents and verify unique IDs\n        for i in 0..5 {\n            let request = Request::new(ProcessDocumentRequest {\n                project_id: \"test_project\".to_string(),\n                document_type: crate::proto::DocumentType::Text as i32,\n                file_path: format!(\"/test/document_{}.txt\", i),\n                collection_name: \"test_collection\".to_string(),\n                metadata: HashMap::new(),\n                options: None,\n            });\n\n            let result = processor.process_document(request).await;\n            assert!(result.is_ok());\n\n            let response = result.unwrap().into_inner();\n            assert!(document_ids.insert(response.document_id.clone()),\n                    \"Duplicate document ID generated: {}\", response.document_id);\n        }\n\n        assert_eq!(document_ids.len(), 5);\n    }\n\n    #[tokio::test]\n    async fn test_process_document_timestamps() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let before_processing = chrono::Utc::now().timestamp();\n\n        let request = Request::new(ProcessDocumentRequest {\n            project_id: \"test_project\".to_string(),\n            document_type: crate::proto::DocumentType::Text as i32,\n            file_path: \"/test/timestamp_test.txt\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n            metadata: HashMap::new(),\n            options: None,\n        });\n\n        let result = processor.process_document(request).await;\n        assert!(result.is_ok());\n\n        let after_processing = chrono::Utc::now().timestamp();\n        let response = result.unwrap().into_inner();\n\n        assert!(response.processed_at.is_some());\n        let processed_timestamp = response.processed_at.unwrap().seconds;\n        assert!(processed_timestamp \u003e= before_processing);\n        assert!(processed_timestamp \u003c= after_processing);\n    }\n\n    #[tokio::test]\n    async fn test_processing_status_timestamps() {\n        let daemon = create_test_daemon().await;\n        let processor = DocumentProcessorImpl::new(daemon);\n\n        let request = Request::new(ProcessingStatusRequest {\n            operation_id: \"timestamp_test_op\".to_string(),\n        });\n\n        let result = processor.get_processing_status(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(response.started_at.is_some());\n        assert!(response.updated_at.is_some());\n\n        let started_timestamp = response.started_at.unwrap().seconds;\n        let updated_timestamp = response.updated_at.unwrap().seconds;\n\n        // Updated timestamp should be after started timestamp\n        assert!(updated_timestamp \u003e= started_timestamp);\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_document_processing() {\n        let daemon = create_test_daemon().await;\n        let processor = Arc::new(DocumentProcessorImpl::new(daemon));\n\n        let mut handles = vec![];\n\n        // Process multiple documents concurrently\n        for i in 0..5 {\n            let processor_clone = Arc::clone(\u0026processor);\n            let handle = tokio::spawn(async move {\n                let request = Request::new(ProcessDocumentRequest {\n                    project_id: \"test_project\".to_string(),\n                    document_type: crate::proto::DocumentType::Text as i32,\n                    file_path: format!(\"/test/concurrent_doc_{}.txt\", i),\n                    collection_name: \"test_collection\".to_string(),\n                    metadata: HashMap::new(),\n                    options: None,\n                });\n\n                processor_clone.process_document(request).await\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all tasks to complete\n        let results: Vec\u003c_\u003e = futures_util::future::join_all(handles).await;\n\n        // All tasks should complete successfully\n        for (i, result) in results.into_iter().enumerate() {\n            let task_result = result.unwrap();\n            assert!(task_result.is_ok(), \"Task {} failed\", i);\n\n            let response = task_result.unwrap().into_inner();\n            assert!(!response.document_id.is_empty());\n            assert_eq!(response.status, crate::proto::ProcessingStatus::Completed as i32);\n        }\n    }\n\n    #[test]\n    fn test_document_processor_impl_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cDocumentProcessorImpl\u003e();\n        assert_sync::\u003cDocumentProcessorImpl\u003e();\n    }\n}","traces":[{"line":21,"address":[],"length":0,"stats":{"Line":14}},{"line":62,"address":[],"length":0,"stats":{"Line":0}},{"line":63,"address":[],"length":0,"stats":{"Line":0}},{"line":65,"address":[],"length":0,"stats":{"Line":0}},{"line":66,"address":[],"length":0,"stats":{"Line":0}},{"line":81,"address":[],"length":0,"stats":{"Line":0}},{"line":82,"address":[],"length":0,"stats":{"Line":0}},{"line":85,"address":[],"length":0,"stats":{"Line":0}},{"line":86,"address":[],"length":0,"stats":{"Line":0}},{"line":87,"address":[],"length":0,"stats":{"Line":0}}],"covered":1,"coverable":10},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","services","memory_service.rs"],"content":"//! Memory management gRPC service implementation\n\nuse crate::daemon::WorkspaceDaemon;\nuse crate::proto::{\n    memory_service_server::MemoryService,\n    AddDocumentRequest, AddDocumentResponse,\n    UpdateDocumentRequest, UpdateDocumentResponse,\n    RemoveDocumentRequest, GetDocumentRequest, GetDocumentResponse,\n    ListDocumentsRequest, ListDocumentsResponse,\n    CreateCollectionRequest, CreateCollectionResponse,\n    DeleteCollectionRequest, ListCollectionsRequest, ListCollectionsResponse,\n    DocumentInfo, CollectionInfo, DocumentContent, CollectionConfig,\n};\nuse std::sync::Arc;\nuse tonic::{Request, Response, Status};\nuse tracing::{debug, error, info};\n\n/// Memory service implementation\n#[derive(Debug)]\npub struct MemoryServiceImpl {\n    daemon: Arc\u003cWorkspaceDaemon\u003e,\n}\n\nimpl MemoryServiceImpl {\n    pub fn new(daemon: Arc\u003cWorkspaceDaemon\u003e) -\u003e Self {\n        Self { daemon }\n    }\n}\n\n#[tonic::async_trait]\nimpl MemoryService for MemoryServiceImpl {\n    async fn add_document(\n        \u0026self,\n        request: Request\u003cAddDocumentRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cAddDocumentResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Adding document: {}\", req.file_path);\n\n        // TODO: Implement actual document addition\n        let response = AddDocumentResponse {\n            document_id: uuid::Uuid::new_v4().to_string(),\n            success: true,\n            error_message: String::new(),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn update_document(\n        \u0026self,\n        request: Request\u003cUpdateDocumentRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cUpdateDocumentResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Updating document: {}\", req.document_id);\n\n        // TODO: Implement actual document update\n        let response = UpdateDocumentResponse {\n            success: true,\n            error_message: String::new(),\n            updated_at: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp(),\n                nanos: 0,\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn remove_document(\n        \u0026self,\n        request: Request\u003cRemoveDocumentRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003c()\u003e, Status\u003e {\n        let req = request.into_inner();\n        info!(\"Removing document: {} from collection: {}\", req.document_id, req.collection_name);\n\n        // TODO: Implement actual document removal\n\n        Ok(Response::new(()))\n    }\n\n    async fn get_document(\n        \u0026self,\n        request: Request\u003cGetDocumentRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cGetDocumentResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Getting document: {} from collection: {}\", req.document_id, req.collection_name);\n\n        // TODO: Implement actual document retrieval\n        let response = GetDocumentResponse {\n            document_id: req.document_id.clone(),\n            content: Some(DocumentContent {\n                text: \"Example document content\".to_string(),\n                chunks: vec![],\n                extracted_metadata: std::collections::HashMap::new(),\n            }),\n            metadata: std::collections::HashMap::new(),\n            created_at: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp() - 86400,\n                nanos: 0,\n            }),\n            updated_at: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp(),\n                nanos: 0,\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn list_documents(\n        \u0026self,\n        request: Request\u003cListDocumentsRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cListDocumentsResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Listing documents in collection: {}\", req.collection_name);\n\n        // TODO: Implement actual document listing\n        let response = ListDocumentsResponse {\n            documents: vec![\n                DocumentInfo {\n                    document_id: uuid::Uuid::new_v4().to_string(),\n                    file_path: \"/example/document.txt\".to_string(),\n                    title: \"Example Document\".to_string(),\n                    document_type: crate::proto::DocumentType::Text as i32,\n                    file_size: 1024,\n                    metadata: std::collections::HashMap::new(),\n                    created_at: Some(prost_types::Timestamp {\n                        seconds: chrono::Utc::now().timestamp() - 86400,\n                        nanos: 0,\n                    }),\n                    updated_at: Some(prost_types::Timestamp {\n                        seconds: chrono::Utc::now().timestamp(),\n                        nanos: 0,\n                    }),\n                },\n            ],\n            total_count: 1,\n            has_more: false,\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn create_collection(\n        \u0026self,\n        request: Request\u003cCreateCollectionRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cCreateCollectionResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        info!(\"Creating collection: {} for project: {}\", req.collection_name, req.project_id);\n\n        // TODO: Implement actual collection creation\n        let response = CreateCollectionResponse {\n            success: true,\n            error_message: String::new(),\n            collection_id: uuid::Uuid::new_v4().to_string(),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn delete_collection(\n        \u0026self,\n        request: Request\u003cDeleteCollectionRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003c()\u003e, Status\u003e {\n        let req = request.into_inner();\n        info!(\"Deleting collection: {} for project: {} (force: {})\",\n              req.collection_name, req.project_id, req.force);\n\n        // TODO: Implement actual collection deletion\n\n        Ok(Response::new(()))\n    }\n\n    async fn list_collections(\n        \u0026self,\n        request: Request\u003cListCollectionsRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cListCollectionsResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Listing collections for project: {}\", req.project_id);\n\n        // TODO: Implement actual collection listing\n        let response = ListCollectionsResponse {\n            collections: vec![\n                CollectionInfo {\n                    collection_name: \"example-collection\".to_string(),\n                    collection_id: uuid::Uuid::new_v4().to_string(),\n                    project_id: req.project_id.clone(),\n                    document_count: 10,\n                    total_size_bytes: 10240,\n                    config: Some(CollectionConfig {\n                        vector_size: 384,\n                        distance_metric: \"Cosine\".to_string(),\n                        enable_indexing: true,\n                        metadata_schema: std::collections::HashMap::new(),\n                    }),\n                    created_at: Some(prost_types::Timestamp {\n                        seconds: chrono::Utc::now().timestamp() - 86400,\n                        nanos: 0,\n                    }),\n                },\n            ],\n        };\n\n        Ok(Response::new(response))\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::*;\n    use tempfile::TempDir;\n    use tonic::Request;\n    use tokio_test;\n    use std::collections::HashMap;\n\n    fn create_test_daemon_config() -\u003e DaemonConfig {\n        // Use in-memory SQLite database for tests\n        let db_path = \":memory:\";\n\n        DaemonConfig {\n            server: ServerConfig {\n                host: \"127.0.0.1\".to_string(),\n                port: 50053,\n                max_connections: 100,\n                connection_timeout_secs: 30,\n                request_timeout_secs: 60,\n                enable_tls: false,\n            },\n            database: DatabaseConfig {\n                sqlite_path: db_path.to_string(),\n                max_connections: 5,\n                connection_timeout_secs: 30,\n                enable_wal: true,\n            },\n            qdrant: QdrantConfig {\n                url: \"http://localhost:6333\".to_string(),\n                api_key: None,\n                timeout_secs: 30,\n                max_retries: 3,\n                default_collection: crate::config::CollectionConfig {\n                    vector_size: 384,\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    replication_factor: 1,\n                    shard_number: 1,\n                },\n            },\n            processing: ProcessingConfig {\n                max_concurrent_tasks: 2,\n                default_chunk_size: 1000,\n                default_chunk_overlap: 200,\n                max_file_size_bytes: 1024 * 1024,\n                supported_extensions: vec![\"txt\".to_string(), \"md\".to_string()],\n                enable_lsp: false,\n                lsp_timeout_secs: 10,\n            },\n            file_watcher: FileWatcherConfig {\n                enabled: false,\n                debounce_ms: 500,\n                max_watched_dirs: 10,\n                ignore_patterns: vec![],\n                recursive: true,\n            },\n            metrics: MetricsConfig {\n                enabled: false,\n                collection_interval_secs: 60,\n                retention_days: 30,\n                enable_prometheus: false,\n                prometheus_port: 9090,\n            },\n            logging: LoggingConfig {\n                level: \"info\".to_string(),\n                file_path: None,\n                json_format: false,\n                max_file_size_mb: 100,\n                max_files: 5,\n            },\n        }\n    }\n\n    async fn create_test_daemon() -\u003e Arc\u003cWorkspaceDaemon\u003e {\n        let config = create_test_daemon_config();\n        Arc::new(WorkspaceDaemon::new(config).await.expect(\"Failed to create daemon\"))\n    }\n\n    #[tokio::test]\n    async fn test_memory_service_impl_new() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon.clone());\n\n        assert!(Arc::ptr_eq(\u0026service.daemon, \u0026daemon));\n    }\n\n    #[tokio::test]\n    async fn test_memory_service_impl_debug() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let debug_str = format!(\"{:?}\", service);\n        assert!(debug_str.contains(\"MemoryServiceImpl\"));\n        assert!(debug_str.contains(\"daemon\"));\n    }\n\n    #[tokio::test]\n    async fn test_add_document_basic() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(AddDocumentRequest {\n            file_path: \"/test/document.txt\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n            content: Some(DocumentContent {\n                text: \"Test document content\".to_string(),\n                chunks: vec![],\n                extracted_metadata: HashMap::new(),\n            }),\n            metadata: HashMap::new(),\n            project_id: \"test_project\".to_string(),\n        });\n\n        let result = service.add_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.document_id.is_empty());\n        assert!(response.success);\n        assert!(response.error_message.is_empty());\n    }\n\n    #[tokio::test]\n    async fn test_add_document_with_metadata() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let mut metadata = HashMap::new();\n        metadata.insert(\"author\".to_string(), \"John Doe\".to_string());\n        metadata.insert(\"category\".to_string(), \"documentation\".to_string());\n        metadata.insert(\"version\".to_string(), \"1.0\".to_string());\n\n        let mut extracted_metadata = HashMap::new();\n        extracted_metadata.insert(\"word_count\".to_string(), \"150\".to_string());\n        extracted_metadata.insert(\"language\".to_string(), \"en\".to_string());\n\n        let request = Request::new(AddDocumentRequest {\n            file_path: \"/test/document_with_metadata.txt\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n            content: Some(DocumentContent {\n                text: \"Test document with metadata\".to_string(),\n                chunks: vec![\n                    crate::proto::DocumentChunk {\n                        id: \"chunk1\".to_string(),\n                        content: \"First chunk content\".to_string(),\n                        start_offset: 0,\n                        end_offset: 50,\n                        metadata: HashMap::new(),\n                    },\n                    crate::proto::DocumentChunk {\n                        id: \"chunk2\".to_string(),\n                        content: \"Second chunk content\".to_string(),\n                        start_offset: 51,\n                        end_offset: 100,\n                        metadata: HashMap::new(),\n                    },\n                ],\n                extracted_metadata,\n            }),\n            metadata,\n            project_id: \"test_project\".to_string(),\n        });\n\n        let result = service.add_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.document_id.is_empty());\n        assert!(response.success);\n    }\n\n    #[tokio::test]\n    async fn test_add_document_different_file_types() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let file_types = [\n            (\"document.txt\", \"text/plain\"),\n            (\"readme.md\", \"text/markdown\"),\n            (\"script.py\", \"text/x-python\"),\n            (\"code.rs\", \"text/x-rust\"),\n            (\"data.json\", \"application/json\"),\n            (\"page.html\", \"text/html\"),\n        ];\n\n        for (file_name, _mime_type) in file_types {\n            let request = Request::new(AddDocumentRequest {\n                file_path: format!(\"/test/{}\", file_name),\n                collection_name: \"test_collection\".to_string(),\n                content: Some(DocumentContent {\n                    text: format!(\"Content for {}\", file_name),\n                    chunks: vec![],\n                    extracted_metadata: HashMap::new(),\n                }),\n                metadata: HashMap::new(),\n                project_id: \"test_project\".to_string(),\n            });\n\n            let result = service.add_document(request).await;\n            assert!(result.is_ok(), \"Failed to add document: {}\", file_name);\n\n            let response = result.unwrap().into_inner();\n            assert!(response.success);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_update_document_basic() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(UpdateDocumentRequest {\n            document_id: \"test_doc_123\".to_string(),\n            content: Some(DocumentContent {\n                text: \"Updated document content\".to_string(),\n                chunks: vec![],\n                extracted_metadata: HashMap::new(),\n            }),\n            metadata: HashMap::new(),\n        });\n\n        let result = service.update_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(response.success);\n        assert!(response.error_message.is_empty());\n        assert!(response.updated_at.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_update_document_timestamp() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let before_update = chrono::Utc::now().timestamp();\n\n        let request = Request::new(UpdateDocumentRequest {\n            document_id: \"timestamp_test_doc\".to_string(),\n            content: Some(DocumentContent {\n                text: \"Timestamp test content\".to_string(),\n                chunks: vec![],\n                extracted_metadata: HashMap::new(),\n            }),\n            metadata: HashMap::new(),\n        });\n\n        let result = service.update_document(request).await;\n        assert!(result.is_ok());\n\n        let after_update = chrono::Utc::now().timestamp();\n        let response = result.unwrap().into_inner();\n\n        assert!(response.updated_at.is_some());\n        let updated_timestamp = response.updated_at.unwrap().seconds;\n        assert!(updated_timestamp \u003e= before_update);\n        assert!(updated_timestamp \u003c= after_update);\n    }\n\n    #[tokio::test]\n    async fn test_remove_document() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(RemoveDocumentRequest {\n            document_id: \"doc_to_remove\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n        });\n\n        let result = service.remove_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response, ());\n    }\n\n    #[tokio::test]\n    async fn test_get_document() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let document_id = \"test_document_123\";\n        let collection_name = \"test_collection\";\n\n        let request = Request::new(GetDocumentRequest {\n            document_id: document_id.to_string(),\n            collection_name: collection_name.to_string(),\n        });\n\n        let result = service.get_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.document_id, document_id);\n        assert!(response.content.is_some());\n        assert!(response.created_at.is_some());\n        assert!(response.updated_at.is_some());\n\n        let content = response.content.unwrap();\n        assert_eq!(content.text, \"Example document content\");\n    }\n\n    #[tokio::test]\n    async fn test_get_document_timestamps() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(GetDocumentRequest {\n            document_id: \"timestamp_doc\".to_string(),\n            collection_name: \"test_collection\".to_string(),\n        });\n\n        let result = service.get_document(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(response.created_at.is_some());\n        assert!(response.updated_at.is_some());\n\n        let created_timestamp = response.created_at.unwrap().seconds;\n        let updated_timestamp = response.updated_at.unwrap().seconds;\n\n        // Updated should be after created (or equal)\n        assert!(updated_timestamp \u003e= created_timestamp);\n    }\n\n    #[tokio::test]\n    async fn test_list_documents() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(ListDocumentsRequest {\n            collection_name: \"test_collection\".to_string(),\n            project_id: \"test_project\".to_string(),\n            limit: 10,\n            offset: 0,\n            filter: None,\n        });\n\n        let result = service.list_documents(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.documents.len(), 1);\n        assert_eq!(response.total_count, 1);\n        assert!(!response.has_more);\n\n        let document = \u0026response.documents[0];\n        assert!(!document.document_id.is_empty());\n        assert_eq!(document.file_path, \"/example/document.txt\");\n        assert_eq!(document.title, \"Example Document\");\n        assert_eq!(document.file_size, 1024);\n        assert!(document.created_at.is_some());\n        assert!(document.updated_at.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_list_documents_pagination() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let pagination_params = [\n            (10, 0),   // First page\n            (5, 5),    // Second page\n            (1, 0),    // Single result\n            (20, 10),  // Larger offset\n        ];\n\n        for (limit, offset) in pagination_params {\n            let request = Request::new(ListDocumentsRequest {\n                collection_name: \"test_collection\".to_string(),\n                project_id: \"test_project\".to_string(),\n                limit,\n                offset,\n                filter: None,\n            });\n\n            let result = service.list_documents(request).await;\n            assert!(result.is_ok(), \"Failed for limit={}, offset={}\", limit, offset);\n\n            let response = result.unwrap().into_inner();\n            assert!(response.total_count \u003e= 0);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_create_collection() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(CreateCollectionRequest {\n            collection_name: \"new_collection\".to_string(),\n            project_id: \"test_project\".to_string(),\n            config: Some(crate::proto::CollectionConfig {\n                vector_size: 384,\n                distance_metric: \"Cosine\".to_string(),\n                enable_indexing: true,\n                metadata_schema: HashMap::new(),\n            }),\n        });\n\n        let result = service.create_collection(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(response.success);\n        assert!(response.error_message.is_empty());\n        assert!(!response.collection_id.is_empty());\n    }\n\n    #[tokio::test]\n    async fn test_create_collection_different_configs() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let configs = [\n            (384, \"Cosine\", true),\n            (512, \"Euclidean\", false),\n            (768, \"Dot\", true),\n            (256, \"Cosine\", false),\n        ];\n\n        for (i, (vector_size, distance_metric, enable_indexing)) in configs.iter().enumerate() {\n            let request = Request::new(CreateCollectionRequest {\n                collection_name: format!(\"collection_{}\", i),\n                project_id: \"test_project\".to_string(),\n                config: Some(crate::proto::CollectionConfig {\n                    vector_size: *vector_size,\n                    distance_metric: distance_metric.to_string(),\n                    enable_indexing: *enable_indexing,\n                    metadata_schema: HashMap::new(),\n                }),\n            });\n\n            let result = service.create_collection(request).await;\n            assert!(result.is_ok(), \"Failed for config: {:?}\", (vector_size, distance_metric, enable_indexing));\n\n            let response = result.unwrap().into_inner();\n            assert!(response.success);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_delete_collection() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(DeleteCollectionRequest {\n            collection_name: \"collection_to_delete\".to_string(),\n            project_id: \"test_project\".to_string(),\n            force: false,\n        });\n\n        let result = service.delete_collection(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response, ());\n    }\n\n    #[tokio::test]\n    async fn test_delete_collection_force() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let request = Request::new(DeleteCollectionRequest {\n            collection_name: \"force_delete_collection\".to_string(),\n            project_id: \"test_project\".to_string(),\n            force: true,\n        });\n\n        let result = service.delete_collection(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response, ());\n    }\n\n    #[tokio::test]\n    async fn test_list_collections() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let project_id = \"test_project\";\n        let request = Request::new(ListCollectionsRequest {\n            project_id: project_id.to_string(),\n        });\n\n        let result = service.list_collections(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.collections.len(), 1);\n\n        let collection = \u0026response.collections[0];\n        assert_eq!(collection.collection_name, \"example-collection\");\n        assert!(!collection.collection_id.is_empty());\n        assert_eq!(collection.project_id, project_id);\n        assert_eq!(collection.document_count, 10);\n        assert_eq!(collection.total_size_bytes, 10240);\n        assert!(collection.config.is_some());\n        assert!(collection.created_at.is_some());\n\n        let config = collection.config.as_ref().unwrap();\n        assert_eq!(config.vector_size, 384);\n        assert_eq!(config.distance_metric, \"Cosine\");\n        assert!(config.enable_indexing);\n    }\n\n    #[tokio::test]\n    async fn test_list_collections_different_projects() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let project_ids = [\n            \"project_1\",\n            \"project_2\",\n            \"my-awesome-project\",\n            \"test_project_123\",\n        ];\n\n        for project_id in project_ids {\n            let request = Request::new(ListCollectionsRequest {\n                project_id: project_id.to_string(),\n            });\n\n            let result = service.list_collections(request).await;\n            assert!(result.is_ok(), \"Failed for project: {}\", project_id);\n\n            let response = result.unwrap().into_inner();\n            assert_eq!(response.collections.len(), 1);\n            assert_eq!(response.collections[0].project_id, project_id);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_memory_operations() {\n        let daemon = create_test_daemon().await;\n        let service = Arc::new(MemoryServiceImpl::new(daemon));\n\n        let mut handles = vec![];\n\n        // Perform multiple concurrent operations\n        for i in 0..5 {\n            let service_clone = Arc::clone(\u0026service);\n            let handle = tokio::spawn(async move {\n                // Add document\n                let add_request = Request::new(AddDocumentRequest {\n                    file_path: format!(\"/test/concurrent_doc_{}.txt\", i),\n                    collection_name: \"test_collection\".to_string(),\n                    content: Some(DocumentContent {\n                        text: format!(\"Concurrent document {}\", i),\n                        chunks: vec![],\n                        extracted_metadata: HashMap::new(),\n                    }),\n                    metadata: HashMap::new(),\n                    project_id: \"test_project\".to_string(),\n                });\n\n                let add_result = service_clone.add_document(add_request).await;\n\n                // List documents\n                let list_request = Request::new(ListDocumentsRequest {\n                    collection_name: \"test_collection\".to_string(),\n                    project_id: \"test_project\".to_string(),\n                    limit: 10,\n                    offset: 0,\n                    filter: None,\n                });\n\n                let list_result = service_clone.list_documents(list_request).await;\n\n                (add_result, list_result)\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all operations to complete\n        let results: Vec\u003c_\u003e = futures_util::future::join_all(handles).await;\n\n        // All operations should complete successfully\n        for (i, result) in results.into_iter().enumerate() {\n            let (add_result, list_result) = result.unwrap();\n            assert!(add_result.is_ok(), \"Add operation {} failed\", i);\n            assert!(list_result.is_ok(), \"List operation {} failed\", i);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_document_unique_ids() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let mut document_ids = std::collections::HashSet::new();\n\n        // Add multiple documents and verify unique IDs\n        for i in 0..5 {\n            let request = Request::new(AddDocumentRequest {\n                file_path: format!(\"/test/unique_doc_{}.txt\", i),\n                collection_name: \"test_collection\".to_string(),\n                content: Some(DocumentContent {\n                    text: format!(\"Unique document {}\", i),\n                    chunks: vec![],\n                    extracted_metadata: HashMap::new(),\n                }),\n                metadata: HashMap::new(),\n                project_id: \"test_project\".to_string(),\n            });\n\n            let result = service.add_document(request).await;\n            assert!(result.is_ok());\n\n            let response = result.unwrap().into_inner();\n            assert!(document_ids.insert(response.document_id.clone()),\n                    \"Duplicate document ID generated: {}\", response.document_id);\n        }\n\n        assert_eq!(document_ids.len(), 5);\n    }\n\n    #[tokio::test]\n    async fn test_collection_unique_ids() {\n        let daemon = create_test_daemon().await;\n        let service = MemoryServiceImpl::new(daemon);\n\n        let mut collection_ids = std::collections::HashSet::new();\n\n        // Create multiple collections and verify unique IDs\n        for i in 0..5 {\n            let request = Request::new(CreateCollectionRequest {\n                collection_name: format!(\"unique_collection_{}\", i),\n                project_id: \"test_project\".to_string(),\n                config: Some(crate::proto::CollectionConfig {\n                    vector_size: 384,\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    metadata_schema: HashMap::new(),\n                }),\n            });\n\n            let result = service.create_collection(request).await;\n            assert!(result.is_ok());\n\n            let response = result.unwrap().into_inner();\n            assert!(collection_ids.insert(response.collection_id.clone()),\n                    \"Duplicate collection ID generated: {}\", response.collection_id);\n        }\n\n        assert_eq!(collection_ids.len(), 5);\n    }\n\n    #[test]\n    fn test_memory_service_impl_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cMemoryServiceImpl\u003e();\n        assert_sync::\u003cMemoryServiceImpl\u003e();\n    }\n}","traces":[{"line":25,"address":[],"length":0,"stats":{"Line":22}}],"covered":1,"coverable":1},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","services","mod.rs"],"content":"//! gRPC service implementations\n\npub mod document_processor;\npub mod search_service;\npub mod memory_service;\npub mod system_service;\n\npub use document_processor::DocumentProcessorImpl;\npub use search_service::SearchServiceImpl;\npub use memory_service::MemoryServiceImpl;\npub use system_service::SystemServiceImpl;","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","services","search_service.rs"],"content":"//! Search service gRPC implementation\n\nuse crate::daemon::WorkspaceDaemon;\nuse crate::proto::{\n    search_service_server::SearchService,\n    HybridSearchRequest, HybridSearchResponse,\n    SemanticSearchRequest, SemanticSearchResponse,\n    KeywordSearchRequest, KeywordSearchResponse,\n    SuggestionsRequest, SuggestionsResponse,\n    SearchResult, SearchMetadata,\n};\nuse std::sync::Arc;\nuse tonic::{Request, Response, Status};\nuse tracing::{debug, error, info};\n\n/// Search service implementation\n#[deri
