ve(Debug)]\npub struct SearchServiceImpl {\n    daemon: Arc\u003cWorkspaceDaemon\u003e,\n}\n\nimpl SearchServiceImpl {\n    pub fn new(daemon: Arc\u003cWorkspaceDaemon\u003e) -\u003e Self {\n        Self { daemon }\n    }\n}\n\n#[tonic::async_trait]\nimpl SearchService for SearchServiceImpl {\n    async fn hybrid_search(\n        \u0026self,\n        request: Request\u003cHybridSearchRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cHybridSearchResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Hybrid search requested: {}\", req.query);\n\n        // TODO: Implement actual hybrid search\n        let response = HybridSearchResponse {\n            results: vec![\n                SearchResult {\n                    document_id: uuid::Uuid::new_v4().to_string(),\n                    collection_name: \"example\".to_string(),\n                    score: 0.95,\n                    semantic_score: 0.9,\n                    keyword_score: 0.85,\n                    title: \"Example Document\".to_string(),\n                    content_snippet: \"This is an example search result...\".to_string(),\n                    metadata: std::collections::HashMap::new(),\n                    file_path: \"/path/to/document.txt\".to_string(),\n                    matched_terms: vec![\"example\".to_string()],\n                },\n            ],\n            metadata: Some(SearchMetadata {\n                total_results: 1,\n                max_score: 0.95,\n                search_time: Some(prost_types::Timestamp {\n                    seconds: chrono::Utc::now().timestamp(),\n                    nanos: 0,\n                }),\n                search_duration_ms: 25,\n                searched_collections: vec![\"example\".to_string()],\n            }),\n            query_id: uuid::Uuid::new_v4().to_string(),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn semantic_search(\n        \u0026self,\n        request: Request\u003cSemanticSearchRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cSemanticSearchResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Semantic search requested: {}\", req.query);\n\n        // TODO: Implement actual semantic search\n        let response = SemanticSearchResponse {\n            results: vec![],\n            metadata: Some(SearchMetadata {\n                total_results: 0,\n                max_score: 0.0,\n                search_time: Some(prost_types::Timestamp {\n                    seconds: chrono::Utc::now().timestamp(),\n                    nanos: 0,\n                }),\n                search_duration_ms: 15,\n                searched_collections: vec![],\n            }),\n            query_id: uuid::Uuid::new_v4().to_string(),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn keyword_search(\n        \u0026self,\n        request: Request\u003cKeywordSearchRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cKeywordSearchResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Keyword search requested: {}\", req.query);\n\n        // TODO: Implement actual keyword search\n        let response = KeywordSearchResponse {\n            results: vec![],\n            metadata: Some(SearchMetadata {\n                total_results: 0,\n                max_score: 0.0,\n                search_time: Some(prost_types::Timestamp {\n                    seconds: chrono::Utc::now().timestamp(),\n                    nanos: 0,\n                }),\n                search_duration_ms: 10,\n                searched_collections: vec![],\n            }),\n            query_id: uuid::Uuid::new_v4().to_string(),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn get_suggestions(\n        \u0026self,\n        request: Request\u003cSuggestionsRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cSuggestionsResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Suggestions requested for: {}\", req.partial_query);\n\n        // TODO: Implement actual suggestions\n        let response = SuggestionsResponse {\n            suggestions: vec![\n                format!(\"{} complete\", req.partial_query),\n                format!(\"{} suggestion\", req.partial_query),\n            ],\n            metadata: Some(SearchMetadata {\n                total_results: 2,\n                max_score: 1.0,\n                search_time: Some(prost_types::Timestamp {\n                    seconds: chrono::Utc::now().timestamp(),\n                    nanos: 0,\n                }),\n                search_duration_ms: 5,\n                searched_collections: vec![],\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n    use crate::config::*;\n    use tempfile::TempDir;\n    use tonic::Request;\n    use tokio_test;\n    use std::collections::HashMap;\n\n    fn create_test_daemon_config() -\u003e DaemonConfig {\n        // Use in-memory SQLite database for tests\n        let db_path = \":memory:\";\n\n        DaemonConfig {\n            server: ServerConfig {\n                host: \"127.0.0.1\".to_string(),\n                port: 50054,\n                max_connections: 100,\n                connection_timeout_secs: 30,\n                request_timeout_secs: 60,\n                enable_tls: false,\n            },\n            database: DatabaseConfig {\n                sqlite_path: db_path.to_string(),\n                max_connections: 5,\n                connection_timeout_secs: 30,\n                enable_wal: true,\n            },\n            qdrant: QdrantConfig {\n                url: \"http://localhost:6333\".to_string(),\n                api_key: None,\n                timeout_secs: 30,\n                max_retries: 3,\n                default_collection: CollectionConfig {\n                    vector_size: 384,\n                    distance_metric: \"Cosine\".to_string(),\n                    enable_indexing: true,\n                    replication_factor: 1,\n                    shard_number: 1,\n                },\n            },\n            processing: ProcessingConfig {\n                max_concurrent_tasks: 2,\n                default_chunk_size: 1000,\n                default_chunk_overlap: 200,\n                max_file_size_bytes: 1024 * 1024,\n                supported_extensions: vec![\"txt\".to_string(), \"md\".to_string()],\n                enable_lsp: false,\n                lsp_timeout_secs: 10,\n            },\n            file_watcher: FileWatcherConfig {\n                enabled: false,\n                debounce_ms: 500,\n                max_watched_dirs: 10,\n                ignore_patterns: vec![],\n                recursive: true,\n            },\n            metrics: MetricsConfig {\n                enabled: false,\n                collection_interval_secs: 60,\n                retention_days: 30,\n                enable_prometheus: false,\n                prometheus_port: 9090,\n            },\n            logging: LoggingConfig {\n                level: \"info\".to_string(),\n                file_path: None,\n                json_format: false,\n                max_file_size_mb: 100,\n                max_files: 5,\n            },\n        }\n    }\n\n    async fn create_test_daemon() -\u003e Arc\u003cWorkspaceDaemon\u003e {\n        let config = create_test_daemon_config();\n        Arc::new(WorkspaceDaemon::new(config).await.expect(\"Failed to create daemon\"))\n    }\n\n    // Helper function to create proper HybridSearchRequest\n    fn create_hybrid_search_request(\n        query: \u0026str,\n        semantic_weight: f32,\n        keyword_weight: f32,\n        limit: i32,\n        collection_names: Vec\u003cString\u003e\n    ) -\u003e HybridSearchRequest {\n        HybridSearchRequest {\n            query: query.to_string(),\n            context: crate::proto::SearchContext::Project as i32,\n            options: Some(crate::proto::SearchOptions {\n                limit,\n                score_threshold: 0.0,\n                include_metadata: true,\n                include_content: true,\n                ranking: Some(crate::proto::RankingOptions {\n                    semantic_weight,\n                    keyword_weight,\n                    rrf_constant: 60.0,\n                }),\n            }),\n            project_id: \"test_project\".to_string(),\n            collection_names,\n        }\n    }\n\n    // Helper function to create SemanticSearchRequest\n    fn create_semantic_search_request(\n        query: \u0026str,\n        similarity_threshold: f32,\n        limit: i32,\n        collection_names: Vec\u003cString\u003e\n    ) -\u003e SemanticSearchRequest {\n        SemanticSearchRequest {\n            query: query.to_string(),\n            context: crate::proto::SearchContext::Project as i32,\n            options: Some(crate::proto::SearchOptions {\n                limit,\n                score_threshold: similarity_threshold,\n                include_metadata: true,\n                include_content: true,\n                ranking: None,\n            }),\n            project_id: \"test_project\".to_string(),\n            collection_names,\n        }\n    }\n\n    // Helper function to create KeywordSearchRequest\n    fn create_keyword_search_request(\n        query: \u0026str,\n        limit: i32,\n        collection_names: Vec\u003cString\u003e\n    ) -\u003e KeywordSearchRequest {\n        KeywordSearchRequest {\n            query: query.to_string(),\n            context: crate::proto::SearchContext::Project as i32,\n            options: Some(crate::proto::SearchOptions {\n                limit,\n                score_threshold: 0.0,\n                include_metadata: true,\n                include_content: true,\n                ranking: None,\n            }),\n            project_id: \"test_project\".to_string(),\n            collection_names,\n        }\n    }\n\n    // Helper function to create SuggestionsRequest\n    fn create_suggestions_request(\n        partial_query: \u0026str,\n        limit: i32,\n        collection_names: Vec\u003cString\u003e\n    ) -\u003e SuggestionsRequest {\n        SuggestionsRequest {\n            partial_query: partial_query.to_string(),\n            context: crate::proto::SearchContext::Project as i32,\n            max_suggestions: limit,\n            project_id: \"test_project\".to_string(),\n        }\n    }\n\n    #[tokio::test]\n    async fn test_search_service_impl_new() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon.clone());\n\n        assert!(Arc::ptr_eq(\u0026service.daemon, \u0026daemon));\n    }\n\n    #[tokio::test]\n    async fn test_search_service_impl_debug() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let debug_str = format!(\"{:?}\", service);\n        assert!(debug_str.contains(\"SearchServiceImpl\"));\n        assert!(debug_str.contains(\"daemon\"));\n    }\n\n    #[tokio::test]\n    async fn test_hybrid_search_basic() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let request = Request::new(HybridSearchRequest {\n            query: \"test query\".to_string(),\n            context: crate::proto::SearchContext::Collection as i32,\n            options: Some(crate::proto::SearchOptions {\n                limit: 10,\n                score_threshold: 0.0,\n                include_metadata: true,\n                include_content: true,\n                ranking: Some(crate::proto::RankingOptions {\n                    semantic_weight: 0.7,\n                    keyword_weight: 0.3,\n                    rrf_constant: 60.0,\n                }),\n            }),\n            project_id: \"test_project\".to_string(),\n            collection_names: vec![\"test_collection\".to_string()],\n        });\n\n        let result = service.hybrid_search(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.query_id.is_empty());\n        assert_eq!(response.results.len(), 1);\n        assert!(response.metadata.is_some());\n\n        let metadata = response.metadata.unwrap();\n        assert_eq!(metadata.total_results, 1);\n        assert_eq!(metadata.max_score, 0.95);\n        assert!(metadata.search_time.is_some());\n        assert_eq!(metadata.search_duration_ms, 25);\n    }\n\n    #[tokio::test]\n    async fn test_hybrid_search_different_queries() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let queries = [\n            \"simple query\",\n            \"complex search with multiple terms\",\n            \"特殊字符查询\", // Unicode characters\n            \"query with symbols !@#$%\",\n            \"12345 numeric query\",\n        ];\n\n        for query in queries {\n            let request = Request::new(create_hybrid_search_request(\n                query,\n                0.6,\n                0.4,\n                5,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.hybrid_search(request).await;\n            assert!(result.is_ok(), \"Failed for query: {}\", query);\n\n            let response = result.unwrap().into_inner();\n            assert!(!response.query_id.is_empty());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_hybrid_search_different_weights() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let weight_combinations = [\n            (1.0, 0.0), // Pure semantic\n            (0.0, 1.0), // Pure keyword\n            (0.5, 0.5), // Equal weights\n            (0.8, 0.2), // Semantic-heavy\n            (0.3, 0.7), // Keyword-heavy\n        ];\n\n        for (semantic, keyword) in weight_combinations {\n            let request = Request::new(create_hybrid_search_request(\n                \"test query\",\n                semantic,\n                keyword,\n                10,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.hybrid_search(request).await;\n            assert!(result.is_ok(), \"Failed for weights: semantic={}, keyword={}\", semantic, keyword);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_hybrid_search_metadata_validation() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let request = Request::new(create_hybrid_search_request(\n            \"test query with metadata\",\n            0.7,\n            0.3,\n            10,\n            vec![\"test_collection\".to_string()]\n        ));\n\n        let result = service.hybrid_search(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.query_id.is_empty());\n        assert!(response.metadata.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_hybrid_search_pagination() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let pagination_params = [\n            (10, 0),   // First page\n            (10, 10),  // Second page\n            (5, 0),    // Smaller page size\n            (20, 40),  // Larger offset\n            (1, 0),    // Single result\n        ];\n\n        for (limit, _offset) in pagination_params {\n            let request = Request::new(create_hybrid_search_request(\n                \"pagination test\",\n                0.7,\n                0.3,\n                limit,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.hybrid_search(request).await;\n            assert!(result.is_ok(), \"Failed for limit={}\", limit);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_semantic_search_basic() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let request = Request::new(create_semantic_search_request(\n            \"semantic search query\",\n            0.7,\n            10,\n            vec![\"test_collection\".to_string()]\n        ));\n\n        let result = service.semantic_search(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.query_id.is_empty());\n        assert!(response.metadata.is_some());\n\n        let metadata = response.metadata.unwrap();\n        assert!(metadata.search_time.is_some());\n        assert_eq!(metadata.search_duration_ms, 15);\n    }\n\n    #[tokio::test]\n    async fn test_semantic_search_different_thresholds() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let thresholds = [0.1, 0.3, 0.5, 0.7, 0.9];\n\n        for threshold in thresholds {\n            let request = Request::new(create_semantic_search_request(\n                \"threshold test\",\n                threshold,\n                10,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.semantic_search(request).await;\n            assert!(result.is_ok(), \"Failed for threshold: {}\", threshold);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_keyword_search_basic() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let request = Request::new(create_keyword_search_request(\n            \"keyword search\",\n            10,\n            vec![\"test_collection\".to_string()]\n        ));\n\n        let result = service.keyword_search(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.query_id.is_empty());\n        assert!(response.metadata.is_some());\n\n        let metadata = response.metadata.unwrap();\n        assert!(metadata.search_time.is_some());\n        assert_eq!(metadata.search_duration_ms, 10);\n    }\n\n    #[tokio::test]\n    async fn test_keyword_search_with_different_limits() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let limits = [1, 5, 10, 20, 50];\n\n        for limit in limits {\n            let request = Request::new(create_keyword_search_request(\n                \"limit test search\",\n                limit,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.keyword_search(request).await;\n            assert!(result.is_ok(), \"Failed for limit: {}\", limit);\n\n            let response = result.unwrap().into_inner();\n            assert!(!response.query_id.is_empty());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_keyword_search_different_queries() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let queries = [\"simple\", \"complex search terms\", \"special!@#$%\", \"numbers123\"];\n\n        for query in queries {\n            let request = Request::new(create_keyword_search_request(\n                query,\n                10,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.keyword_search(request).await;\n            assert!(result.is_ok(), \"Failed for query: {}\", query);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_get_suggestions_basic() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let request = Request::new(create_suggestions_request(\n            \"test\",\n            5,\n            vec![\"test_collection\".to_string()]\n        ));\n\n        let result = service.get_suggestions(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.suggestions.len(), 2);\n        assert!(response.suggestions[0].contains(\"test\"));\n        assert!(response.suggestions[1].contains(\"test\"));\n        assert!(response.metadata.is_some());\n\n        let metadata = response.metadata.unwrap();\n        assert_eq!(metadata.total_results, 2);\n        assert_eq!(metadata.search_duration_ms, 5);\n    }\n\n    #[tokio::test]\n    async fn test_get_suggestions_different_queries() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let partial_queries = [\n            \"t\",\n            \"te\",\n            \"test\",\n            \"testing\",\n            \"query\",\n            \"search\",\n        ];\n\n        for partial in partial_queries {\n            let request = Request::new(create_suggestions_request(\n                partial,\n                5,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.get_suggestions(request).await;\n            assert!(result.is_ok(), \"Failed for partial query: {}\", partial);\n\n            let response = result.unwrap().into_inner();\n            assert_eq!(response.suggestions.len(), 2);\n            for suggestion in \u0026response.suggestions {\n                assert!(suggestion.contains(partial));\n            }\n        }\n    }\n\n    #[tokio::test]\n    async fn test_get_suggestions_different_limits() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let limits = [1, 3, 5, 10, 20];\n\n        for limit in limits {\n            let request = Request::new(create_suggestions_request(\n                \"suggestion\",\n                limit,\n                vec![\"test_collection\".to_string()]\n            ));\n\n            let result = service.get_suggestions(request).await;\n            assert!(result.is_ok(), \"Failed for limit: {}\", limit);\n\n            let response = result.unwrap().into_inner();\n            // Current implementation returns 2 suggestions regardless of limit\n            assert_eq!(response.suggestions.len(), 2);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_search_service_multiple_collections() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let collections = vec![\n            \"collection1\".to_string(),\n            \"collection2\".to_string(),\n            \"documents\".to_string(),\n            \"code\".to_string(),\n        ];\n\n        let request = Request::new(create_hybrid_search_request(\n            \"multi-collection search\",\n            0.7,\n            0.3,\n            10,\n            collections.clone()\n        ));\n\n        let result = service.hybrid_search(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.query_id.is_empty());\n    }\n\n    #[tokio::test]\n    async fn test_search_timestamps() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let before_search = chrono::Utc::now().timestamp();\n\n        let request = Request::new(create_hybrid_search_request(\n            \"timestamp test\",\n            0.7,\n            0.3,\n            10,\n            vec![\"test_collection\".to_string()]\n        ));\n\n        let result = service.hybrid_search(request).await;\n        assert!(result.is_ok());\n\n        let after_search = chrono::Utc::now().timestamp();\n        let response = result.unwrap().into_inner();\n\n        assert!(response.metadata.is_some());\n        let metadata = response.metadata.unwrap();\n        assert!(metadata.search_time.is_some());\n\n        let search_timestamp = metadata.search_time.unwrap().seconds;\n        assert!(search_timestamp \u003e= before_search);\n        assert!(search_timestamp \u003c= after_search);\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_searches() {\n        let daemon = create_test_daemon().await;\n        let service = Arc::new(SearchServiceImpl::new(daemon));\n\n        let mut handles = vec![];\n\n        // Perform multiple concurrent searches\n        for i in 0..5 {\n            let service_clone = Arc::clone(\u0026service);\n            let handle = tokio::spawn(async move {\n                let request = Request::new(create_hybrid_search_request(\n                    \u0026format!(\"concurrent search {}\", i),\n                    0.7,\n                    0.3,\n                    10,\n                    vec![\"test_collection\".to_string()]\n                ));\n\n                service_clone.hybrid_search(request).await\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all searches to complete\n        let results: Vec\u003c_\u003e = futures_util::future::join_all(handles).await;\n\n        // All searches should complete successfully\n        for (i, result) in results.into_iter().enumerate() {\n            let task_result = result.unwrap();\n            assert!(task_result.is_ok(), \"Search {} failed\", i);\n\n            let response = task_result.unwrap().into_inner();\n            assert!(!response.query_id.is_empty());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_search_result_structure() {\n        let daemon = create_test_daemon().await;\n        let service = SearchServiceImpl::new(daemon);\n\n        let request = Request::new(create_hybrid_search_request(\n            \"structure test\",\n            0.7,\n            0.3,\n            10,\n            vec![\"test_collection\".to_string()]\n        ));\n\n        let result = service.hybrid_search(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.results.len(), 1);\n\n        let search_result = \u0026response.results[0];\n        assert!(!search_result.document_id.is_empty());\n        assert_eq!(search_result.collection_name, \"example\");\n        assert_eq!(search_result.score, 0.95);\n        assert_eq!(search_result.semantic_score, 0.9);\n        assert_eq!(search_result.keyword_score, 0.85);\n        assert_eq!(search_result.title, \"Example Document\");\n        assert!(!search_result.content_snippet.is_empty());\n        assert!(!search_result.file_path.is_empty());\n        assert_eq!(search_result.matched_terms.len(), 1);\n    }\n\n    #[test]\n    fn test_search_service_impl_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cSearchServiceImpl\u003e();\n        assert_sync::\u003cSearchServiceImpl\u003e();\n    }\n}","traces":[{"line":23,"address":[],"length":0,"stats":{"Line":20}}],"covered":1,"coverable":1},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","grpc","services","system_service.rs"],"content":"//! System administration gRPC service implementation\n\nuse crate::daemon::WorkspaceDaemon;\nuse crate::proto::{\n    system_service_server::SystemService,\n    HealthCheckResponse, SystemStatusResponse, MetricsRequest, MetricsResponse,\n    ConfigResponse, UpdateConfigRequest, DetectProjectRequest, DetectProjectResponse,\n    ListProjectsResponse, ServiceStatus, ComponentHealth, SystemMetrics, ProjectInfo,\n};\nuse std::sync::Arc;\nuse tonic::{Request, Response, Status};\nuse tracing::{debug, error, info};\n\n/// System service implementation\n#[derive(Debug)]\npub struct SystemServiceImpl {\n    daemon: Arc\u003cWorkspaceDaemon\u003e,\n}\n\nimpl SystemServiceImpl {\n    pub fn new(daemon: Arc\u003cWorkspaceDaemon\u003e) -\u003e Self {\n        Self { daemon }\n    }\n}\n\n#[tonic::async_trait]\nimpl SystemService for SystemServiceImpl {\n    async fn health_check(\n        \u0026self,\n        _request: Request\u003c()\u003e,\n    ) -\u003e Result\u003cResponse\u003cHealthCheckResponse\u003e, Status\u003e {\n        debug!(\"Health check requested\");\n\n        // TODO: Implement actual health checks\n        let response = HealthCheckResponse {\n            status: ServiceStatus::Healthy as i32,\n            components: vec![\n                ComponentHealth {\n                    component_name: \"database\".to_string(),\n                    status: ServiceStatus::Healthy as i32,\n                    message: \"SQLite database operational\".to_string(),\n                    last_check: Some(prost_types::Timestamp {\n                        seconds: chrono::Utc::now().timestamp(),\n                        nanos: 0,\n                    }),\n                },\n                ComponentHealth {\n                    component_name: \"qdrant\".to_string(),\n                    status: ServiceStatus::Healthy as i32,\n                    message: \"Qdrant connection active\".to_string(),\n                    last_check: Some(prost_types::Timestamp {\n                        seconds: chrono::Utc::now().timestamp(),\n                        nanos: 0,\n                    }),\n                },\n                ComponentHealth {\n                    component_name: \"file_watcher\".to_string(),\n                    status: ServiceStatus::Healthy as i32,\n                    message: \"File watching active\".to_string(),\n                    last_check: Some(prost_types::Timestamp {\n                        seconds: chrono::Utc::now().timestamp(),\n                        nanos: 0,\n                    }),\n                },\n            ],\n            timestamp: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp(),\n                nanos: 0,\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn get_status(\n        \u0026self,\n        _request: Request\u003c()\u003e,\n    ) -\u003e Result\u003cResponse\u003cSystemStatusResponse\u003e, Status\u003e {\n        debug!(\"System status requested\");\n\n        // TODO: Implement actual system status collection\n        let response = SystemStatusResponse {\n            status: ServiceStatus::Healthy as i32,\n            metrics: Some(SystemMetrics {\n                cpu_usage_percent: 15.5,\n                memory_usage_bytes: 128 * 1024 * 1024, // 128MB\n                memory_total_bytes: 8 * 1024 * 1024 * 1024, // 8GB\n                disk_usage_bytes: 2 * 1024 * 1024 * 1024, // 2GB\n                disk_total_bytes: 500 * 1024 * 1024 * 1024, // 500GB\n                active_connections: 5,\n                pending_operations: 0,\n            }),\n            active_projects: vec![\"workspace-qdrant-mcp\".to_string()],\n            total_documents: 1000,\n            total_collections: 5,\n            uptime_since: Some(prost_types::Timestamp {\n                seconds: chrono::Utc::now().timestamp() - 3600, // 1 hour ago\n                nanos: 0,\n            }),\n        };\n\n        Ok(Response::new(response))\n    }\n\n    async fn get_metrics(\n        \u0026self,\n        request: Request\u003cMetricsRequest\u003e,\n    ) -\u003e Result\u003cResponse\u003cMetricsResponse\u003e, Status\u003e {\n        let req = request.into_inner();\n        debug!(\"Metrics requested: {:?}\", req.metric_names);\n\n        // TODO: Implement actual metrics collection\n        let response = MetricsResponse {\n            metrics: vec![\n                crate::proto::Metric {\n                    name: \"grpc_requests_total\".to_string(),\n                    r#type: \"counter\".to_string(),\n                    labels: [(\"method\".to_string(), \"ProcessDocument\".to_string())].into_iter().c ate_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon.clone());\n\n        assert!(Arc::ptr_eq(\u0026service.daemon, \u0026daemon));\n    }\n\n    #[tokio::test]\n    async fn test_system_service_impl_debug() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let debug_str = format!(\"{:?}\", service);\n        assert!(debug_str.contains(\"SystemServiceImpl\"));\n        assert!(debug_str.contains(\"daemon\"));\n    }\n\n    #[tokio::test]\n    async fn test_health_check() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let request = Request::new(());\n        let result = service.health_check(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.status, ServiceStatus::Healthy as i32);\n        assert_eq!(response.components.len(), 3);\n        assert!(response.timestamp.is_some());\n\n        // Check individual components\n        let component_names: Vec\u003c_\u003e = response.components.iter()\n            .map(|c| c.component_name.as_str())\n            .collect();\n        assert!(component_names.contains(\u0026\"database\"));\n        assert!(component_names.contains(\u0026\"qdrant\"));\n        assert!(component_names.contains(\u0026\"file_watcher\"));\n\n        // All components should be healthy\n        for component in \u0026response.components {\n            assert_eq!(component.status, ServiceStatus::Healthy as i32);\n            assert!(!component.message.is_empty());\n            assert!(component.last_check.is_some());\n        }\n    }\n\n    #[tokio::test]\n    async fn test_health_check_timestamps() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let before_check = chrono::Utc::now().timestamp();\n        let request = Request::new(());\n cs.active_connections, 5);\n        assert_eq!(metrics.pending_operations, 0);\n    }\n\n    #[tokio::test]\n    async fn test_get_status_uptime() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let request = Request::new(());\n        let result = service.get_status(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(response.uptime_since.is_some());\n\n        let uptime_timestamp = response.uptime_since.unwrap().seconds;\n        let current_time = chrono::Utc::now().timestamp();\n\n        // Uptime should be in the past (simulated as 1 hour ago)\n        assert!(uptime_timestamp \u003c current_time);\n        assert!(current_time - uptime_timestamp \u003e= 3500); // Allow some margin\n    }\n\n    #[tokio::test]\n    async fn test_get_metrics_basic() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let request = Request::new(MetricsRequest {\n            since: None,\n            metric_names: vec![\"grpc_requests_total\".to_string()],\n        });\n\n        let result = service.get_metrics(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert_eq!(response.metrics.len(), 2);\n        assert!(response.collected_at.is_some());\n\n        // Check specific metrics\n        let grpc_metric = response.metrics.iter()\n            .find(|m| m.name == \"grpc_requests_total\")\n            .expect(\"grpc_requests_total metric not found\");\n        assert_eq!(grpc_metric.r#type, \"counter\");\n        assert_eq!(grpc_metric.value, 150.0);\n        assert!(grpc_metric.labels.contains_key(\"method\"));\n        assert!(grpc_metric.timestamp.is_some());\n\n        let duration_metric = response.metrics.iter()\n            .find(|m| m.name == \"document_processing_duration_seconds\")\n            .ex  response = result.unwrap().into_inner();\n        assert!(response.collected_at.is_some());\n\n        let collected_timestamp = response.collected_at.unwrap().seconds;\n        assert!(collected_timestamp \u003e= before_request \u0026\u0026 collected_timestamp \u003c= after_request);\n\n        // Check individual metric timestamps\n        for metric in \u0026response.metrics {\n            assert!(metric.timestamp.is_some());\n            let metric_timestamp = metric.timestamp.as_ref().unwrap().seconds;\n            assert!(metric_timestamp \u003e= before_request \u0026\u0026 metric_timestamp \u003c= after_request);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_get_config() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let request = Request::new(());\n        let result = service.get_config(request).await;\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(!response.configuration.is_empty());\n        assert!(!response.version.is_empty());\n\n        // Check specific configuration values\n        assert_eq!(response.configuration.get(\"server.host\").unwrap(), \"127.0.0.1\");\n        assert_eq!(response.configuration.get(\"server.port\").unwrap(), \"50051\");\n        assert_eq!(response.configuration.get(\"qdrant.url\").unwrap(), \"http://localhost:6333\");\n        assert!(response.configuration.contains_key(\"database.sqlite_path\"));\n        assert_eq!(response.configuration.get(\"processing.max_concurrent_tasks\").unwrap(), \"4\");\n\n        // Check version format\n        let version = \u0026response.version;\n        assert!(version.contains('.'), \"Version should contain dots: {}\", version);\n    }\n\n    #[tokio::test]\n    async fn test_update_config_basic() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let mut config_updates = HashMap: ect.name, \"example-project\");\n        assert_eq!(project.root_path, \"/path/to/project\");\n        assert_eq!(project.git_repository, \"https://github.com/example/project.git\");\n        assert_eq!(project.git_branch, \"main\");\n        assert!(project.submodules.is_empty());\n        assert!(project.metadata.contains_key(\"detected_at\"));\n        assert!(project.detected_at.is_some());\n    }\n\n    #[tokio::test]\n    async fn test_detect_project_different_paths() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let test_paths = [\n            \"/home/user/project\",\n            \"/Users/developer/workspace/my-app\",\n            \"./relative/path\",\n            \"../parent/project\",\n            \"/very/deep/nested/project/structure\",\n        ];\n\n        for path in test_paths {\n            let request = Request::new(DetectProjectRequest {\n                path: path.to_string(),\n            });\n\n            let result = service.detect_project(request).await;\n            assert!(result.is_ok(), \"Failed for path: {}\", path);\n\n            let response = result.unwrap().into_inner();\n            assert!(response.project.is_some());\n            assert_eq!(response.project.unwrap().root_path, path);\n        }\n    }\n\n    #[tokio::test]\n    async fn test_detect_project_timestamps() {\n        let daemon = create_test_daemon().await;\n        let service = SystemServiceImpl::new(daemon);\n\n        let before_detection = chrono::Utc::now().timestamp();\n        let request = Request::new(DetectProjectRequest {\n            path: \"/timestamp/test/project\".to_string(),\n        });\n\n        let result = service.detect_project(request).await;\n        let after_detection = chrono::Utc::now().timestamp();\n        assert!(result.is_ok());\n\n        let response = result.unwrap().into_inner();\n        assert!(response.project.is_some());\n\n        let project = response. ould be detected in the past (simulated as 1 day ago)\n        assert!(detected_timestamp \u003c current_time);\n        assert!(current_time - detected_timestamp \u003e= 86300); // Allow some margin for 1 day\n    }\n\n    #[tokio::test]\n    async fn test_concurrent_system_operations() {\n        let daemon = create_test_daemon().await;\n        let service = Arc::new(SystemServiceImpl::new(daemon));\n\n        let mut handles = vec![];\n\n        // Perform multiple concurrent system operations\n        for i in 0..5 {\n            let service_clone = Arc::clone(\u0026service);\n            let handle = tokio::spawn(async move {\n                // Health check\n                let health_request = Request::new(());\n                let health_result = service_clone.health_check(health_request).await;\n\n                // Get status\n                let status_request = Request::new(());\n                let status_result = service_clone.get_status(status_request).await;\n\n                // Get config\n                let config_request = Request::new(());\n                let config_result = service_clone.get_config(config_request).await;\n\n                // Project detection\n                let detect_request = Request::new(DetectProjectRequest {\n                    path: format!(\"/test/project_{}\", i),\n                });\n                let detect_result = service_clone.detect_project(detect_request).await;\n\n                (health_result, status_result, config_result, detect_result)\n            });\n            handles.push(handle);\n        }\n\n        // Wait for all operations to complete\n        let results: Vec\u003c_\u003e = futures_util::future::join_all(handles).await;\n\n        // All operations should complete successfully\n        for (i, result) in results.into_iter().enumerate() {\n            let (health_result, status_result, config_result, detect_result) = result.unwrap();\n            assert!(health_result.is_ok(), \"Health           assert!(metric.timestamp.is_some());\n        }\n    }\n\n    #[test]\n    fn test_system_service_impl_send_sync() {\n        fn assert_send\u003cT: Send\u003e() {}\n        fn assert_sync\u003cT: Sync\u003e() {}\n\n        assert_send::\u003cSystemServiceImpl\u003e();\n        assert_sync::\u003cSystemServiceImpl\u003e();\n    }\n}","traces":[{"line":21,"address":[],"length":0,"stats":{"Line":21}}],"covered":1,"coverable":1},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","lib.rs"],"content":"//! Workspace Qdrant Daemon Library\n//!\n//! This library provides the core functionality for the workspace document processing\n//! and vector search daemon.\n\npub mod config;\npub mod error;\npub mod daemon;\npub mod grpc;\n\n// Include generated protobuf code\npub mod proto {\n    tonic::include_proto!(\"workspace_daemon\");\n}\n\n// Re-export commonly used types\npub use config::*;\npub use error::*;","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","src","main.rs"],"content":"//! Workspace Qdrant Daemon\n//!\n//! High-performance Rust daemon for workspace document processing and vector search.\n//! Provides gRPC services for document processing, search operations, memory management,\n//! and system administration.\n\nuse anyhow::Result;\nuse clap::Parser;\nuse std::net::SocketAddr;\nuse tracing::{info, warn};\n\nmod grpc;\nmod daemon;\nmod config;\nmod error;\n\n// Include generated protobuf code\npub mod proto {\n    tonic::include_proto!(\"workspace_daemon\");\n}\n\n#[derive(Parser, Debug)]\n#[command(author, version, about, long_about = None)]\nstruct Args {\n    /// gRPC server address\n    #[arg(short, long, default_value = \"127.0.0.1:50051\")]\n    address: SocketAddr,\n\n    /// Configuration file path\n    #[arg(short, long)]\n    config: Option\u003cstd::path::PathBuf\u003e,\n\n    /// Log     assert!(!args.daemon);\n        assert!(args.config.is_none());\n    }\n\n    #[test]\n    fn test_args_custom_values() {\n        let args = Args::parse_from(\u0026[\n            \"test\",\n            \"-a\", \"0.0.0.0:8080\",\n            \"-l\", \"debug\",\n            \"--enable-metrics\",\n            \"--daemon\",\n            \"-c\", \"/path/to/config.yaml\"\n        ]);\n\n        assert_eq!(args.address.to_string(), \"0.0.0.0:8080\");\n        assert_eq!(args.log_level, \"debug\");\n        assert!(args.enable_metrics);\n        assert!(args.daemon);\n        assert_eq!(args.config.unwrap().to_string_lossy(), \"/path/to/config.yaml\");\n    }\n\n    #[test]\n    fn test_args_debug_format() {\n        let args = Args::parse_from(\u0026[\"test\"]);\n        let debug_str = format!(\"{:?}\", args);\n\n        assert!(debug_str.contains(\"Args\"));\n        assert!(debug_str.contains(\"127.0.0.1:50051\"));\n        assert!(debug_str.contains(\"info\"));\n    }\n\n    #[test]\n    fn test_init_tracing_valid_levels() {\n        // Test various valid log levels\n        let valid_levels = vec![\"trace\", \"debug\", \"info\", \"warn\", \"error\"];\n\n        for level in valid_levels {\n            // Note: We can't actually call init_tracing multiple times in tests\n            // because it would panic, so we just test the validation logic\n            let result = std::panic::catch_unwind(|| {\n                init_tracing(level)\n            });\n            // Should not panic for valid levels (though it may fail due to already initialized)\n            assert!(result.is_ok() || result.is_err()); // Either succeeds or fails gracefully\n        }\n    }\n\n    #[test]\n    fn test_init_tracing_invalid_level() {\n        let result = init_tracing(\"invalid_level\");\n        assert!(result.is_err());\n\n        let error_msg = result.unwrap_err().to_string();\n        assert!(error_msg.contains(\"Invalid log level\"));\n    }\n\n    #[test]\n    fn test_args_parser_help() {\n        // Test that the help text can be generated without panicking\n        let result = std::panic::catch_unwind(|| {\n            Args::parse_from(\u0026[\"test\", \"--help\"])\n        });\n        // Should panic with help message (this is expected behavior for --help)\n        assert!(result.is_err());\n    }\n\n    #[test]\n    fn test_args_with_ipv6_address() {\n        let args = Args::parse_from(\u0026[\n            \"test\",\n            \"-a\", \"[::1]:9090\"\n        ]);\n\n        assert_eq!(args.address.to_string(), \"[::1]:9090\");\n    }\n\n    #[test]\n    fn test_args_long_flags() {\n        let args = Args::parse_from(\u0026[\n            \"test\",\n            \"--address\", \"192.168.1.1:3000\",\n            \"--log-level\", \"debug\",\n            \"--enable-metrics\",\n            \"--daemon\",\n            \"--config\", \"/etc/daemon.yaml\"\n        ]);\n\n        assert_eq!(args.address.to_string(), \"192.168.1.1:3000\");\n        assert_eq!(args.log_level, \"debug\");\n        assert!(args.enable_metrics);\n        assert!(args.daemon);\n        assert_eq!(args.config.unwrap().to_string_lossy(), \"/etc/daemon.yaml\");\n    }\n\n    #[test]\n    fn test_args_mixed_flags() {\n        let args = Args::parse_from(\u0026[\n            \"test\",\n            \"-a\", \"0.0.0.0:8080\",\n            \"--log-level\", \"warn\",\n            \"--enable-metrics\"\n        ]);\n\n        assert_eq!(args.address.to_string(), \"0.0.0.0:8080\");\n        assert_eq!(args.log_level, \"warn\");\n        assert!(args.enable_metrics);\n        assert!(!args.daemon);\n    }\n\n    #[test]\n    fn test_args_version_flag() {\n        let result = std::panic::catch_unwind(|| {\n            Args::parse_from(\u0026[\"test\", \"--version\"])\n        });\n        // Should panic with version message (this is expected behavior for --version)\n        assert!(result.is_err());\n    }\n\n    #[test]\n    fn test_args_invalid_address() {\n        let result = std::panic::catch_unwind(|| {\n            Args::parse_from(\u0026[\"test\", \"-a\", \"invalid_address\"])\n        });\n        // Should panic due to invalid socket address format\n        assert!(result.is_err());\n    }\n\n    #[test]\n    fn test_args_invalid_port() {\n        let result = std::panic::catch_unwind(|| {\n            Args::parse_from(\u0026[\"test\", \"-a\", \"127.0.0.1:99999\"])\n        });\n        // Should panic due to invalid port number\n        assert!(result.is_err());\n    }\n\n    #[test]\n    fn test_args_empty_config_path() {\n        let args = Args::parse_from(\u0026[\n            \"test\",\n            \"--config\", \"\"\n        ]);\n\n        assert_eq!(args.config.unwrap().to_string_lossy(), \"\");\n    }\n\n    #[test]\n    fn test_args_relative_config_path() {\n        let args = Args::parse_from(\u0026[\n            \"test\",\n            \"--config\", \"./config.yaml\"\n        ]);\n\n        assert_eq!(args.config.unwrap().to_string_lossy(), \"./config.yaml\");\n    }\n\n    #[test]\n    fn test_args_all_log_levels() {\n        let log_levels = [\"trace\", \"debug\", \"info\", \"warn\", \"error\"];\n\n        for level in log_levels {\n            let args = Args::parse_from(\u0026[\n                \"test\",\n                \"--log-level\", level\n            ]);\n            assert_eq!(args.log_level, level);\n        }\n    }\n\n    #[test]\n    fn test_args_different_ports() {\n        let ports = [\"8080\", \"3000\", \"9090\", \"50051\"];\n\n        for port in ports {\n            let address = format!(\"127.0.0.1:{}\", port);\n            let args = Args::parse_from(\u0026[\n                \"test\",\n                \"-a\", \u0026address\n            ]);\n            assert_eq!(args.address.to_string(), address);\n        }\n    }\n\n    #[test]\n    fn test_args_different_hosts() {\n        let hosts = [\n            \"127.0.0.1:8080\",\n            \"0.0.0.0:8080\",\n            \"localhost:8080\",\n            \"[::]:8080\",\n            \"[::1]:8080\"\n        ];\n\n        for host in hosts {\n            let result = std::panic::catch_unwind(|| {\n                Args::parse_from(\u0026[\"test\", \"-a\", host])\n            });\n            // Some hosts may be valid, others may not be parseable\n            // We're just testing that the parser handles various formats\n            let _ = result;\n        }\n    }\n\n    #[test]\n    fn test_args_boolean_flags_combinations() {\n        // Test all combinations of boolean flags\n        let combinations = [\n            (false, false),\n            (true, false),\n            (false, true),\n            (true, true),\n        ];\n\n        for (enable_metrics, daemon) in combinations {\n            let mut cmd = vec![\"test\"];\n            if enable_metrics {\n                cmd.push(\"--enable-metrics\");\n            }\n            if daemon {\n                cmd.push(\"--daemon\");\n            }\n\n            let args = Args::parse_from(\u0026cmd);\n            assert_eq!(args.enable_metrics, enable_metrics);\n            assert_eq!(args.daemon, daemon);\n        }\n    }\n\n    #[test]\n    fn test_args_config_file_extensions() {\n        let extensions = [\n            \"config.yaml\",\n            \"config.yml\",\n            \"config.json\",\n            \"config.toml\",\n            \"config.conf\",\n            \"daemon.cfg\"\n        ];\n\n        for ext in extensions {\n            let args = Args::parse_from(\u0026[\n                \"test\",\n                \"--config\", ext\n            ]);\n            assert_eq!(args.config.unwrap().to_string_lossy(), ext);\n        }\n    }\n\n    #[test]\n    fn test_init_tracing_case_insensitive() {\n        let levels = [\"INFO\", \"Debug\", \"WARN\", \"error\", \"TRACE\"];\n\n        for level in levels {\n            let result = std::panic::catch_unwind(|| {\n                init_tracing(level)\n            });\n            // Should handle case v daemon::error::*;\n\n#[test]\nfn test_daemon_config_creation() {\n    let config = DaemonConfig::default();\n    assert_eq!(config.server.host, \"127.0.0.1\");\n    assert_eq!(config.server.port, 50051);\n    assert_eq!(config.database.max_connections, 10);\n    assert_eq!(config.qdrant.url, \"http://localhost:6333\");\n}\n\n#[test]\nfn test_server_config_creation() {\n    let config = ServerConfig {\n        host: \"0.0.0.0\".to_string(),\n        port: 8080,\n        max_connections: 500,\n        connection_timeout_secs: 60,\n        request_timeout_secs: 300,\n        enable_tls: true,\n    };\n\n    assert_eq!(config.host, \"0.0.0.0\");\n    assert_eq!(config.port, 8080);\n    assert!(config.enable_tls);\n}\n\n#[test]\nfn test_database_config_creation() {\n    let config = DatabaseConfig {\n        sqlite_path: \"/tmp/test.db\".to_string(),\n        max_connections: 20,\n        connection_timeout_secs: 45,\n        enable_wal: false,\n    };\n\n    assert_eq!(config.sqlite_path, \"/tmp/test.db\");\n    assert_eq!(config.max_connections, 20);\n    assert!(!config.enable_wal);\n}\n\n#[test]\nfn test_qdrant_config_creation() {\n    let collection_config = CollectionConfig {\n        vector_size: 768,\n        distance_metric: \"Euclidean\".to_string(),\n        enable_indexing: false,\n        replication_factor: 2,\n        shard_number: 3,\n    };\n\n    let config = QdrantConfig {\n        url: \"http://remote:6333\".to_string(),\n        api_key: Some(\"test-key\".to_string()),\n        timeout_secs: 60,\n        max_retries: 5,\n        default_collection: collection_config,\n    };\n\n    assert_eq!(config.url, \"http://remote:6333\");\n    assert_eq!(config.api_key, Some(\"test-key\".to_string()));\n    assert_eq!(config.max_retries, 5);\n    assert_eq!(config.default_collection.vector_size, 768);\n}\n\n#[test]\nfn test_processing_config_creation() {\n    let config = ProcessingConfig {\n        max_concurrent_tasks: 8,\n        default_chunk_size: 2000,\n        default_chunk_overlap: 400,\n        max_file_size_bytes: 200_000_000,\n        supported_extensions: vec![\"rs\".to_string(), \"py\".to_string()],\n        enable_lsp: false,\n        lsp_timeout_secs: 20,\n    };\n\n    assert_eq!(config.max_concurrent_tasks, 8);\n    assert_eq!(config.default_chunk_size, 2000);\n    assert!(!config.enable_lsp);\n    assert!(config.supported_extensions.contains(\u0026\"rs\".to_string()));\n}\n\n#[test]\nfn test_file_watcher_config_creation() {\n    let config = FileWatcherConfig {\n        enabled: true,\n        debounce_ms: 1000,\n        max_watched_dirs: 50,\n        ignore_patterns: vec![\"*.log\".to_string(), \"target/**\".to_string()],\n        recursive: false,\n    };\n\n    assert!(config.enabled);\n    assert_eq!(config.debounce_ms, 1000);\n    assert!(!config.recursive);\n    assert!(config.ignore_patterns.contains(\u0026\"*.log\".to_string()));\n}\n\n#[test]\nfn test_metrics_config_creation() {\n    let config = MetricsConfig {\n        enabled: false,\n        collection_interval_secs: 120,\n        retention_days: 60,\n        enable_prometheus: false,\n        prometheus_port: 9091,\n    };\n\n    assert!(!config.enabled);\n    assert_eq!(config.collection_interval_secs, 120);\n    assert_eq!(config.retention_days, 60);\n    assert!(!config.enable_prometheus);\n}\n\n#[test]\nfn test_logging_config_creation() {\n    let config = LoggingConfig {\n        level: \"debug\".to_string(),\n        file_path: Some(\"/custom/log.log\".to_string()),\n        json_format: true,\n        max_file_size_mb: 200,\n        max_files: 10,\n    };\n\n    assert_eq!(config.level, \"debug\");\n    assert_eq!(config.file_path, Some(\"/custom/log.log\".to_string()));\n    assert!(config.json_format);\n    assert_eq!(config.max_file_size_mb, 200);\n}\n\n#[test]\nfn test_config_validation_valid() {\n    let config = DaemonConfig::default();\n    assert!(config.validate().is_ok());\n}\n\n#[test]\nfn test_config_validation_invalid_port() {\n    let mut config = DaemonConfig::default();\n    config.server.port = 0;\n\n    let result = config.validate();\n    assert!(result.is_err());\n\n    match result {\n        Err(DaemonError::Config(_)) =\u003e {\n            // Expected error type\n        },\n        _ =\u003e panic!(\"Expected Config error for invalid port\"),\n    }\n}\n\n#[test]\nfn test_config_validation_empty_qdrant_url() {\n    let mut config = DaemonConfig::default();\n    config.qdrant.url = String::new();\n\n    let result = config.validate();\n    assert!(result.is_err());\n\n    match result {\n        Err(DaemonError::Config(_)) =\u003e {\n            // Expected error type\n        },\n        _ =\u003e panic!(\"Expected Config error for empty Qdrant URL\"),\n    }\n}\n\n#[test]\nfn test_config_validation_empty_database_path() {\n    let mut config = DaemonConfig::default();\n    config.database.sqlite_path = String::new();\n\n    let result = config.validate();\n    assert!(result.is_err());\n\n    match result {\n        Err(DaemonError::Config(_)) =\u003e {\n            // Expected error type\n        },\n        _ =\u003e panic!(\"Expected Config error for empty database path\"),\n    }\n}\n\n#[test]\nfn test_config_validation_zero_chunk_size() {\n    let mut config = DaemonConfig::default();\n    config.processing.default_chunk_size = 0;\n\n    let result = config.validate();\n    assert!(result.is_err());\n\n    match result {\n        Err(DaemonError::Config(_)) =\u003e {\n            // Expected error type\n        },\n        _ =\u003e panic!(\"Expected Config error for zero chunk size\"),\n    }\n}\n\n#[test]\nfn test_config_clone_debug() {\n    let config = DaemonConfig::default();\n    let cloned = config.clone();\n\n    assert_eq!(config.server.host, cloned.server.host);\n    assert_eq!(config.qdrant.url, cloned.qdrant.url);\n\n    // Test debug format\n    let debug_str = format!(\"{:?}\", config);\n    assert!(debug_str.contains(\"DaemonConfig\"));\n    assert!(debug_str.contains(\"ServerConfig\"));\n}\n\n#[test]\nfn test_collection_config_standalone() {\n    let collection_config = CollectionConfig {\n        vector_size: 768,\n        distance_metric: \"Dot\".to_string(),\n        enable_indexing: false,\n        replication_factor: 3,\n        shard_number: 2,\n    };\n\n    let debug_str = format!(\"{:?}\", collection_config);\n    assert!(debug_str.contains(\"CollectionConfig\"));\n    assert!(debug_str.contains(\"768\"));\n    assert!(debug_str.contains(\"Dot\"));\n\n    let cloned = collection_config.clone();\n    assert_eq!(collection_config.vector_size, cloned.vector_size);\n    assert_eq!(collection_config.distance_metric, cloned.distance_metric);\n}\n\n#[test]\nfn test_error_types() {\n    // Test that we can create different error types\n    let config_error = DaemonError::Config(\n        config::ConfigError::Message(\"Test config error\".to_string())\n    );\n\n    let io_error = DaemonError::Io(std::io::Error::new(\n        std::io::ErrorKind::NotFound,\n        \"Test IO error\"\n    ));\n\n    // Test that they can be formatted\n    let config_msg = format!(\"{}\", config_error);\n    assert!(config_msg.contains(\"Configuration error\"));\n\n    let io_msg = format!(\"{}\", io_error);\n    assert!(io_msg.contains(\"IO error\"));\n}\n\n#[test]\nfn test_config_structs_are_send_sync() {\n    fn assert_send_sync\u003cT: Send + Sync\u003e() {}\n\n    assert_send_sync::\u003cDaemonConfig\u003e();\n    assert_send_sync::\u003cServerConfig\u003e();\n    assert_send_sync::\u003cDatabaseConfig\u003e();\n    assert_send_sync::\u003cQdrantConfig\u003e();\n    assert_send_sync::\u003cCollectionConfig\u003e();\n    assert_send_sync::\u003cProcessingConfig\u003e();\n    assert_send_sync::\u003cFileWatcherConfig\u003e();\n    assert_send_sync::\u003cMetricsConfig\u003e();\n    assert_send_sync::\u003cLoggingConfig\u003e();\n}","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","tests","daemon_coverage.rs"],"content":"//! Additional test coverage for daemon modules\n//! Targeting daemon/core.rs, daemon/processing.rs, daemon/state.rs, daemon/watcher.rs\n\nuse workspace_qdrant_daemon::config::*;\nuse workspace_qdrant_daemon::daemon::core::*;\nuse workspace_qdrant_daemon::daemon::processing::*;\nuse workspace_qdrant_daemon::daemon::state::*;\nuse workspace_qdrant_daemon::daemon::watcher::*;\nuse std::sync::Arc;\nuse tempfile::TempDir;\nuse sqlx::Row;\n\n// ================================\n// DAEMON CORE TESTS\n// ================================\n\n#[test]\nfn test_daemon_core_initialization() {\n    let core = DaemonCore::new();\n    assert_eq!(std::mem::size_of::\u003cDaemonCore\u003e(), 0);\n\n    // Test debug representation\n    let debug_str = format!(\"{:?}\", core);\n    assert!(debug_str.contains(\"DaemonCore\"));\n}\n\n#[test]\nfn test_system_info_creation() {\n    let info = SystemInfo {\n        cpu_count: 8,\n        memory_total: 16 * 1024 * 1024 * 1024, // 16GB\n        hostname: \"test-machine\".to_string(),\n    };\n\n    assert_eq!(info.cpu_count, 8);\n    assert_eq!(info.memory_total, 16 * 1024 * 1024 * 1024);\n    assert_eq!(info.hostname, \"test-machine\");\n\n    // Test clone implementation\n    let cloned = info.clone();\n    assert_eq!(info.cpu_count, cloned.cpu_count);\n    assert_eq!(info.memory_total, cloned.memory_total);\n    assert_eq!(info.hostname, cloned.hostname);\n}\n\n#[test]\nfn test_system_info_debug_formatting() {\n    let info = SystemInfo {\n        cpu_count: 4,\n        memory_total: 8_000_000_000,\n        hostname: \"debug-host\".to_string(),\n    };\n\n    let debug_str = format!(\"{:?}\", info);\n    assert!(debug_str.contains(\"SystemInfo\"));\n    assert!(debug_str.contains(\"4\"));\n    assert!(debug_str.contains(\"8000000000\"));\n    assert!(debug_str.contains(\"debug-host\"));\n}\n\n#[test]\nfn test_get_system_info_success() {\n    let result = DaemonCore::get_system_info();\n    assert!(result.is_ok());\n\n    let info = result.unwrap();\n    assert!(info.cpu_count \u003e 0);\n    assert!(info.memory_total \u003e 0);\n    assert!(!info.hostname.is_empty());\n}\n\n// Note: get_total_memory is private, so we can't test it directly\n\n#[test]\nfn test_daemon_core_multiple_instances() {\n    let core1 = DaemonCore::new();\n    let core2 = DaemonCore::new();\n\n    // Both should be identical (unit struct)\n    assert_eq!(std::mem::size_of_val(\u0026core1), std::mem::size_of_val(\u0026core2));\n    assert_eq!(std::mem::size_of_val(\u0026core1), 0);\n}\n\n#[test]\nfn test_system_info_send_sync() {\n    fn assert_send\u003cT: Send\u003e() {}\n    fn assert_sync\u003cT: Sync\u003e() {}\n\n    assert_send::\u003cSystemInfo\u003e();\n    assert_sync::\u003cSystemInfo\u003e();\n}\n\n// ================================\n// DOCUMENT PROCESSOR TESTS\n// ================================\n\nfn create_test_configs() -\u003e (ProcessingConfig, QdrantConfig) {\n    let processing_config = ProcessingConfig {\n        max_concurrent_tasks: 3,\n        default_chunk_size: 1500,\n        default_chunk_overlap: 300,\n        max_file_size_bytes: 2 * 1024 * 1024,\n        supported_extensions: vec![\"txt\".to_string(), \"md\".to_string(), \"rs\".to_string()],\n        enable_lsp: true,\n        lsp_timeout_secs: 15,\n    };\n\n    let qdrant_config = QdrantConfig {\n        url: \"http://localhost:6333\".to_string(),\n        api_key: Some(\"test-api-key\".to_string()),\n        timeout_secs: 45,\n        max_retries: 5,\n        default_collection: CollectionConfig {\n            vector_size: 512,\n            distance_metric: \"Cosine\".to_string(),\n            enable_indexing: true,\n            replication_factor: 2,\n            shard_number: 2,\n        },\n    };\n\n    (processing_config, qdrant_config)\n}\n\nasync fn create_test_processor() -\u003e Arc\u003cDocumentProcessor\u003e {\n    let (processing_config, qdrant_config) = create_test_configs();\n    Arc::new(DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap())\n}\n\n#[tokio::test]\nasync fn test_document_processor_creation() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let result = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await;\n\n    assert!(result.is_ok());\n    let processor = result.unwrap();\n\n    assert_eq!(processor.config().max_concurrent_tasks, 3);\n    assert_eq!(processor.config().default_chunk_size, 1500);\n    assert_eq!(processor.config().default_chunk_overlap, 300);\n    assert_eq!(processor.config().max_file_size_bytes, 2 * 1024 * 1024);\n    assert!(processor.config().enable_lsp);\n    assert_eq!(processor.config().lsp_timeout_secs, 15);\n    assert_eq!(processor.config().supported_extensions.len(), 3);\n    assert!(processor.config().supported_extensions.contains(\u0026\"rs\".to_string()));\n}\n\n#[tokio::test]\nasync fn test_document_processor_config_values() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap();\n\n    // Test that config values match what we set\n    assert_eq!(processor.config().max_concurrent_tasks, 3);\n    assert_eq!(processor.config().default_chunk_size, 1500);\n    assert_eq!(processor.config().default_chunk_overlap, 300);\n    assert_eq!(processor.config().max_file_size_bytes, 2 * 1024 * 1024);\n    assert!(processor.config().enable_lsp);\n    assert_eq!(processor.config().lsp_timeout_secs, 15);\n    assert!(processor.config().supported_extensions.contains(\u0026\"txt\".to_string()));\n    assert!(processor.config().supported_extensions.contains(\u0026\"rs\".to_string()));\n}\n\n#[tokio::test]\nasync fn test_document_processor_debug_format() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap();\n\n    let debug_str = format!(\"{:?}\", processor);\n    assert!(debug_str.contains(\"DocumentProcessor\"));\n    assert!(!debug_str.is_empty());\n}\n\n#[tokio::test]\nasync fn test_document_processing_single_file() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap();\n\n    let result = processor.process_document(\"test_file.txt\").await;\n    assert!(result.is_ok());\n\n    let document_id = result.unwrap();\n    assert_eq!(document_id.len(), 36); // UUID v4 length\n    assert!(document_id.contains('-'));\n}\n\n#[tokio::test]\nasync fn test_document_processing_different_extensions() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap();\n\n    let test_files = vec![\n        \"document.txt\",\n        \"readme.md\",\n        \"script.rs\",\n        \"config.yaml\",\n        \"data.json\",\n    ];\n\n    for file in test_files {\n        let result = processor.process_document(file).await;\n        assert!(result.is_ok(), \"Failed to process file: {}\", file);\n\n        let document_id = result.unwrap();\n        assert_eq!(document_id.len(), 36);\n    }\n}\n\n#[tokio::test]\nasync fn test_document_processor_config_access() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap();\n\n    let config = processor.config();\n    assert_eq!(config.max_concurrent_tasks, 3);\n    assert!(config.supported_extensions.contains(\u0026\"txt\".to_string()));\n    assert!(config.enable_lsp);\n}\n\n// ================================\n// DAEMON STATE TESTS\n// ================================\n\nfn create_test_database_config() -\u003e DatabaseConfig {\n    DatabaseConfig {\n        sqlite_path: \"sqlite::memory:\".to_string(),\n        max_connections: 3,\n        connection_timeout_secs: 10,\n        enable_wal: false,\n    }\n}\n\n#[tokio::test]\nasync fn test_daemon_state_creation() {\n    let config = create_test_database_config();\n    let result = DaemonState::new(\u0026config).await;\n\n    assert!(result.is_ok());\n    let state = result.unwrap();\n\n    // Test debug formatting\n    let debug_str = format!(\"{:?}\", state);\n    assert!(debug_str.contains(\"DaemonState\"));\n}\n\n#[tokio::test]\nasync fn test_daemon_state_pool_access() {\n    let config = create_test_database_config();\n    let state = DaemonState::new(\u0026config).await.unwrap();\n\n    let pool = state.pool();\n    assert!(!pool.is_closed());\n}\n\n#[tokio::test]\nasync fn test_daemon_state_health_check() {\n    let config = create_test_database_config();\n    let state = DaemonState::new(\u0026config).await.unwrap();\n\n    let result = state.health_check().await;\n    assert!(result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_daemon_state_invalid_path() {\n    let config = DatabaseConfig {\n        sqlite_path: \"/invalid/nonexistent/path/test.db\".to_string(),\n        max_connections: 1,\n        connection_timeout_secs: 5,\n        enable_wal: false,\n    };\n\n    let result = DaemonState::new(\u0026config).await;\n    assert!(result.is_err());\n}\n\n#[tokio::test]\nasync fn test_daemon_state_migrations() {\n    let config = create_test_database_config();\n    let state = DaemonState::new(\u0026config).await.unwrap();\n\n    // Check that tables were created\n    let tables_query = \"SELECT name FROM sqlite_master WHERE type='table'\";\n    let rows = sqlx::query(tables_query)\n        .fetch_all(state.pool())\n        .await\n        .unwrap();\n\n    let table_names: Vec\u003cString\u003e = rows.iter()\n        .map(|row| row.get::\u003cString, _\u003e(\"name\"))\n        .collect();\n\n    assert!(table_names.contains(\u0026\"projects\".to_string()));\n    assert!(table_names.contains(\u0026\"collections\".to_string()));\n    assert!(table_names.contains(\u0026\"processing_operations\".to_string()));\n}\n\n#[tokio::test]\nasync fn test_daemon_state_multiple_instances() {\n    let config1 = create_test_database_config();\n    let config2 = create_test_database_config();\n\n    let state1 = DaemonState::new(\u0026config1).await.unwrap();\n    let state2 = DaemonState::new(\u0026config2).await.unwrap();\n\n    // Both should work independently\n    state1.health_check().await.unwrap();\n    state2.health_check().await.unwrap();\n}\n\n// ================================\n// FILE WATCHER TESTS\n// ================================\n\nfn create_test_watcher_config(enabled: bool) -\u003e FileWatcherConfig {\n    FileWatcherConfig {\n        enabled,\n        debounce_ms: 500,\n        max_watched_dirs: 20,\n        ignore_patterns: vec![\n            \"*.tmp\".to_string(),\n            \"*.log\".to_string(),\n            \"target/**\".to_string(),\n            \".git/**\".to_string(),\n        ],\n        recursive: true,\n    }\n}\n\n#[tokio::test]\nasync fn test_file_watcher_creation_enabled() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n\n    let result = FileWatcher::new(\u0026config, processor).await;\n    assert!(result.is_ok());\n\n    let _watcher = result.unwrap();\n    // Note: config fields are private, so we just test creation success\n}\n\n#[tokio::test]\nasync fn test_file_watcher_creation_disabled() {\n    let config = create_test_watcher_config(false);\n    let processor = create_test_processor().await;\n\n    let result = FileWatcher::new(\u0026config, processor).await;\n    assert!(result.is_ok());\n\n    let _watcher = result.unwrap();\n    // Note: config fields are private, so we just test creation success\n}\n\n#[tokio::test]\nasync fn test_file_watcher_start_enabled() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    let result = watcher.start().await;\n    assert!(result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_file_watcher_start_disabled() {\n    let config = create_test_watcher_config(false);\n    let processor = create_test_processor().await;\n    let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    let result = watcher.start().await;\n    assert!(result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_file_watcher_stop() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    watcher.start().await.unwrap();\n    let result = watcher.stop().await;\n    assert!(result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_file_watcher_directory_operations() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    let temp_dir = TempDir::new().unwrap();\n\n    // Test watching directory\n    let result = watcher.watch_directory(temp_dir.path()).await;\n    assert!(result.is_ok());\n\n    // Test unwatching directory\n    let result = watcher.unwatch_directory(temp_dir.path()).await;\n    assert!(result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_file_watcher_watch_string_path() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let mut watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    let result = watcher.watch_directory(\"/tmp\").await;\n    assert!(result.is_ok());\n\n    let result = watcher.unwatch_directory(\"/tmp\").await;\n    assert!(result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_file_watcher_debug_format() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    let debug_str = format!(\"{:?}\", watcher);\n    assert!(debug_str.contains(\"FileWatcher\"));\n    assert!(debug_str.contains(\"config\"));\n    assert!(debug_str.contains(\"processor\"));\n}\n\n#[tokio::test]\nasync fn test_file_watcher_processor_sharing() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let processor_clone = Arc::clone(\u0026processor);\n\n    let _watcher = FileWatcher::new(\u0026config, processor_clone).await.unwrap();\n\n    // Verify Arc sharing\n    assert!(Arc::strong_count(\u0026processor) \u003e= 2);\n}\n\n#[tokio::test]\nasync fn test_file_watcher_ignore_patterns() {\n    let mut config = create_test_watcher_config(true);\n    config.ignore_patterns = vec![\n        \"*.log\".to_string(),\n        \"node_modules/**\".to_string(),\n        \"*.tmp\".to_string(),\n    ];\n\n    let processor = create_test_processor().await;\n    let _watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    // Config fields are private, so we just test that creation succeeds with custom patterns\n    assert_eq!(config.ignore_patterns.len(), 3);\n    assert!(config.ignore_patterns.contains(\u0026\"*.log\".to_string()));\n    assert!(config.ignore_patterns.contains(\u0026\"node_modules/**\".to_string()));\n}\n\n#[tokio::test]\nasync fn test_file_watcher_multiple_start_stop() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let watcher = FileWatcher::new(\u0026config, processor).await.unwrap();\n\n    // Multiple start/stop cycles should work\n    for _ in 0..3 {\n        watcher.start().await.unwrap();\n        watcher.stop().await.unwrap();\n    }\n}\n\n#[test]\nfn test_file_watcher_send_sync() {\n    fn assert_send\u003cT: Send\u003e() {}\n    fn assert_sync\u003cT: Sync\u003e() {}\n\n    assert_send::\u003cFileWatcher\u003e();\n    assert_sync::\u003cFileWatcher\u003e();\n}\n\n// ================================\n// CROSS-MODULE INTEGRATION TESTS\n// ================================\n\n#[tokio::test]\nasync fn test_processor_and_state_integration() {\n    let (processing_config, qdrant_config) = create_test_configs();\n    let processor = DocumentProcessor::new(\u0026processing_config, \u0026qdrant_config).await.unwrap();\n\n    let db_config = create_test_database_config();\n    let state = DaemonState::new(\u0026db_config).await.unwrap();\n\n    // Both should be functional\n    let doc_result = processor.process_document(\"integration_test.txt\").await;\n    assert!(doc_result.is_ok());\n\n    let health_result = state.health_check().await;\n    assert!(health_result.is_ok());\n}\n\n#[tokio::test]\nasync fn test_watcher_and_processor_integration() {\n    let config = create_test_watcher_config(true);\n    let processor = create_test_processor().await;\n    let processor_clone = Arc::clone(\u0026processor);\n\n    let watcher = FileWatcher::new(\u0026config, processor_clone).await.unwrap();\n\n    // Both components should be functional\n    watcher.start().await.unwrap();\n\n    let doc_result = processor.process_document(\"watcher_test.txt\").await;\n    assert!(doc_result.is_ok());\n\n    watcher.stop().await.unwrap();\n}\n\n#[test]\nfn test_all_components_send_sync() {\n    fn assert_send\u003cT: Send\u003e() {}\n    fn assert_sync\u003cT: Sync\u003e() {}\n\n    // All main daemon components should be Send + Sync\n    assert_send::\u003cDaemonCore\u003e();\n    assert_sync::\u003cDaemonCore\u003e();\n    assert_send::\u003cSystemInfo\u003e();\n    assert_sync::\u003cSystemInfo\u003e();\n    assert_send::\u003cFileWatcher\u003e();\n    assert_sync::\u003cFileWatcher\u003e();\n}","traces":[],"covered":0,"coverable":0},{"path":["/","Users","chris","dev","ai","claude-code-cfg","mcp","workspace-qdrant-mcp","rust-engine-legacy","tests","functional","test_service_integration.rs"],"content":"use proptest::prelude::*;\nuse serial_test::serial;\nuse std::time::Duration;\nuse testcontainers::{clients, images, Container, Docker};\nuse tokio::time::sleep;\n\n/// Property-based test for document content validation\n#[cfg(test)]\nmod property_tests {\n    use super::*;\n\n    proptest! {\n        #[test]\n        fn test_document_content_properties(\n            content in \"\\\\PC{1,10000}\", // Any Unicode string 1-10k chars\n            metadata in prop::collection::hash_map(\"\\\\PC{1,100}\", \"\\\\PC{1,1000}\", 0..10)\n        ) {\n            // Property: processed content should never be empty if input isn't empty\n            if !content.is_empty() {\n                let processed = process_document_content(\u0026content);\n                prop_assert!(!processed.is_empty(), \"Processed content should not be empty\");\n            }\n\n            // Property: metadata keys should be preserved\n            let processed_metadata = process_metadata(metadata.clone());\n            for key in metadata.keys() {\n                prop_assert!(processed_metadata.contains_key(key), \"Metadata key should be preserved\");\n            }\n        }\n\n        #[test]\n        fn test_search_score_properties(\n            scores in prop::collection::vec(0.0f32..1.0f32, 1..100)\n        ) {\n            // Property: fusion scores should be in valid range\n            let fused_scores = reciprocal_rank_fusion(\u0026scores, \u0026scores);\n            for score in \u0026fused_scores {\n                prop_assert!(*score \u003e= 0.0, \"Fused score should be non-negative\");\n                prop_assert!(*score \u003c= 2.0, \"Fused score should not exceed reasonable bounds\");\n            }\n\n            // Property: number of results should be preserved\n            prop_assert_eq!(fused_scores.len(), scores.len(), \"Result count should be preserved\");\n        }\n    }\n\n    // Mock implementations for testing\n
